(28, 40, 2, 'Maid', NULL, 2009, NULL, '2013-02-20', NULL, NULL, 'Pen and Paper Rollenspiele und Singen', 'Rotkohl + Klöße, Yukimi Daifuko', 'Ich kann mich nicht entscheiden, weil es so viele leckere süße Sachen gibt >_< Auf jeden Fall ist Zuckerwatte ganz oben bei mir auf der Liste.', NULL, 'Ich wäre gerne Mew! Ich mag Mew sowieso, es ist süß, verspielt und es kann fliegen! =D Gibt es ein besseres Pokemon? Außerdem hat es Psychokräfte!', NULL, 'Das ist eine schwierige Frage! Früher hab ich mir immer Gewünscht in der Welt von Inuyasha leben zu können. Ich fand es so toll im feudalen Japan zu leben, in dem Dämonen und Geister existieren. Aber heute würde ich glaube ich gerne in der Welt von Pokemon oder One-piece leben. Die Vorstellung einfach seine Sachen zu packen und in die Welt zu ziehen finde ich total schön.', 'Ich denke ich wäre gerne Utena aus dem gleichnamigen Anime. Sie ist so stark und kämpft für ihre Überzeugungen und ihre Freunde und schafft es allem zu trotzen obwohl sie von ihren Feinden oft unterschätzt wird. Das finde ich bewundernswert', 'Entweder bei den Achterbahnen oder im Streichelzoo bei den Tieren! Auf keinen Fall würde man mich in der Nähe der Geisterbahn finden. Ich hab so Angst vor Geisterbahnen Q_Q', 'Ich würde mir wünschen das ich und meine Familie glücklich und zufrieden leben könnten. Eine Zuckerwattemaschine wäre bestimmt aber auch noch drin ;D', 'Was gibt es da zu erzählen? Ich bin offenherzig und erzähle gerne, kann aber auch gut zuhören. Ich mache gerne quatsch und ärger meine Freunde, kann aber auch ganz lieb und anhänglich sein >_< Ich denke mit mir kann man viel Spaß haben :-)', NULL, 0),
