(51, 48, 2, 'Maid', NULL, 2013, 'Da meine Schwester bereits zum Lucky Chocolate Maid Café gehört hat, habe ich des öfteren von ihrer Arbeit im Café und den Treffen mit den Maids gehört und gemerkt, dass sie mit Begeisterung dabei ist. Dann schlug sie mir vor, dass ich mich doch auch mal bewerben sollte. Ich war überrascht aber habe schnell gemerkt, dass mir dieser Gedanke gefiel (wer kann zu diesen Maids schon nein sagen?)! Zum Glück haben sie mich aufgenommen :3 Dieses super süße Team ist nämlich genau so umwerfend niedlich wie es mir beschrieben wurde!^^', '2014-01-24', 'Wassermann', NULL, 'Lesen, klettern, shoppen (am liebsten mit anderen süßen Mädels), kochen, backen und viiiieles mehr', 'Lasagne von Mama :3', 'Nimm 2 Soft (sooo weich, fruchtig und lecker...nomnom) =^.^= Aber auch Pfirsichringen und Lollies kann ich nicht wiederstehen...*pureLiebe*', 'Katzen  sind meine  absoluten Lieblingstiere, weil sie einfach wunderschön sind, mit mir kuscheln wenn es mir mal schlecht geht und trotzdem ihren eigenen Kopf haben. Sie bringen mich zum lachen wenn sie mal wieder tollpatschig von einem Regal fallen oder total begeistert hinter einer Fliege her rennen...außerdem sind sie einfach nur süß. <3', 'Bei soo vielen Pokemon kann ich mich nicht festlegen, weil mir einige gefallen. Eins steht aber fest. Ich wäre ein wildes, da die Freiheit dann für mich verlockender wäre als alles andere. :D', NULL, 'Ich könnte mich bei den ganzen tollen und außergewöhnlichen Welten nicht entscheiden! Am liebsten würde ich von einer Welt zur nächsten reisen :3', 'Ich wäre super gerne Yuuki Asuna, da sie  eine starke Person ist und mutig ihre Freunde beschützt. Ich würde auch gerne mit einem Schwert umgehen können. Zudem ist sie sehr hübsch und hat Kirito an ihrer Seite. <3 Und in der 2. virtuellen Welt kann fliegen was mein absoluter Traum ist. *o* ', 'Überall wo ich einen Adrenalinkick bekomme xD...also alles vom freien Fall bis zur Wildwasserbahn.', 'Meine geheimsten Wünsche verrate ich nicht^^'' Aber ein paar einfache Wünsche, die man sich selbst erfüllen kann habe ich auch...fragt mich doch beim nächsten Besuch unseres Cafés danach :3', 'Mein Name ist Lulu und ich bin eine quirlige, motivierte Maid. Ich hoffe gaaaanz viele glückliche Gesichter im Café bedienen zu dürfen. ^^', 'Apricot', 0),
