(59, 50, 2, 'Maid', NULL, 2013, 'Durch neugier, interesse an der Japanischen Kultur, spaß an Shootings, liebe zu süßen und leckeren Törtchen usw und letztendlich durch meine Freundin May ;) und ich bereue es kein bischen, da ich super tolle und nette Leute kennen gelernt habe mit denen man die gleichen Interessen teilen darf und das macht es um so schöner!', '1988-02-15', NULL, NULL, 'Cosplay und Bengalkatzen', 'ReisCurry', 'Eiscreme', 'Ich bin fasziniert von Katzen und damit meine ich nicht nur Hauskatzen sondern auch Wildkatzen z.B Geparden, Leoparden aber auch Löwen usw. Doch an erster Stelle steht bei mir die Bengalkatze. Ich besitze selber zwei von den Stubentigern und will Sie nicht mehr missen. Sie haben einen tollen Charakter und sind echt einzigartige Tiere. Sie lieben Wasser, reden viel und sind Energiebündel, die bis ins hohe Alter total verspielt sind. Ihre wilde Leopardenmusterung macht sie so faszinierend. Ganz toll finde ich auch Abessiner und Savannah Katzen.', 'Pikatchu, es ist frei und immer voller Energie geladen und so manch einem könnte ein Stromschlag mal nicht schaden xD', NULL, 'In einem Mix aus verschiedenen. Wichtig wäre mir Frieden und der schutz der Tiere, wo Mensch & Tier im einklang leben. Wo Kinder behutsam aufwachsen können und man noch Träume hat und die Welt nicht von Hass erfrüllt ist und Geld nicht die Welt regiert. Dort, wo wir die Welt nicht kaputt machen und die Natur geschätzt und respektiert wird. Und eine mit ganz viel Sonnenschein :)', 'Wer wäre denn nicht gerne eine Sailor Kriegerin im Kampf für die Gerechtigkeit?', 'Ich glaube überall *lach* an Spielbuden, Süssigkeitenstände und den größten und schnellsten Atraktionen. Wahrscheinlich aber an einem riesen Pferde Karussel, ich finde die altmodischen großen Karussels wunderschön und könnte sie stundenlang bewundern.', 'Natürlich mehr Wünsche, was soll der Geiz hehehe :DAber ich kann schonmal einen verraten, ich würde super gerne mal nach Japan! und ausserdem dort selbst mal in einem Maid Cafe bedient werden ^-^', 'Ich bin mit Anime & Manga groß geworden, deswegen cosplay ich gerne und fühle mich als Maid Pudel wohl :3. Ausserdem liebe ich den Gyaru Style! und die Lolita Mode ist ein Traum :)Ich liebe Tiere über alles und finde, dass man sich viel mehr für den Tierschutz einsetzen sollte.  Ganz besonders liebe ich meine Bengalkatzen Simba & Cira, sie sind alles für mich <3', 'Pink', 0),
