(77, 52, 2, 'Maid', NULL, 2013, 'Maid Café''s haben mir schon immer gut gefallen und ich wollte auch gerne mal in einem arbeiten.  Außerdem möchte ich viele neue Leute kennenlernen^^', '2013-04-04', NULL, NULL, 'Lolita tragen, Dolls sammeln und Konzerte besuchen.', 'Sushi, Pizza, Pasta und Spinat :3', 'Kuchen natürlich, am liebsten mit Erdbeeren! Und Macarons <3', 'Ich liebe Alpacas! Die sind sooo flauschig und süß und gucken immer so lieb und treudoof *-*', 'Togepi! Es ist immer fröhlich und süß <3', NULL, 'Ich glaube die Digiwelt wäre ganz cool^^', 'Sailor Venus! Sie ist einfach die coolste :D', 'Bei den gebratenen Champignons und den Schokofrüchten, die liiiebe ich <3', 'Ein Leben wie Marie Antoinette xD', 'Ich bin eine Backfee, denn ich liebe backen einfach!', NULL, 0),
