(79, 52, 4, 'Maid', NULL, 2013, 'Maid Café''s haben mir schon immer gut gefallen und ich wollte auch gerne mal in einem arbeiten.  Außerdem möchte ich viele neue Leute kennenlernen^^', '2013-04-04', NULL, NULL, 'Lolita tragen, Dolls sammeln und Konzerte besuchen.', 'Sushi, Pizza, Pasta und Spinat :3', 'Kuchen natürlich, am liebsten mit Erdbeeren! Und Macarons <3', 'Ich liebe Alpacas! Die sind sooo flauschig und süß und gucken immer so lieb und treudoof *-*', 'Togepi! Es ist immer fröhlich und süß <3', NULL, 'Ich glaube die Digiwelt wäre ganz cool^^', 'Sailor Venus! Sie ist einfach die coolste :D', 'Bei den gebratenen Champignons und den Schokofrüchten, die liiiebe ich <3', 'Ein Leben wie Marie Antoinette xD', 'Ich bin eine Backfee, denn ich liebe backen einfach!', NULL, 112),
(80, 53, 2, 'Maid', NULL, 2013, 'Weil ich Menschen so gerne mit tanzen/singen/spielen oder einfach nur einem netten Schwätzchen unterhalte. Und wo würde das besser gehen als in diesem Maid Café? Der Alltag ist schließlich ernst genug ;)', '2013-09-09', NULL, NULL, 'Cosplay, Singen, Zeichnen', 'Sushi & Obstsalat', 'Eiskonfekt :D', ' Ich denke das Faultier. Seine Augen sind so groß und die Gesichter sind so herzlich!!', 'Kaprador  und ich würde nur noch Platscher einsetzen ^.~ ', NULL, 'Ich wäre gerne die beste Freundin von Sawako (Kimi ni Todoke). Ich liebe dieses Mädchen, sie hat einen unglaublich reinen Charakter ^.^', 'Iva aus Karneval! Sie ist zwar kein typisches Magical Girl, aber ihre Fähigkeiten sind beneidenswert (sie kämpft mit Diamanten O.O)und sie geht für ihre Freunde durch´s Feuer. ', 'Auf den Freefalltowern oder auf den Themenfahrten', 'Gesundheit für meine Lieben. Und einmal mit einem antiken Römern oder Griechen unterhalten können & fragen, wie das Leben damals wirklich war!!', 'Ich bin leicht chaotisch, aber aufgeweckt. Ich liebe Singen und Lachen & möchte euch mit guter Laune anstecken :D Ich freue mich sehr darauf, euch demnächst bedienen zu dürfen ;P ', NULL, 0),
