(91, 40, 14, 'Maid', NULL, 2009, NULL, '2013-02-20', NULL, NULL, 'Pen and Paper Rollenspiele und Singen', 'Rotkohl + Klöße, Yukimi Daifuko', 'Ich kann mich nicht entscheiden, weil es so viele leckere süße Sachen gibt >_< Auf jeden Fall ist Zuckerwatte ganz oben bei mir auf der Liste.', NULL, 'Ich wäre gerne Mew! Ich mag Mew sowieso, es ist süß, verspielt und es kann fliegen! =D Gibt es ein besseres Pokemon? Außerdem hat es Psychokräfte!', NULL, 'Das ist eine schwierige Frage! Früher hab ich mir immer Gewünscht in der Welt von Inuyasha leben zu können. Ich fand es so toll im feudalen Japan zu leben, in dem Dämonen und Geister existieren. Aber heute würde ich glaube ich gerne in der Welt von Pokemon oder One-piece leben. Die Vorstellung einfach seine Sachen zu packen und in die Welt zu ziehen finde ich total schön.', 'Ich denke ich wäre gerne Utena aus dem gleichnamigen Anime. Sie ist so stark und kämpft für ihre Überzeugungen und ihre Freunde und schafft es allem zu trotzen obwohl sie von ihren Feinden oft unterschätzt wird. Das finde ich bewundernswert.', 'Entweder bei den Achterbahnen oder im Streichelzoo bei den Tieren! Auf keinen Fall würde man mich in der Nähe der Geisterbahn finden. Ich hab so Angst vor Geisterbahnen Q_Q', 'Ich würde mir wünschen das ich und meine Familie glücklich und zufrieden leben könnten. Eine Zuckerwattemaschine wäre bestimmt aber auch noch drin ;D', 'Was gibt es da zu erzählen? Ich bin offenherzig und erzähle gerne, kann aber auch gut zuhören. Ich mache gerne quatsch und ärger meine Freunde, kann aber auch ganz lieb und anhänglich sein >_< Ich denke mit mir kann man viel Spaß haben :-)', NULL, 112),
(92, 54, 2, 'Maid', NULL, 2012, 'Es fing alles an mit "Kaichou wa Maid-sama" ^-^ Wahhh~ wäre es toll, wenn es auch Maid Cafés in Deutschland gäbe und so entdeckte ich zufällig das "Lucky Chocolate Maid Café" ♥ Es wäre sicher lustig und aufregend, in einem süßen Kleid, von leckerem Kuchen umgeben, die Gäste mit Freude und Spaß anzustecken. Und ich bin überglücklich, durch meinen Job als Maid viele liebe und tolle Maids kennengelernt zu haben und zusammen Goshujin-sama & Ojou-sama ein Lächeln herbeizuzaubern ^.~', '2013-01-27', 'Wassermann', '164 cm', 'reisen, shopping, Fashion & Design, Musik, Animes & Mangas ♥', 'Pfannkuchen, Nudeln & Pasta~ Alles was lecker ist und mich satt macht xD', 'Kyaaah~ Süßigkeiten sind doch ALLE sooo lecker *^*', 'Katzen, Kaninchen, Schmetterlinge, Pinguine ^.^', 'Was für ein Pokémon wärst du und warum? Evoli ist mein absolutes Lieblingspokémon und seine Weiterentwicklungen sind alle so cool !!! Da denke ich, dass Feelinara/Sylveon am besten zu mir passt, da es auch überall Schleifen trägt ^.~', 'Kaichou wa Maid-sama, Pandora Hearts, Shingeki No Kyoujin Attack On Titan', '"Uta no Prince-sama"-Welt mit vielen gut aussehenden Jungs, die mir viele schöne Songs vorsingen *schwärm* xDDD', 'Mew Ichigo (von Tokyo Mew Mew) ^o^ In einem süzzen Café arbeiten, die Natur beschützen, gegen Aliens kämpfen (xD) und zwischendurch sich in eine Katze verwandeln *nya* =^.^=', 'Ich wäre überall zu finden bzw. zu suchen *haha* Achterbahnen, Karussells, Riesenrad und und und ~ bis hin an den Spielbuden, Süßigkeitenständen und und und ^.~', 'Hmmm~ Wünsche darf man doch nicht verraten, oder? Sonst gehen sie doch nicht in Erfüllung, ne ^.~ ', 'Ich bin die fröhliche Maid Aimi, die (große) Schleifen über alles liebt *^* Schau doch im "Lucky Chocolate Maid Café" vorbei und ich begrüße dich mit einem herzlichen "Okaerinasaimase" ^.~ ♥', 'violett', 0),
