(95, 56, 2, 'Maid', NULL, 2011, 'Ich habe 2010 zum ersten Mal eine Con besucht und es war die Dokomi. Aus Zufall heraus war ich auf einmal eine Helferin und konnte die con als Helferin und gast genießen. Später habe ich dann erfahren, dass das LC neue Maids sucht. Da die Con mich sofort überzeugt hat und die Idee als Maid zu arbeiten sehr gefallen hat, wollte ich es gerne ausprobieren.  ', '2013-07-08', NULL, NULL, 'Manga lesen, spazieren gehen, mit Freunden treffen', 'Dim Sum, Sushi, Wassermelone und Dorianfrucht xD ', 'CHOCOLATE ', 'Katze. Katzen sind äußerst unabhängige Tiere und doch wenn sie Zuneigung  haben wollen, stellen die sich so süß an, dass man sofort nachgeben muss und die einfach lieb haben muss. ', 'Plusel und Minum. Die kleinen Häschen sind frech und doch so putzig', NULL, 'One Piece. Ich liebe die verschiedenen Inseln die Oda Eiichiro sich einfallen lässt für die Abenteuer von Ruffy und co. Außerdem Frage ich mich wie es sich wohl anfühlen würde eine Teufelsfrucht zu essen und dann Special power zu haben ', 'Keins, egal wie sehr ich als kleines Kind Sailor Moon oder Doremi nachgespielt habe, würde ich mich nicht mit einer assoziieren, wenn dann andere Charaktere.', 'Achterbahn!!! Nichts ist besser als Achterbahn.', 'Ein wohl utopischer Wunsch, aber Weltfrieden wäre echt toll. Man sieht jeden Tag schlechte Nachrichten über Kriege jeder Art und es macht mich traurig mitzusehen wie unschuldige Zivilisten mit in den Kämpfen hineingezogen werden. ', 'Konichiwa Minna-san, ich bin manchmal etwas schüchtern, also seid bitte ganz lieb zu mir. Ich liebe süße und niedliche Gegenstände, bin eine große Katzenliebhaberin und habe gaaaaaaanz große Angst vor Spinnen. Hmm, das müsste reichen.', NULL, 0),
