(98, 57, 2, 'Maid', NULL, 2013, 'Durch einige Besuche in Maidcafés und durch die tolle Werbung von May habe ich mich entschieden auch eine Maid zu werden, da man so viele Leute kennen lernt und tolle Erfahrung macht ^_^', '2013-06-08', NULL, NULL, 'Lolita, zeichnen, backen', 'Nudelgerichte, Steak', 'Karamellwaffeln', 'Der Panda - super flauschig, putzig und frisst den halben Tag!', 'Da ich darauf keine Antwort wusste, habe ich meine beste Freundin gesagt. Sie meinte Myrapla würde gut zu mir passen :D', NULL, ' In der von Kilala Princess, weil ich die Disney Prinzessinnen liebe <3', ' Super Pig! Ein Schwein als Superheldin ist einfach cool :D', 'Wildwasserbahn', 'Noch mehr Wünsche ;P', 'Ich glaube durch den Steckbrief erfährt man schon einiges über mich. Ich liebe Lolita, es ist mein größtes Hobby. Was man vielleicht nicht direkt vermutet ist mein Musikgeschmack, denn ich höre bevorzugt Metalcore. Ebenso liebe ich Essen, ich bin vielleicht kein Gourmet aber zu einem leckeren Gericht sage ich eigentlich nicht nein ;) Abgesehen von Lolita und Maid bin ich Mediengestalterin und verdiene so mein Geld, was ich dann in tolle Kleider investiere ;D', NULL, 0),
