(107, 60, 2, 'Maid', NULL, 2013, 'Durch die Überredungskünste von Maid Jenny und Host Momo :D', '2013-11-19', NULL, NULL, ' Ich beschäftige mich am liebsten mit koreanischer Popmusik und ihren Choreografien', 'Viel zu viel was zur Auswahl steht um sich zu entscheiden >_<', 'Außer Vanilleeis nasche ich selten was :3', 'Ich mag keine Tiere >_<'''' Die beißen alle nur qq', 'Am liebsten wäre ich Pikachu. Es ist süß und liebenswert und wird oft in der Gegend herumgetragen <:', NULL, 'Ich denke, dass ich mich mit sehr vielen Welten anfreuden könnte. Ganz oben steht DeathNote, AngelBeats und Digimon', 'Jeanne die Kamikaze Diebin, weil Sie auch in den verzweifelten Situationen nicht den Kopf hängen lässt :)', 'An allen möglichen Achterbahnen und Essensständen <:', 'Wenn ich mir nicht noch mehr Wünsche wünchen dürfte, würde ich mir Lebensglück wünschen. Außerdem würde ich mir wünschen, dass ich nichts im Leben bereuen würde.', 'Mein Name ist Tecky und ich liebe es zu K-Pop zu tanzen! Ich hoffe, ich schaffe es Dir ein Lächeln ins Gesicht zu zaubern. <: ', 'Rosa', 0),
