(150, 40, 15, 'Maid', NULL, 2009, NULL, '2013-02-20', NULL, NULL, 'Pen and Paper Rollenspiele und Singen', 'Rotkohl + Klöße, Yukimi Daifuko', 'Ich kann mich nicht entscheiden, weil es so viele leckere süße Sachen gibt >_< Auf jeden Fall ist Zuckerwatte ganz oben bei mir auf der Liste.', NULL, 'Ich wäre gerne Mew! Ich mag Mew sowieso, es ist süß, verspielt und es kann fliegen! =D Gibt es ein besseres Pokemon? Außerdem hat es Psychokräfte!', NULL, 'Das ist eine schwierige Frage! Früher hab ich mir immer Gewünscht in der Welt von Inuyasha leben zu können. Ich fand es so toll im feudalen Japan zu leben, in dem Dämonen und Geister existieren. Aber heute würde ich glaube ich gerne in der Welt von Pokemon oder One-piece leben. Die Vorstellung einfach seine Sachen zu packen und in die Welt zu ziehen finde ich total schön.', 'Ich denke ich wäre gerne Utena aus dem gleichnamigen Anime. Sie ist so stark und kämpft für ihre Überzeugungen und ihre Freunde und schafft es allem zu trotzen obwohl sie von ihren Feinden oft unterschätzt wird. Das finde ich bewundernswert.', 'Entweder bei den Achterbahnen oder im Streichelzoo bei den Tieren! Auf keinen Fall würde man mich in der Nähe der Geisterbahn finden. Ich hab so Angst vor Geisterbahnen Q_Q', 'Ich würde mir wünschen das ich und meine Familie glücklich und zufrieden leben könnten. Eine Zuckerwattemaschine wäre bestimmt aber auch noch drin ;D', 'Was gibt es da zu erzählen? Ich bin offenherzig und erzähle gerne, kann aber auch gut zuhören. Ich mache gerne quatsch und ärger meine Freunde, kann aber auch ganz lieb und anhänglich sein >_< Ich denke mit mir kann man viel Spaß haben :-)', '#ffff01', 112),
(151, 46, 5, 'Maid', NULL, 2014, ' Ich liebe es zu Cosplayen und Maid zu sein erfüllt mich in meinem Hobby. es macht Spaß zu sehen wie glücklich die Kunden sind und die gemeinsame Arbeit wundervoll ist', '2013-10-16', NULL, NULL, ' Zeichnen, Tanzen, Videos machen & cosplay', 'Kuchen', 'Erdbeertörtchen', 'Mehrere, Wolf & weißer Lowe, (Katzen&Panda) Sie sind im Rudel und treu zu ihren kameraden, es sind schöne und stolze Tiere. weiße Löwen sind selten und stolz. wunderschöne Tiere', 'Pikachu, weil meine Freunde und Kollegen mich so nennen & immer treu ist', NULL, 'Chobits / Vampire Knight', 'Kagome ( Inuyasha ) weil sie immer versucht Ihre Freunde zu beschützen und stets an ihrer stärke arbeitet.', 'An den Ständen wo man Plüshis gewinnen kann ;)', 'Gesundheit für alle die ich liebe!', 'Hallo ich bin Lisa, bin gerne kreativ und liebe süßes und niedliche Tiere. aber wer auch nicht ? Ich freue mich auf euren Besuch <3', '#bf111b', 112),
(152, 47, 5, 'Maid', NULL, 2013, ' Es war eine spontane Entscheidung :)', '2013-08-10', NULL, NULL, 'Schlafen, Fotos machen und mit meiner Katze kuscheln *-*', 'Crêpe mit Kinderschokolade *-*', 'Schoki :3', 'Katzen sind so wundervoll, weil.. öhm .. ich habe schon immer Katzen geliebt :)', 'Pika Pika-chuuuu, weil es süß ist und das erste Pokemon war was ich knuffig fand :3', NULL, 'One Piece :3 ein Traumabenteuer :D', 'Ich würde sagen Ichigo aus Tokyo Mew Mew :3 einfach weil der Charakter mir etwas ähnlich ist und ich Katzen über alles liebe *^*', 'Auf der Wildwasser Achterbahn oder auf so Kleinkinder Karussells :D ', 'Man soll wünsche erst verraten wenn sie wahr geworden sind, ansonsten bringt das doch unheil, oder nicht? u.u', 'Ich bin Chooko und liebe Schokolade *-*. und mein Name Chooko ist absichtlich mit k geschrieben :D', '#309eaf', 112),
(153, 48, 5, 'Maid', NULL, 2013, 'Da meine Schwester bereits zum Lucky Chocolate Maid Café gehört hat, habe ich des öfteren von ihrer Arbeit im Café und den Treffen mit den Maids gehört und gemerkt, dass sie mit Begeisterung dabei ist. Dann schlug sie mir vor, dass ich mich doch auch mal bewerben sollte. Ich war überrascht aber habe schnell gemerkt, dass mir dieser Gedanke gefiel (wer kann zu diesen Maids schon nein sagen?)! Zum Glück haben sie mich aufgenommen :3 Dieses super süße Team ist nämlich genau so umwerfend niedlich wie es mir beschrieben wurde!^^', '2014-01-24', 'Wassermann', NULL, 'Lesen, klettern, shoppen (am liebsten mit anderen süßen Mädels), kochen, backen und viiiieles mehr', 'Lasagne von Mama :3', 'Nimm 2 Soft (sooo weich, fruchtig und lecker...nomnom) =^.^= Aber auch Pfirsichringen und Lollies kann ich nicht wiederstehen...*pureLiebe*', 'Katzen  sind meine  absoluten Lieblingstiere, weil sie einfach wunderschön sind, mit mir kuscheln wenn es mir mal schlecht geht und trotzdem ihren eigenen Kopf haben. Sie bringen mich zum lachen wenn sie mal wieder tollpatschig von einem Regal fallen oder total begeistert hinter einer Fliege her rennen...außerdem sind sie einfach nur süß. <3', 'Bei soo vielen Pokemon kann ich mich nicht festlegen, weil mir einige gefallen. Eins steht aber fest. Ich wäre ein wildes, da die Freiheit dann für mich verlockender wäre als alles andere. :D', NULL, 'Ich könnte mich bei den ganzen tollen und außergewöhnlichen Welten nicht entscheiden! Am liebsten würde ich von einer Welt zur nächsten reisen :3', 'Ich wäre super gerne Yuuki Asuna, da sie  eine starke Person ist und mutig ihre Freunde beschützt. Ich würde auch gerne mit einem Schwert umgehen können. Zudem ist sie sehr hübsch und hat Kirito an ihrer Seite. <3 Und in der 2. virtuellen Welt kann fliegen was mein absoluter Traum ist. *o* ', 'Überall wo ich einen Adrenalinkick bekomme xD...also alles vom freien Fall bis zur Wildwasserbahn.', 'Meine geheimsten Wünsche verrate ich nicht^^'' Aber ein paar einfache Wünsche, die man sich selbst erfüllen kann habe ich auch...fragt mich doch beim nächsten Besuch unseres Cafés danach :3', 'Mein Name ist Lulu und ich bin eine quirlige, motivierte Maid. Ich hoffe gaaaanz viele glückliche Gesichter im Café bedienen zu dürfen. ^^', '#fa8073', 112),
(154, 49, 5, 'Maid', NULL, 0, 'Ich bin Maid geworden um mich neu zu fordern, neue Leute kennen zu lernen und einfach nur Spaß zu haben :D', '1991-07-16', NULL, NULL, 'Cosplay, Showgruppe D.A.N.G.O, singen', 'Salat, thunfisch/lachs Onigiri, Pilze', 'Kinderpingui und HariboSpaghetti', 'Mein lieblings Landsäugetier bzw. Tiere sind Katzenartige. ich bin mit Katzen aufgewachsen und deswegen verrückt nach Vertreten der katzen Familie ^^ Mein Liebstes Meerestier ist der Orca. Ich hab früher sehr oft Free Willy geguckt und träume oft davon einmal mit einem Orca zu schwimmen :3', 'Ich wäre ein Nachtara  weil ich einfach ein Nachtmensch bin und Katzen und den Mond liebe oder ich wäre ein Ampharos, weil es einfach mein Lieblings Elektro-Pokémon ist welches ich, wenn es denn geht immer in meinem Team habe ^_^', NULL, 'Es gibt so viele tolle Welten o.o Digimon, Pokemon, Fairy Tail...', 'Da ist erstmal die frage wer jetz alles zum magical girl zählt aber blair aus soul eater oder erza scarlet aus fairy tail.', 'Überall und Nirgendwo am besten ist man hat meine Handynummer xD', 'Ich würde mir wünschen endlich meinen Traumberuf als Tierpflegerin ausüben zu können ^^', 'lustig, aufgeweckt, kontaktfreudig, kreativ, hilfsbereit', '#12b600', 112),
(155, 50, 5, 'Maid', NULL, 2013, 'Durch neugier, interesse an der Japanischen Kultur, spaß an Shootings, liebe zu süßen und leckeren Törtchen usw und letztendlich durch meine Freundin May ;) und ich bereue es kein bischen, da ich super tolle und nette Leute kennen gelernt habe mit denen man die gleichen Interessen teilen darf und das macht es um so schöner!', '1988-02-15', NULL, NULL, 'Cosplay und Bengalkatzen', 'ReisCurry', 'Eiscreme', 'Ich bin fasziniert von Katzen und damit meine ich nicht nur Hauskatzen sondern auch Wildkatzen z.B Geparden, Leoparden aber auch Löwen usw. Doch an erster Stelle steht bei mir die Bengalkatze. Ich besitze selber zwei von den Stubentigern und will Sie nicht mehr missen. Sie haben einen tollen Charakter und sind echt einzigartige Tiere. Sie lieben Wasser, reden viel und sind Energiebündel, die bis ins hohe Alter total verspielt sind. Ihre wilde Leopardenmusterung macht sie so faszinierend. Ganz toll finde ich auch Abessiner und Savannah Katzen.', 'Pikatchu, es ist frei und immer voller Energie geladen und so manch einem könnte ein Stromschlag mal nicht schaden xD', NULL, 'In einem Mix aus verschiedenen. Wichtig wäre mir Frieden und der schutz der Tiere, wo Mensch & Tier im einklang leben. Wo Kinder behutsam aufwachsen können und man noch Träume hat und die Welt nicht von Hass erfrüllt ist und Geld nicht die Welt regiert. Dort, wo wir die Welt nicht kaputt machen und die Natur geschätzt und respektiert wird. Und eine mit ganz viel Sonnenschein :)', 'Wer wäre denn nicht gerne eine Sailor Kriegerin im Kampf für die Gerechtigkeit?', 'Ich glaube überall *lach* an Spielbuden, Süssigkeitenstände und den größten und schnellsten Atraktionen. Wahrscheinlich aber an einem riesen Pferde Karussel, ich finde die altmodischen großen Karussels wunderschön und könnte sie stundenlang bewundern.', 'Natürlich mehr Wünsche, was soll der Geiz hehehe :DAber ich kann schonmal einen verraten, ich würde super gerne mal nach Japan! und ausserdem dort selbst mal in einem Maid Cafe bedient werden ^-^', 'Ich bin mit Anime & Manga groß geworden, deswegen cosplay ich gerne und fühle mich als Maid Pudel wohl :3. Ausserdem liebe ich den Gyaru Style! und die Lolita Mode ist ein Traum :)Ich liebe Tiere über alles und finde, dass man sich viel mehr für den Tierschutz einsetzen sollte.  Ganz besonders liebe ich meine Bengalkatzen Simba & Cira, sie sind alles für mich <3', '#ff0d86', 112),
(156, 51, 5, 'Maid', NULL, 2014, 'Mir gefallen die Outfits. Zudem mag ich es den gleichen Stil in einer Gruppe zu tragen (z.B. auch Cosplay und Gothic Lolita).', '2015-12-31', NULL, NULL, 'Zeichnen, Lesen, Fotografieren', 'Nudeln aller Art, Süßes', 'Schokolade!', ' Hühner! Hühner sind einfach so cool und liebenswert, oftmals auch sehr belustigend (Ich habe selbst Zwerghühnchen). Ich mag aber auch Katzen sehr gerne.', 'Ein Lugia! Ich mag Vögel sehr gerne. Zudem ist Lugia ein eleganter Flieger... und Fliegen würde ich auch gerne können :)', NULL, 'Das ist eine sehr schwere Frage... Es gibt so viele tolle Welten. Im Moment würde ich sagen in der ''Attack on Titan'' Welt, da ich ein großer Fan von Fachwerkhäusern bin und das derzeit auch meine Lieblingsserie ist. Ansonsten gefällt mir die Welt von ''Ao no Exorcist'' sehr gut, da ich den Campus und die Uniformen super finde.', 'Momoko Asuka von Doremi. Ich liebe einfach ihren lebhaften Charakter! Da ich ein eher zurückhaltender Mensch bin, wünsche ich mir manchmal etwas von ihrer lustigen und positiven Art ;)', 'Bei der nicht ganz so schnellen Achterbahn', 'Dass die Menschen mehr Rücksicht auf andere nehmen und mehr Toleranz zeigen würden.', 'Ich bin Fotografen Auszubildenende, liebe Tiere und Manga/Anime. Ich wirke auf die meisten ruhig und zurückhaltend, bin aber ein sehr aufgeschlossener Mensch.', '#f5ac81', 112),
(157, 52, 5, 'Maid', NULL, 2013, 'Maid Café''s haben mir schon immer gut gefallen und ich wollte auch gerne mal in einem arbeiten.  Außerdem möchte ich viele neue Leute kennenlernen^^', '2013-04-04', NULL, NULL, 'Lolita tragen, Dolls sammeln und Konzerte besuchen.', 'Sushi, Pizza, Pasta und Spinat :3', 'Kuchen natürlich, am liebsten mit Erdbeeren! Und Macarons <3', 'Ich liebe Alpacas! Die sind sooo flauschig und süß und gucken immer so lieb und treudoof *-*', 'Togepi! Es ist immer fröhlich und süß <3', NULL, 'Ich glaube die Digiwelt wäre ganz cool^^', 'Sailor Venus! Sie ist einfach die coolste :D', 'Bei den gebratenen Champignons und den Schokofrüchten, die liiiebe ich <3', 'Ein Leben wie Marie Antoinette xD', 'Ich bin eine Backfee, denn ich liebe backen einfach!', '#79d5ac', 112),
(158, 53, 5, 'Maid', NULL, 2013, 'Weil ich Menschen so gerne mit tanzen/singen/spielen oder einfach nur einem netten Schwätzchen unterhalte. Und wo würde das besser gehen als in diesem Maid Café? Der Alltag ist schließlich ernst genug ;)', '2013-09-09', NULL, NULL, 'Cosplay, Singen, Zeichnen', 'Sushi & Obstsalat', 'Eiskonfekt :D', ' Ich denke das Faultier. Seine Augen sind so groß und die Gesichter sind so herzlich!!', 'Kaprador  und ich würde nur noch Platscher einsetzen ^.~ ', NULL, 'Ich wäre gerne die beste Freundin von Sawako (Kimi ni Todoke). Ich liebe dieses Mädchen, sie hat einen unglaublich reinen Charakter ^.^', 'Iva aus Karneval! Sie ist zwar kein typisches Magical Girl, aber ihre Fähigkeiten sind beneidenswert (sie kämpft mit Diamanten O.O)und sie geht für ihre Freunde durch´s Feuer. ', 'Auf den Freefalltowern oder auf den Themenfahrten', 'Gesundheit für meine Lieben. Und einmal mit einem antiken Römern oder Griechen unterhalten können & fragen, wie das Leben damals wirklich war!!', 'Ich bin leicht chaotisch, aber aufgeweckt. Ich liebe Singen und Lachen & möchte euch mit guter Laune anstecken :D Ich freue mich sehr darauf, euch demnächst bedienen zu dürfen ;P ', '#ff7f50', 112),
(159, 54, 5, 'Maid', NULL, 2012, 'Es fing alles an mit "Kaichou wa Maid-sama" ^-^ Wahhh~ wäre es toll, wenn es auch Maid Cafés in Deutschland gäbe und so entdeckte ich zufällig das "Lucky Chocolate Maid Café" ♥ Es wäre sicher lustig und aufregend, in einem süßen Kleid, von leckerem Kuchen umgeben, die Gäste mit Freude und Spaß anzustecken. Und ich bin überglücklich, durch meinen Job als Maid viele liebe und tolle Maids kennengelernt zu haben und zusammen Goshujin-sama & Ojou-sama ein Lächeln herbeizuzaubern ^.~', '2013-01-27', 'Wassermann', '164 cm', 'reisen, shopping, Fashion & Design, Musik, Animes & Mangas ♥', 'Pfannkuchen, Nudeln & Pasta~ Alles was lecker ist und mich satt macht xD', 'Kyaaah~ Süßigkeiten sind doch ALLE sooo lecker *^*', 'Katzen, Kaninchen, Schmetterlinge, Pinguine ^.^', 'Was für ein Pokémon wärst du und warum? Evoli ist mein absolutes Lieblingspokémon und seine Weiterentwicklungen sind alle so cool !!! Da denke ich, dass Feelinara/Sylveon am besten zu mir passt, da es auch überall Schleifen trägt ^.~', 'Kaichou wa Maid-sama, Pandora Hearts, Shingeki No Kyoujin Attack On Titan', '"Uta no Prince-sama"-Welt mit vielen gut aussehenden Jungs, die mir viele schöne Songs vorsingen *schwärm* xDDD', 'Mew Ichigo (von Tokyo Mew Mew) ^o^ In einem süzzen Café arbeiten, die Natur beschützen, gegen Aliens kämpfen (xD) und zwischendurch sich in eine Katze verwandeln *nya* =^.^=', 'Ich wäre überall zu finden bzw. zu suchen *haha* Achterbahnen, Karussells, Riesenrad und und und ~ bis hin an den Spielbuden, Süßigkeitenständen und und und ^.~', 'Hmmm~ Wünsche darf man doch nicht verraten, oder? Sonst gehen sie doch nicht in Erfüllung, ne ^.~ ', 'Ich bin die fröhliche Maid Aimi, die (große) Schleifen über alles liebt *^* Schau doch im "Lucky Chocolate Maid Café" vorbei und ich begrüße dich mit einem herzlichen "Okaerinasaimase" ^.~ ♥', '#921a7e', 112),
(160, 56, 5, 'Maid', NULL, 2011, 'Ich habe 2010 zum ersten Mal eine Con besucht und es war die Dokomi. Aus Zufall heraus war ich auf einmal eine Helferin und konnte die con als Helferin und gast genießen. Später habe ich dann erfahren, dass das LC neue Maids sucht. Da die Con mich sofort überzeugt hat und die Idee als Maid zu arbeiten sehr gefallen hat, wollte ich es gerne ausprobieren.  ', '2013-07-08', NULL, NULL, 'Manga lesen, spazieren gehen, mit Freunden treffen', 'Dim Sum, Sushi, Wassermelone und Dorianfrucht xD ', 'CHOCOLATE ', 'Katze. Katzen sind äußerst unabhängige Tiere und doch wenn sie Zuneigung  haben wollen, stellen die sich so süß an, dass man sofort nachgeben muss und die einfach lieb haben muss. ', 'Plusel und Minum. Die kleinen Häschen sind frech und doch so putzig', NULL, 'One Piece. Ich liebe die verschiedenen Inseln die Oda Eiichiro sich einfallen lässt für die Abenteuer von Ruffy und co. Außerdem Frage ich mich wie es sich wohl anfühlen würde eine Teufelsfrucht zu essen und dann Special power zu haben ', 'Keins, egal wie sehr ich als kleines Kind Sailor Moon oder Doremi nachgespielt habe, würde ich mich nicht mit einer assoziieren, wenn dann andere Charaktere.', 'Achterbahn!!! Nichts ist besser als Achterbahn.', 'Ein wohl utopischer Wunsch, aber Weltfrieden wäre echt toll. Man sieht jeden Tag schlechte Nachrichten über Kriege jeder Art und es macht mich traurig mitzusehen wie unschuldige Zivilisten mit in den Kämpfen hineingezogen werden. ', 'Konichiwa Minna-san, ich bin manchmal etwas schüchtern, also seid bitte ganz lieb zu mir. Ich liebe süße und niedliche Gegenstände, bin eine große Katzenliebhaberin und habe gaaaaaaanz große Angst vor Spinnen. Hmm, das müsste reichen.', '#9ec9f3', 112),
(161, 57, 5, 'Maid', NULL, 2013, 'Durch einige Besuche in Maidcafés und durch die tolle Werbung von May habe ich mich entschieden auch eine Maid zu werden, da man so viele Leute kennen lernt und tolle Erfahrung macht ^_^', '2013-06-08', NULL, NULL, 'Lolita, zeichnen, backen', 'Nudelgerichte, Steak', 'Karamellwaffeln', 'Der Panda - super flauschig, putzig und frisst den halben Tag!', 'Da ich darauf keine Antwort wusste, habe ich meine beste Freundin gesagt. Sie meinte Myrapla würde gut zu mir passen :D', NULL, ' In der von Kilala Princess, weil ich die Disney Prinzessinnen liebe <3', ' Super Pig! Ein Schwein als Superheldin ist einfach cool :D', 'Wildwasserbahn', 'Noch mehr Wünsche ;P', 'Ich glaube durch den Steckbrief erfährt man schon einiges über mich. Ich liebe Lolita, es ist mein größtes Hobby. Was man vielleicht nicht direkt vermutet ist mein Musikgeschmack, denn ich höre bevorzugt Metalcore. Ebenso liebe ich Essen, ich bin vielleicht kein Gourmet aber zu einem leckeren Gericht sage ich eigentlich nicht nein ;) Abgesehen von Lolita und Maid bin ich Mediengestalterin und verdiene so mein Geld, was ich dann in tolle Kleider investiere ;D', '#ccd4d4', 112);
INSERT INTO `maid_versions` (`ID`, `RecordID`, `Version`, `Type`, `colour`, `since`, `maidreason`, `BDay`, `zodiac`, `size`, `hobbys`, `favfood`, `favsweet`, `favanimal`, `pokemon`, `anime`, `animelocation`, `magicalgirl`, `funfairlocation`, `wish`, `aboutme`, `mcolour`, `maidphotoID`) VALUES
(162, 58, 5, 'Maid', NULL, 2012, 'Einer süße Idee, die mir vorgeschlagen wurde und ich konnte nicht widerstehen =)', '2013-01-27', NULL, NULL, 'tanzen, shoppen, reisen, feiern, lesen', 'Marmorkuchen, Erdbeeren', 'Schokokekse', 'Schildkröten sind die Ruhe selbst =) und Babyschildkröten sind einfach zuckersüß <3', 'Relaxo...ich liebe es zu schlafen', NULL, NULL, NULL, 'Irgendwo auf einer Achterbahn', 'Alles Glück dieser Welt für die Liebsten', 'Ein Tag ohne lächeln ist ein verlorener Tag...nach diesem Motto lebe ich.', '#609ce2', 112),
(163, 59, 5, 'Maid', NULL, 2010, 'Weil ich was neues ausprobieren wollte… vorher war ich nichtmal aktiv in der Cosplayszene dabei, aber es hat mich einfach interessiert, wie es ist Maid zu sein. Vorallem aber weil die ersten Maids, die ich jemals gesehen habe, so hübsch aussahen. Ich wollte auch so aussehen wie die <3', '2013-09-04', NULL, NULL, 'Architektur, Singen, Essen, Schlafen', 'Sushi, Bulgogi, Bibimbap, Maid Umi''s Kochkünste, Ramen, … zu viel um es eigentlich aufzuzählen <3', 'Ach, ich mag sooo vieles~ Da kann man ich mich echt nicht entscheiden, was ich am aller aller liebsten mag... Aber Pfirsichringe sind schon pure Liebe~ Oder Cakepops mit Milchschokoladenüberzug mit Pfirsichgeschmack <3', 'Alles was fett, süß und flauschig ist… meine Kuscheltiere!', 'Relaxo!! -> essen, schlafen, essen, schlafen~ Was für ein Leben~', NULL, 'In der Gundam (00) Welt, aber bitte ohne Krieg... weil die Technik da ist schon extremst <3 :DD Dann will ich meinen eigenen Gundam haben! Oha, wenn ich den steuern könnte :x...', 'Sakura aus Cardcaptor Sakura, weil sie so viele tolle Sachen mit ihren Tarotkarten machen kann, weil sie verdammt süße Kleider hat UND weil ich dann Kero an meiner Seite hätte!', 'Auf dem Riesenkarussel mit einer Zuckerwatte in der Hand ?', 'Doraemon´s Tasche!! Dann könnte ich mir seine Dinge mal kurz "borgen" /DD Vorallem seine Überallhin-Tür wäre verdammt praktisch~', NULL, '#cd0000', 112),
(164, 60, 5, 'Maid', NULL, 2013, 'Durch die Überredungskünste von Maid Jenny und Host Momo :D', '2013-11-19', NULL, NULL, ' Ich beschäftige mich am liebsten mit koreanischer Popmusik und ihren Choreografien', 'Viel zu viel was zur Auswahl steht um sich zu entscheiden >_<', 'Außer Vanilleeis nasche ich selten was :3', 'Ich mag keine Tiere >_<'''' Die beißen alle nur qq', 'Am liebsten wäre ich Pikachu. Es ist süß und liebenswert und wird oft in der Gegend herumgetragen <:', NULL, 'Ich denke, dass ich mich mit sehr vielen Welten anfreuden könnte. Ganz oben steht DeathNote, AngelBeats und Digimon', 'Jeanne die Kamikaze Diebin, weil Sie auch in den verzweifelten Situationen nicht den Kopf hängen lässt :)', 'An allen möglichen Achterbahnen und Essensständen <:', 'Wenn ich mir nicht noch mehr Wünsche wünchen dürfte, würde ich mir Lebensglück wünschen. Außerdem würde ich mir wünschen, dass ich nichts im Leben bereuen würde.', 'Mein Name ist Tecky und ich liebe es zu K-Pop zu tanzen! Ich hoffe, ich schaffe es Dir ein Lächeln ins Gesicht zu zaubern. <: ', '#f5c0c8', 112),
(165, 61, 5, 'Maid', NULL, 2013, 'Weil es mein Wille war! :D <3 ach quatsch :) ich finde die Idee total super und es ist eine hübsche Arbeit :* spaß macht es auch :) es war eine gute Entscheidung <3', '2013-10-09', NULL, NULL, 'tanzen, joggen ;D', 'Milchreis <3', ' Jogurette <3', 'Hamster! Ich hatte den stärksten, besten und schlausten! Außerdem brachte die Serie "Hamtaro" mich durch dir Kindheit :D', 'Espeon! Weil... PINK, elegant, schön und geheimnisvoll <3', NULL, 'Card captor sakura <3 Clamp schafft so großartige welten :)', 'Ui ui ui <3 es MUSS aus Tokyo mew mew sein <3 und meine Wahl fällt auf Zakuro <3 schade dass ich so eine Grinsebacke bin und niemals so schön ernst aussehen werde wie sie D: aber sie ist eine wunderschöne und interessante Persönlichkeit v.v und so perfekt selbstbewusst :D so muss eine Frau sein!', 'Achterbahn und Shows! Jedoch weit entfernt von der Wasserbahn :DD', 'hm... persönlich :) aber es wäre was typisches und schönes :) -> Veränderung ', ' aufnahmefähig, motiviert und aktiv :D ', '#ff6db8', 112),
(166, 62, 5, 'Maid', NULL, 2013, NULL, '2013-09-27', NULL, NULL, 'lesen,zeichnen,backen,fotografieren und Filme gücken ( am liebsten von Mavel *-*)', '​Thai Curry und alles mit Melonengeschmack *^*', 'Marshmallows, Melonen Bonbons und Schokokekse <3', NULL, 'ein Cherubi weil es rosa und flauschig aussieht ', NULL, ':3 da könnt ich mich garnicht entscheiden..  Aber ich denke in der Welt von clamp würd ich mich sehr wohl fühlen. ', 'Sakura aus Card Captor Sakura, weil sie immer freundlich und hilfsbereit ist aber sich dabei nicht unterkriegen lässt.  Außerdem trägt sie immer sooo niedliche Outfits ^^', 'auf dem Riesenrad, weil man von dort den ganzen Park überblicken kann  und bei den Süßigkeitenständen *__*', 'das ich alles was ich schaffen will auch erreichen kann und das es allen gut geht die ich liebe', 'Aloha ich  bin Yui,  leicht verplant aber immer fröhlich und versuche immer mein Bestes zugeben. Kreativität ist für mich das wichtigste und so erhält bei mir auch jeder Kuchen seinen eigenen Yui-Stempel :3 Auch bin ich sehr glücklich ein teil dieses süßen Maid Cafes zusein <3', '#ffcf9e', 112),
(167, 63, 5, 'Maid', NULL, 0, NULL, '1996-01-28', NULL, NULL, 'Backen, Schwimmen gehen,zocken', 'Ich liebe alles an essen :D', 'alles was aus Schokolade besteht . Ob Tafelschokolade,Torte,Kuchen, Kekse, Eis ...mhh lecker !', 'PANDAS! Groß, flauschig, süß und ihr schwarz weißes aussehen maxht sie einzigartig *-*', 'Schiggi ! Es war schon immer meine Erstwahl es ist lustig,süß und wird groß und stark !', NULL, 'Dragonball! Wie toll einfach wäre ein super sayajin zu sein . Fliegen können und übermenschliche Kräfte zu haben~', 'Ich glaube Doremi (aus DoReMi) würde am besten zu mir passen. Sie ist immer fröhlich und leicht tollpatschig.', 'Natürlich an den Achterbahnen, Wildwasserbahnen eigentlich überall wo es Adrenalin-kick gibt !', 'Von der Fee würde ich mir eine Weltreise wünschen , mal alles sehen und überall Fotos machen.', 'ich bin Aiko  Immer fröhlich und ich liebe essen :3', '#cb5561', 112),
(168, 64, 5, 'Maid', NULL, 2011, ' Ich liebe Süßigkeiten und ich fand die Kleider immer schon so schön. Ich liebe es Menschen eine Freude zu machen, und ihnen den Tag mit ein bisschen Entertainment und Kuchen zu versüßen :3', '2013-06-09', NULL, NULL, ' singen,tanzen,malen und Süßigkeiten essen :3', ' Erdbeertorteeeeeeee ^o^', ' rote und grüne Gummibärchen', ' Panda, Katze, Schildkröte, Pinguin … >.<  Ich hab so viel Lieblingstiere, weil sie alle sooo süß sind auf ihre Art und Weise.', ' Ein Celebi dann kann ich durch die Zeit reisen', NULL, ' Ich finde die Welt in der ich lebe am besten, die ist schon fast wie in einen Anime XD', ' Ichigo aus Tokio MewMew, sie kann sich in eine Katze verwandeln :3 das will ich auch können', ' Auf der schnellsten Achterbahn', ' Ich würde mir noch mehr Wünsche wünschen, um die vielen Wünsche zu erfüllen die ich habe', ' Bin nicht groß >.< aber hab ein gaaaaaanz großes Herz ', '#02b5dd', 112),
(169, 65, 7, 'Maid', NULL, 2013, 'Ich wollte schon immer mal eine werden , weil ich Maids süß finde', '1992-02-10', NULL, NULL, 'Cosplayen, Freunde treffen, Mangas lesen,  Animes schauen, "Zocken" wenn man das mal so schreiben kann XD ', 'Sushi <3', 'Ich esse viele süße Sachen gerne und kann mich nicht entscheiden x.x', 'der Wolf, weil er für mich eine persönliche bedeutung hat ^-^', ' Mew <3 <3 Weil es ist klein, rosa und so mega süß *Q*', NULL, ' In zu vielen haha einmal: Elfenlied, Witchblade,  Gantz, Highschool Of The Dead, Shingeki No Kyojin, Hellsing, Najica, Dears und und und <3', 'Keins  ', ' Ich glaube ich wäre da wo sich die meisten nicht rein trauen, also bei den schnellen und hohen Sachen ', 'Hmm ich glaube ich würde mir wünschen, dass ich zaubern kann ^-^', 'uff da könnte ich nun viel schreiben, aber um es zu verkürzen: ich bin klein, verrückt, lieb und manchmal eine kleine Chaotin   ', '#cbf8e3', 112),
(170, 66, 6, 'Maid', NULL, 2013, 'Ich liebe es Menschen ein Lächeln aufs Gesicht zu zaubern, und das kann man als Maid am besten :3', '2013-03-09', NULL, NULL, ' zeichnen, online spiele / allgemein spiele, Fotos und Videos machen :3', 'Pizza *-*', 'Oreo Kekse *-*', 'Ich habe kein wirkliches Lieblings Tier, aber viele die ich süß finde, Katzen, Wölfe und Chinchillas und viele mehr :)', 'ich wäre wahrscheinlich Blitza, ich liebe den Blitz und Donner über alles :)', 'Batman', 'In der Batman Welt *-*', 'ich wäre Bunny aus Sailor Moon, sie ist schusselig aber wenn es drauf ankommt ist sie mit dem Herzen dabei <3', 'auf der Achterbahn, ich liebe die Aktion ! :) ', 'Das die Batman Welt, mit all ihren Schurken und Helden existiert *-* für manche ein Chaos für mich ein Traum ;)', 'Hallo, mein Name ist Honey :) Ich liebe onlinespiele und die  Dc Comic Welten. Ich liebe es Leute glücklich zu machen, ich hoffe ich kann auch euch ein Lächeln aufs Gesicht zaubern ;3', '#660066', 112),
(171, 67, 5, 'Organisator', NULL, 2012, 'Weil ich es schön finde, Leute zu Entertainen, süße Maidkleider zu tragen und neue Leute kennen zu lernen. Es macht mir viel Spaß zu sehen, wie sich die Gäste an unseren süßen Sachen erfreuen. Ich zaubere gerne jedem ein Lächeln ins Gesicht :3 Und nur ein zufriedener Kunde ist ein guter Kunde <3', '1990-11-16', NULL, NULL, 'Lolita Mode tragen, Shootings, shoppen, tanzen, Filme gucken, feiern gehen, mit Freunden treffen', 'Kaage-Ramen, KFC, Bún chả, Phở', 'Schokopudding, Erdbeertorte, Benjamin Blümchen Torte, Amicelli, Giotto <3', '1) Wölfe, sie sind stark, anmutig und gefährlich. Diese Kombination ist  sehr faszinierend und mystisch 2) Delfine, es sind die schönsten Geschöpfe der Welt. Für mich sind sie ein Symbol für Freiheit. 3) Meine Bengal Katzen. Süß, vespielt und keine normalen Katzen (nicht nur optisch) :D', 'Ich bin zwar eher ein Fan von Evoli und Vulpix, aber ich  wäre ein Pikachu. Einfach voller Energie geladen und manchmal etwas frech, aber liebenswürdig. Man muss nur für sich entdecken ob diese Energie positiv oder negativ ist. Auf jedenfall ist es verdammt süß und sehr treu :)', NULL, 'OMG ich könnte mich absolut nicht entscheiden. Es gibt so viele tolle Welten, da fällt es einem unheimlich schwer sich eine Welt rauszusuchen. >.<  Hauptsache es herrscht Harmonie, Humor, Liebe, Action und ein klein wenig Fantasy :) Aber die Welten der Ghibli-Filme finde ich immer besonders kreativ :)', 'Eigentlich gefallen mir alle Hauptcharaktere von der Manga-Zeichnerin Arina Tanemura (Fullmoon wo sagashite, Jeanne ect.). Jede Figur ist für sich ein ganz besonderer Chara und jeder rettet die Welt auf seine Weise. Ich bewundere den starken Charakter und die unglaubliche Ausstrahlung der Figuren. Könnte ich mir aussuchen ein Magical Girl zu sein, dann wäre ich eine Mischung aus allen Hauptcharakteren von Arina T. ^^', 'Ganz klar, überall wo es schnell ist und so viel Adrenalin wie möglich ausgestoßen werden kann xD', 'Glücklich zu sein bis an das Ende meiner Tage! Denn egal wie viel Geld ich besitze oder ob ich einen guten Mann an meiner Seite habe, bedeutet dass noch lange nicht, das ich auch Glücklich bin ^^', '~Okaerinasaimase, goshujin-sama, ojou-sama~ Mein Name ist May und komme aus der Mesiterstadt Dortmund :) Ich bin ein aufgewecktes und fröhliches Mädchen, dass gerne auch mal etwas durchgeknallt ist :D Es macht mir sehr viel Spaß, in einem so tollen Team arbeiten zu dürfen und den Gästen viel Freude zu bereiten ^^ Ich wünsche euch allen ein super süßes "Moe, moe kyun <3"', '#fe9ece', 112),
(172, 68, 5, 'Maid', NULL, 2013, 'Das Konzept eines Maid Cafés hat mich schon länger interessiert. Der Kontakt zum Kunden ist ein völlig anderer, ein einfach persönlicherer. Hinzu kommt noch, dass man die Möglichkeit hat in einem Team voller lieber Menschen zu arbeiten. ^-^/ ', '1995-12-11', NULL, NULL, 'Cosplayn, FFs lesen und schreiben', 'Da könnte ich mich nicht entscheiden... ^^''''', 'Jegliche Art von Schokolade', 'Hunde, da sie treudoof und wirklich immer für dich da sind :)', 'Woingenau! Er ist immer für einen Lacher gut ;D', NULL, 'Ich würde gerne in der Welt von One Piece leben, um die Grand Line mit meiner Crew zu besegeln <3', 'Nico Robin :) Auch, wenn sie nicht das typische Magical Girl ist... Sie hat einen starken Charakter und setzt sich für ihre wahren Freunde ein!', 'Auf Geister- oder Achterbahnen <3', 'Ein gesundes und sorgenfreies Leben für Familie und Freunde. :)', 'Ahoi! Ich bin Ida, musikbegeistert und bereit meine gute Laune mit jedem meiner Gäste zu teilen ~(^-^)~', '#ccff99', 112),
(173, 69, 8, 'Maid', NULL, 0, 'Weil ich meine erfahrungen erweitern wollte und mal ein wenig hinter die kulissen schauen wollte wie das so als Maid denn ist :D', '1992-12-07', NULL, NULL, 'Musik hörn, mit freunden chillen, Zocken,', 'Milchreis mit Zimt & Zucker', 'Snickers', 'Schlangen! Weil sie so wunderschön sind mit ihren Schuppen und den Augen, ich habe mich darin einfach verliebt :3', 'Ich denke ich wäre ein Lanturn, ich meine Wasser und Elektro gleichzeitig ist ja wohl mal der wahnsinn :D', ';)', 'Natürlich in der Pokemon Welt!... oder in der Welt von ''Erementar Gerad'' ♥', 'Garkeins :D ich bin keine von diesen träumerlienchen', 'In diesen komischen Häusern wo alle Wände schief sind und man sich drinne verläuft uind gegen sachen rennt :D', 'In meine vergangenheit reisen zu können und meinem alten ich sagen können was ich hätte besser machen können :]', 'Ich bin eine sehr kreative Maid mit ganz viel Temperament und leidenschaft', '#f00001', 112),
(174, 70, 1, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, 0),
(175, 70, 2, 'Organisator', NULL, 2012, 'Ich bin ein Fan von Süßigkeiten und niedlichen Kleidern! >//< Das Team ist umwerfend und jetzt möchte ich es gar nicht mehr missen! <3', '2013-07-23', 'Löwe', '1,75', 'Ich backe und koche sehr gerne =D Fotografieren, zeichnen und nähen mag ich auch. <3', 'Spinat =D ', 'Ahhhh @__@ Es gibt so viele tolle! Aber ich glaube Schokowaffeln liebe ich am meisten. ♥', 'Bären *__* So kuschelig und groß!', 'Teddiursa :D Voll niedlich und entwickelt sich angsteinflößend! Nehmt euch in Acht ^___^', 'Yu-Gi-Oh! GX und 5D''s ♥', 'In der YGO GX Welt =D Eine coole Akademie mit interessanten Wendungen.', 'Meroko! Ich liebe schöne Dinge und bin nah am Wasser gebaut. ', 'Schießstand =D Ich bin sehr zielstrebig und kämpfe bis ich mal gewinne... oder kein Geld mehr habe! :3', 'Ein glückliches, heiteres Leben für mich und meine Liebsten.', 'Ich bin Yusei und leite zusammen mit May dieses Maid Cafe. Ich liebe es andere Menschen glücklich zu machen und werde euch mit einem Lächeln empfangen. Hoffentlich wird es mir gelingen auch euch ein Lächeln auf das Gesicht zu zaubern! =)', '#0000cc', 0),
