(182, 67, 7, 'Organisator', NULL, 2012, 'Weil ich es schön finde, Leute zu Entertainen, süße Maidkleider zu tragen und neue Leute kennen zu lernen. Es macht mir viel Spaß zu sehen, wie sich die Gäste an unseren süßen Sachen erfreuen. Ich zaubere gerne jedem ein Lächeln ins Gesicht :3 Und nur ein zufriedener Kunde ist ein guter Kunde <3', '1990-11-16', NULL, NULL, 'Lolita Mode tragen, Shootings, shoppen, tanzen, Filme gucken, feiern gehen, mit Freunden treffen', 'Kaage-Ramen, KFC, Bún chả, Phở', 'Schokopudding, Erdbeertorte, Benjamin Blümchen Torte, Amicelli, Giotto <3', '1) Wölfe, sie sind stark, anmutig und gefährlich. Diese Kombination ist  sehr faszinierend und mystisch 2) Delfine, es sind die schönsten Geschöpfe der Welt. Für mich sind sie ein Symbol für Freiheit. 3) Meine Bengal Katzen. Süß, vespielt und keine normalen Katzen (nicht nur optisch) :D', 'Ich bin zwar eher ein Fan von Evoli und Vulpix, aber ich  wäre ein Pikachu. Einfach voller Energie geladen und manchmal etwas frech, aber liebenswürdig. Man muss nur für sich entdecken ob diese Energie positiv oder negativ ist. Auf jedenfall ist es verdammt süß und sehr treu :)', NULL, 'OMG ich könnte mich absolut nicht entscheiden. Es gibt so viele tolle Welten, da fällt es einem unheimlich schwer sich eine Welt rauszusuchen. >.<  Hauptsache es herrscht Harmonie, Humor, Liebe, Action und ein klein wenig Fantasy :) Aber die Welten der Ghibli-Filme finde ich immer besonders kreativ :)', 'Eigentlich gefallen mir alle Hauptcharaktere von der Manga-Zeichnerin Arina Tanemura (Fullmoon wo sagashite, Jeanne ect.). Jede Figur ist für sich ein ganz besonderer Chara und jeder rettet die Welt auf seine Weise. Ich bewundere den starken Charakter und die unglaubliche Ausstrahlung der Figuren. Könnte ich mir aussuchen ein Magical Girl zu sein, dann wäre ich eine Mischung aus allen Hauptcharakteren von Arina T. ^^', 'Ganz klar, überall wo es schnell ist und so viel Adrenalin wie möglich ausgestoßen werden kann xD', 'Glücklich zu sein bis an das Ende meiner Tage! Denn egal wie viel Geld ich besitze oder ob ich einen guten Mann an meiner Seite habe, bedeutet dass noch lange nicht, das ich auch Glücklich bin ^^', '~Okaerinasaimase, goshujin-sama, ojou-sama~ Mein Name ist May und komme aus der Mesiterstadt Dortmund :) Ich bin ein aufgewecktes und fröhliches Mädchen, dass gerne auch mal etwas durchgeknallt ist :D Es macht mir sehr viel Spaß, in einem so tollen Team arbeiten zu dürfen und den Gästen viel Freude zu bereiten ^^ Ich wünsche euch allen ein super süßes "Moe, moe kyun <3"', '#fe9ece', 112),
