'Glücklich zu sein bis an das Ende meiner Tage! Denn egal wie viel Geld ich besitze oder ob ich einen guten Mann an meiner Seite habe, bedeutet dass noch lange nicht, das ich auch glücklich bin. ^^', '~Okaerinasaimase, goshujin-sama, ojou-sama~. Mein Name ist May und ich komme aus der Meisterstadt Dortmund :) Ich bin ein aufgewecktes und fröhliches Mädchen, dass gerne auch mal etwas durchgeknallt ist :D Es macht mir sehr viel Spaß, in einem so tollen Team arbeiten zu dürfen und den Gästen viel Freude zu bereiten ^^ Ich wünsche euch allen ein super süßes "Moe, moe kyun <3"', '#fe9ece', 112),
(211, 46, 6, 'Maid', NULL, 2014, ' Ich liebe es zu Cosplayen und Maid zu sein erfüllt mich in meinem Hobby. es macht Spaß zu sehen wie glücklich die Kunden sind und die gemeinsame Arbeit wundervoll ist', '2013-10-16', 'Waage', '1,60', ' Zeichnen, Tanzen, Videos machen & cosplay', 'Kuchen', 'Erdbeertörtchen', 'Mehrere, Wolf & weißer Lowe, (Katzen&Panda) Sie sind im Rudel und treu zu ihren kameraden, es sind schöne und stolze Tiere. weiße Löwen sind selten und stolz. wunderschöne Tiere', 'Pikachu, weil meine Freunde und Kollegen mich so nennen & immer treu ist', NULL, 'Chobits / Vampire Knight', 'Kagome ( Inuyasha ) weil sie immer versucht Ihre Freunde zu beschützen und stets an ihrer stärke arbeitet.', 'An den Ständen wo man Plüshis gewinnen kann ;)', 'Gesundheit für alle die ich liebe!', 'Hallo ich bin Lisa, bin gerne kreativ und liebe süßes und niedliche Tiere. aber wer auch nicht ? Ich freue mich auf euren Besuch <3', '#bf111b', 112),
(212, 47, 6, 'Maid', NULL, 2013, ' Es war eine spontane Entscheidung :)', '2013-08-10', 'Löwe', '1,63', 'Schlafen, Fotos machen und mit meiner Katze kuscheln *-*', 'Crêpe mit Kinderschokolade *-*', 'Schoki :3', 'Katzen sind so wundervoll, weil.. öhm .. ich habe schon immer Katzen geliebt :)', 'Pika Pika-chuuuu, weil es süß ist und das erste Pokemon war was ich knuffig fand :3', NULL, 'One Piece :3 ein Traumabenteuer :D', 'Ich würde sagen Ichigo aus Tokyo Mew Mew :3 einfach weil der Charakter mir etwas ähnlich ist und ich Katzen über alles liebe *^*', 'Auf der Wildwasser Achterbahn oder auf so Kleinkinder Karussells :D ', 'Man soll Wünsche erst verraten wenn sie wahr geworden sind, ansonsten bringt das doch unheil, oder nicht? u.u', 'Ich bin Chooko und liebe Schokolade *-*. Und mein Name Chooko ist absichtlich mit k geschrieben :D', '#309eaf', 112),
(213, 40, 16, 'Maid', NULL, 2009, NULL, '2013-02-20', 'Fische', NULL, 'Pen and Paper Rollenspiele und Singen', 'Rotkohl + Klöße, Yukimi Daifuko', 'Ich kann mich nicht entscheiden, weil es so viele leckere süße Sachen gibt >_< Auf jeden Fall ist Zuckerwatte ganz oben bei mir auf der Liste.', NULL, 'Ich wäre gerne Mew! Ich mag Mew sowieso, es ist süß, verspielt und es kann fliegen! =D Gibt es ein besseres Pokemon? Außerdem hat es Psychokräfte!', NULL, 'Das ist eine schwierige Frage! Früher hab ich mir immer Gewünscht in der Welt von Inuyasha leben zu können. Ich fand es so toll im feudalen Japan zu leben, in dem Dämonen und Geister existieren. Aber heute würde ich glaube ich gerne in der Welt von Pokemon oder One-piece leben. Die Vorstellung einfach seine Sachen zu packen und in die Welt zu ziehen finde ich total schön.', 'Ich denke ich wäre gerne Utena aus dem gleichnamigen Anime. Sie ist so stark und kämpft für ihre Überzeugungen und ihre Freunde und schafft es allem zu trotzen obwohl sie von ihren Feinden oft unterschätzt wird. Das finde ich bewundernswert.', 'Entweder bei den Achterbahnen oder im Streichelzoo bei den Tieren! Auf keinen Fall würde man mich in der Nähe der Geisterbahn finden. Ich hab so Angst vor Geisterbahnen Q_Q', 'Ich würde mir wünschen das ich und meine Familie glücklich und zufrieden leben könnten. Eine Zuckerwattemaschine wäre bestimmt aber auch noch drin ;D', 'Was gibt es da zu erzählen? Ich bin offenherzig und erzähle gerne, kann aber auch gut zuhören. Ich mache gerne quatsch und ärger meine Freunde, kann aber auch ganz lieb und anhänglich sein >_< Ich denke mit mir kann man viel Spaß haben :-)', '#ffff01', 112),
(214, 48, 6, 'Maid', NULL, 2013, 'Da meine Schwester bereits zum Lucky Chocolate Maid Café gehört hat, habe ich des öfteren von ihrer Arbeit im Café und den Treffen mit den Maids gehört und gemerkt, dass sie mit Begeisterung dabei ist. Dann schlug sie mir vor, dass ich mich doch auch mal bewerben sollte. Ich war überrascht aber habe schnell gemerkt, dass mir dieser Gedanke gefiel (wer kann zu diesen Maids schon nein sagen?)! Zum Glück haben sie mich aufgenommen :3 Dieses super süße Team ist nämlich genau so umwerfend niedlich wie es mir beschrieben wurde!^^', '2014-01-24', 'Wassermann', '1,67', 'Lesen, klettern, shoppen (am liebsten mit anderen süßen Mädels), kochen, backen und viiiieles mehr', 'Lasagne von Mama :3', 'Nimm 2 Soft (sooo weich, fruchtig und lecker...nomnom) =^.^= Aber auch Pfirsichringen und Lollies kann ich nicht widerstehen...*pureLiebe*', 'Katzen  sind meine  absoluten Lieblingstiere, weil sie einfach wunderschön sind, mit mir kuscheln wenn es mir mal schlecht geht und trotzdem ihren eigenen Kopf haben. Sie bringen mich zum lachen wenn sie mal wieder tollpatschig von einem Regal fallen oder total begeistert hinter einer Fliege her rennen...außerdem sind sie einfach nur süß. <3', 'Bei soo vielen Pokemon kann ich mich nicht festlegen, weil mir einige gefallen. Eins steht aber fest. Ich wäre ein wildes, da die Freiheit dann für mich verlockender wäre als alles andere. :D', NULL, 'Ich könnte mich bei den ganzen tollen und außergewöhnlichen Welten nicht entscheiden! Am liebsten würde ich von einer Welt zur nächsten reisen :3', 'Ich wäre super gerne Yuuki Asuna, da sie  eine starke Person ist und mutig ihre Freunde beschützt. Ich würde auch gerne mit einem Schwert umgehen können. Zudem ist sie sehr hübsch und hat Kirito an ihrer Seite. <3 Und in der 2. virtuellen Welt kann sie fliegen was mein absoluter Traum ist. *o* ', 'Überall wo ich einen Adrenalinkick bekomme xD...also alles vom freien Fall bis zur Wildwasserbahn.', 'Meine geheimsten Wünsche verrate ich nicht^^'' Aber ein paar einfache Wünsche, die man sich selbst erfüllen kann habe ich auch...fragt mich doch beim nächsten Besuch in unserem Café danach :3', 'Mein Name ist Lulu und ich bin eine quirlige, motivierte Maid. Ich hoffe gaaaanz viele glückliche Gesichter im Café bedienen zu dürfen. ^^', '#fa8073', 112),
(215, 49, 6, 'Maid', NULL, 0, 'Ich bin Maid geworden um mich neu zu fordern, neue Leute kennen zu lernen und einfach nur Spaß zu haben :D', '1991-07-16', 'Krebs', '1,65', 'Cosplay, Showgruppe D.A.N.G.O, singen', 'Salat, Thunfisch/Lachs Onigiri, Pilze', 'Kinderpingui und HariboSpaghetti', 'Mein Lieblings- Landsäugetiere bzw. -Tiere sind katzenartige. ich bin mit Katzen aufgewachsen und deswegen verrückt nach Vertretern der Katzenfamilie ^^ Mein Liebstes Meerestier ist der Orca. Ich hab früher sehr oft Free Willy geguckt und träume oft davon einmal mit einem Orca zu schwimmen :3', 'Ich wäre ein Nachtara  weil ich einfach ein Nachtmensch bin und Katzen und den Mond liebe oder ich wäre ein Ampharos, weil es einfach mein Lieblings Elektro-Pokémon ist welches ich, wenn es denn geht immer in meinem Team habe ^_^', NULL, 'Es gibt so viele tolle Welten o.o Digimon, Pokemon, Fairy Tail...', 'Da ist erstmal die frage wer jetz alles zum Magicalgirl zählt aber Blair aus Soul Eater oder Erza Scarlet aus Fairy Tail.', 'Überall und Nirgendwo am besten hat man meine Handynummer xD', 'Ich würde mir wünschen endlich meinen Traumberuf als Tierpflegerin ausüben zu können ^^', 'Ich bin lustig, aufgeweckt, kontaktfreudig, kreativ, hilfsbereit.', '#12b600', 112),
(216, 50, 6, 'Maid', NULL, 2013, 'Durch neugier, interesse an der Japanischen Kultur, spaß an Shootings, liebe zu süßen und leckeren Törtchen usw und letztendlich durch meine Freundin May ;) und ich bereue es kein bischen, da ich super tolle und nette Leute kennen gelernt habe mit denen man die gleichen Interessen teilen darf und das macht es um so schöner!', '1988-02-15', 'Wassermann', '1,65', 'Cosplay und Bengalkatzen', 'ReisCurry', 'Eiscreme', 'Ich bin fasziniert von Katzen und damit meine ich nicht nur Hauskatzen sondern auch Wildkatzen, wie z. B. Geparden, Leoparden aber auch Löwen usw. Doch an erster Stelle steht bei mir die Bengalkatze. Ich besitze selber zwei von den Stubentigern und will sie nicht mehr missen. Sie haben einen tollen Charakter und sind echt einzigartige Tiere. Sie lieben Wasser, reden viel und sind Energiebündel, die bis ins hohe Alter total verspielt sind. Ihre wilde Leopardenmusterung macht sie so faszinierend. Ganz toll finde ich auch Abessiner und Savannah Katzen.', 'Pikachu. Es ist frei und immer voller Energie geladen und so manch einem könnte ein Stromschlag mal nicht schaden xD', NULL, 'In einem Mix aus verschiedenen. Wichtig wäre mir Frieden und der Schutz der Tiere, wo Mensch & Tier im Einklang leben. Wo Kinder behutsam aufwachsen können und man noch Träume hat und die Welt nicht von Hass erfüllt ist und Geld nicht die Welt regiert. Dort, wo wir die Welt nicht kaputt machen und die Natur geschätzt und respektiert wird. Und eine mit ganz viel Sonnenschein :)', 'Wer wäre denn nicht gerne eine Sailor Kriegerin im Kampf für die Gerechtigkeit?', 'Ich glaube überall *lach* an Spielbuden, Süßigkeitenständen und den größten und schnellsten Attraktionen. Wahrscheinlich aber an einem riesen Pferde Karussel, ich finde die altmodischen großen Karussels wunderschön und könnte sie stundenlang bewundern.', 'Natürlich mehr Wünsche, was soll der Geiz hehehe :D Aber ich kann schonmal einen verraten, ich würde super gerne mal nach Japan und außerdem dort selbst mal in einem Maid Cafe bedient werden ^-^', 'Ich bin mit Anime & Manga groß geworden, deswegen cosplay ich gerne und fühle mich als Maid pudelwohl :3. Außerdem liebe ich den Gyaru Style und die Lolita Mode ist ein Traum! :) Ich liebe Tiere über alles und finde, dass man sich viel mehr für den Tierschutz einsetzen sollte.  Ganz besonders liebe ich meine Bengalkatzen Simba & Cira. Sie sind alles für mich <3', '#ff0d86', 112),
(217, 51, 6, 'Maid', NULL, 2014, 'Mir gefallen die Outfits. Zudem mag ich es den gleichen Stil in einer Gruppe zu tragen (z.B. auch Cosplay und Gothic Lolita).', '2015-12-31', 'Steinbock', '1,75', 'Zeichnen, Lesen, Fotografieren', 'Nudeln aller Art, Süßes', 'Schokolade!', ' Hühner! Hühner sind einfach so cool und liebenswert, oftmals auch sehr belustigend (Ich habe selbst Zwerghühnchen). Ich mag aber auch Katzen sehr gerne.', 'Ein Lugia! Ich mag Vögel sehr gerne. Zudem ist Lugia ein eleganter Flieger... und Fliegen würde ich auch gerne können :)', NULL, 'Das ist eine sehr schwere Frage... Es gibt so viele tolle Welten. Im Moment würde ich sagen in der ''Attack on Titan'' Welt, da ich ein großer Fan von Fachwerkhäusern bin und das derzeit auch meine Lieblingsserie ist. Ansonsten gefällt mir die Welt von ''Ao no Exorcist'' sehr gut, da ich den Campus und die Uniformen super finde.', 'Momoko Asuka von Doremi. Ich liebe einfach ihren lebhaften Charakter! Da ich ein eher zurückhaltender Mensch bin, wünsche ich mir manchmal etwas von ihrer lustigen und positiven Art ;)', 'Bei der nicht ganz so schnellen Achterbahn', 'Dass die Menschen mehr Rücksicht auf andere nehmen und mehr Toleranz zeigen würden.', 'Ich bin Auszubildenende beim Fotografen, liebe Tiere und Manga/Anime. Ich wirke auf die meisten ruhig und zurückhaltend, bin aber ein sehr aufgeschlossener Mensch.', '#f5ac81', 112),
(218, 52, 6, 'Maid', NULL, 2013, 'Maid Café''s haben mir schon immer gut gefallen und ich wollte auch gerne mal in einem arbeiten.  Außerdem möchte ich viele neue Leute kennenlernen^^', '2013-04-04', 'Widder', '1,68', 'Lolita tragen, Dolls sammeln und Konzerte besuchen.', 'Sushi, Pizza, Pasta und Spinat :3', 'Kuchen natürlich, am liebsten mit Erdbeeren! Und Macarons <3', 'Ich liebe Alpacas! Die sind sooo flauschig und süß und gucken immer so lieb und treudoof *-*', 'Togepi! Es ist immer fröhlich und süß <3', NULL, 'Ich glaube die Digiwelt wäre ganz cool^^', 'Sailor Venus! Sie ist einfach die coolste :D', 'Bei den gebratenen Champignons und den Schokofrüchten, die liiiebe ich <3', 'Ein Leben wie Marie Antoinette xD', 'Ich bin eine Backfee, denn ich liebe backen einfach!', '#79d5ac', 112);
INSERT INTO `maid_versions` (`ID`, `RecordID`, `Version`, `Type`, `colour`, `since`, `maidreason`, `BDay`, `zodiac`, `size`, `hobbys`, `favfood`, `favsweet`, `favanimal`, `pokemon`, `anime`, `animelocation`, `magicalgirl`, `funfairlocation`, `wish`, `aboutme`, `mcolour`, `maidphotoID`) VALUES
(219, 53, 6, 'Maid', NULL, 2013, 'Weil ich Menschen so gerne mit Tanzen/Singen/Spielen oder einfach nur einem netten Schwätzchen unterhalte. Und wo würde das besser gehen als in diesem Maid Café? Der Alltag ist schließlich ernst genug ;)', '2013-09-09', 'Jungfrau', '1,72', 'Cosplay, Singen, Zeichnen', 'Sushi & Obstsalat', 'Eiskonfekt :D', ' Ich denke das Faultier. Seine Augen sind so groß und die Gesichter sind so herzlich!!', 'Karpador  und ich würde nur noch Platscher einsetzen ^.~ ', NULL, 'Ich wäre gerne die beste Freundin von Sawako (Kimi ni Todoke). Ich liebe dieses Mädchen, sie hat einen unglaublich reinen Charakter ^.^', 'Iva aus Karneval! Sie ist zwar kein typisches Magical Girl, aber ihre Fähigkeiten sind beneidenswert (sie kämpft mit Diamanten O.O) und sie geht für ihre Freunde durch´s Feuer. ', 'Auf den Freefalltowern oder auf den Themenfahrten', 'Gesundheit für meine Lieben. Und mich einmal mit einem antiken Römer oder Griechen unterhalten können und fragen, wie das Leben damals wirklich war!!', 'Ich bin leicht chaotisch, aber aufgeweckt. Ich liebe Singen und Lachen & möchte euch mit guter Laune anstecken :D Ich freue mich sehr darauf, euch demnächst bedienen zu dürfen ;P ', '#ff7f50', 112),
(220, 54, 6, 'Maid', NULL, 2012, 'Es fing alles an mit "Kaichou wa Maid-sama" ^-^ Wahhh~ wäre es toll, wenn es auch Maid Cafés in Deutschland gäbe und so entdeckte ich zufällig das "Lucky Chocolate Maid Café" ♥ Es wäre sicher lustig und aufregend, in einem süßen Kleid, von leckerem Kuchen umgeben, die Gäste mit Freude und Spaß anzustecken. Und ich bin überglücklich, durch meinen Job als Maid viele liebe und tolle Maids kennengelernt zu haben und zusammen Goshujin-sama & Ojou-sama ein Lächeln herbeizuzaubern ^.~', '2013-01-27', 'Wassermann', '164 cm', 'Reisen, shoppen, Fashion & Design, Musik, Animes & Mangas ♥', 'Pfannkuchen, Nudeln & Pasta~ Alles was lecker ist und mich satt macht xD', 'Kyaaah~ Süßigkeiten sind doch ALLE sooo lecker *^*', 'Katzen, Kaninchen, Schmetterlinge, Pinguine ^.^', 'Evoli ist mein absolutes Lieblingspokémon und seine Weiterentwicklungen sind alle so cool !!! Da denke ich, dass Feelinara/Sylveon am besten zu mir passt, da es auch überall Schleifen trägt ^.~', 'Kaichou wa Maid-sama, Pandora Hearts, Shingeki No Kyoujin Attack On Titan', '"Uta no Prince-sama"-Welt mit vielen gut aussehenden Jungs, die mir viele schöne Songs vorsingen *schwärm* xDDD', 'Mew Ichigo (von Tokyo Mew Mew) ^o^ In einem süßen Café arbeiten, die Natur beschützen, gegen Aliens kämpfen (xD) und sich zwischendurch in eine Katze verwandeln *nya* =^.^=', 'Ich wäre überall zu finden bzw. zu suchen *haha* Achterbahnen, Karussells, Riesenrad und und und ~ bis hin an den Spielbuden, Süßigkeitenständen und und und ^.~', 'Hmmm~ Wünsche darf man doch nicht verraten, oder? Sonst gehen sie doch nicht in Erfüllung, ne ^.~ ', 'Ich bin die fröhliche Maid Aimi, die (große) Schleifen über alles liebt *^*. Schau doch im "Lucky Chocolate Maid Café" vorbei und ich begrüße dich mit einem herzlichen "Okaerinasaimase" ^.~ ♥', '#921a7e', 112),
(221, 54, 7, 'Facebook', NULL, 2012, 'Es fing alles an mit "Kaichou wa Maid-sama" ^-^ Wahhh~ wäre es toll, wenn es auch Maid Cafés in Deutschland gäbe und so entdeckte ich zufällig das "Lucky Chocolate Maid Café" ♥ Es wäre sicher lustig und aufregend, in einem süßen Kleid, von leckerem Kuchen umgeben, die Gäste mit Freude und Spaß anzustecken. Und ich bin überglücklich, durch meinen Job als Maid viele liebe und tolle Maids kennengelernt zu haben und zusammen Goshujin-sama & Ojou-sama ein Lächeln herbeizuzaubern ^.~', '2013-01-27', 'Wassermann', '164 cm', 'Reisen, shoppen, Fashion & Design, Musik, Animes & Mangas ♥', 'Pfannkuchen, Nudeln & Pasta~ Alles was lecker ist und mich satt macht xD', 'Kyaaah~ Süßigkeiten sind doch ALLE sooo lecker *^*', 'Katzen, Kaninchen, Schmetterlinge, Pinguine ^.^', 'Evoli ist mein absolutes Lieblingspokémon und seine Weiterentwicklungen sind alle so cool !!! Da denke ich, dass Feelinara/Sylveon am besten zu mir passt, da es auch überall Schleifen trägt ^.~', 'Kaichou wa Maid-sama, Pandora Hearts, Shingeki No Kyoujin Attack On Titan', '"Uta no Prince-sama"-Welt mit vielen gut aussehenden Jungs, die mir viele schöne Songs vorsingen *schwärm* xDDD', 'Mew Ichigo (von Tokyo Mew Mew) ^o^ In einem süßen Café arbeiten, die Natur beschützen, gegen Aliens kämpfen (xD) und sich zwischendurch in eine Katze verwandeln *nya* =^.^=', 'Ich wäre überall zu finden bzw. zu suchen *haha* Achterbahnen, Karussells, Riesenrad und und und ~ bis hin an den Spielbuden, Süßigkeitenständen und und und ^.~', 'Hmmm~ Wünsche darf man doch nicht verraten, oder? Sonst gehen sie doch nicht in Erfüllung, ne ^.~ ', 'Ich bin die fröhliche Maid Aimi, die (große) Schleifen über alles liebt *^*. Schau doch im "Lucky Chocolate Maid Café" vorbei und ich begrüße dich mit einem herzlichen "Okaerinasaimase" ^.~ ♥', '#921a7e', 112),
(222, 56, 6, 'Maid', NULL, 2011, 'Ich habe 2010 zum ersten Mal eine Con besucht und es war die Dokomi. Aus Zufall heraus war ich auf einmal eine Helferin und konnte die Con als Helferin und Gast genießen. Später habe ich dann erfahren, dass das LC neue Maids sucht. Da die Con mich sofort überzeugt hat und die Idee als Maid zu arbeiten sehr gefallen hat, wollte ich es gerne ausprobieren.  ', '2013-07-08', 'Krebs', '1,65', 'Manga lesen, spazieren gehen, mit Freunden treffen', 'Dim Sum, Sushi, Wassermelone und Dorianfrucht xD ', 'CHOCOLATE ', 'Katze. Katzen sind äußerst unabhängige Tiere und doch wenn sie Zuneigung  haben wollen, stellen sie sich so süß an, dass man sofort nachgeben muss und sie einfach lieb haben muss. ', 'Plusel und Minum. Die kleinen Häschen sind frech und doch so putzig', NULL, 'One Piece. Ich liebe die verschiedenen Inseln, die Oda Eiichiro sich einfallen lässt für die Abenteuer von Ruffy und co. Außerdem frage ich mich wie es sich wohl anfühlen würde eine Teufelsfrucht zu essen und dann Special power zu haben ', 'Keins, egal wie sehr ich als kleines Kind Sailor Moon oder Doremi nachgespielt habe, würde ich mich nicht mit einer assoziieren. Wenn dann andere Charaktere.', 'Achterbahn!!! Nichts ist besser als Achterbahn.', 'Ein wohl utopischer Wunsch, aber Weltfrieden wäre echt toll. Man sieht jeden Tag schlechte Nachrichten über Kriege jeder Art und es macht mich traurig mit anzusehen wie unschuldige Zivilisten mit in den Kämpfen hineingezogen werden. ', 'Konnichiwa Minna-san, ich bin manchmal etwas schüchtern, also seid bitte ganz lieb zu mir. Ich liebe süße und niedliche Gegenstände, bin eine große Katzenliebhaberin und habe gaaaaaaanz große Angst vor Spinnen. ', '#9ec9f3', 112),
(223, 57, 6, 'Maid', NULL, 2013, 'Durch einige Besuche in Maidcafés und durch die tolle Werbung von May habe ich mich entschieden auch eine Maid zu werden, da man so viele Leute kennen lernt und tolle Erfahrung macht ^_^', '2013-06-08', 'Zwillinge', '1,62', 'Lolita, zeichnen, backen', 'Nudelgerichte, Steak', 'Karamellwaffeln', 'Der Panda - super flauschig, putzig und frisst den halben Tag!', 'Da ich darauf keine Antwort wusste, habe ich meine beste Freundin gefragt. Sie meinte Myrapla würde gut zu mir passen :D', NULL, ' In der von Kilala Princess, weil ich die Disney Prinzessinnen liebe <3', ' Super Pig! Ein Schwein als Superheldin ist einfach cool :D', 'Wildwasserbahn', 'Noch mehr Wünsche ;P', 'Ich liebe Lolita, es ist mein größtes Hobby. Was man vielleicht nicht direkt vermutet ist mein Musikgeschmack, denn ich höre bevorzugt Metalcore. Ebenso liebe ich Essen, ich bin vielleicht kein Gourmet aber zu einem leckeren Gericht sage ich eigentlich nicht nein ;) Abgesehen von Lolita und Maid bin ich Mediengestalterin und verdiene so mein Geld, was ich dann in tolle Kleider investiere ;D Außerdem glaube ich, dass man durch den Steckbrief schon einiges über mich erfährt.', '#ccd4d4', 112),
(224, 58, 6, 'Maid', NULL, 2012, 'Aufgrund einer süßen Idee, die mir vorgeschlagen wurde. Ich konnte nicht widerstehen =)', '2013-01-27', 'Wassermann', '1,63', 'Tanzen, shoppen, reisen, feiern, lesen', 'Marmorkuchen, Erdbeeren', 'Schokokekse', 'Schildkröten sind die Ruhe selbst =) und Babyschildkröten sind einfach zuckersüß <3', 'Relaxo...ich liebe es zu schlafen', NULL, NULL, NULL, 'Irgendwo auf einer Achterbahn', 'Alles Glück dieser Welt für die Liebsten', 'Ein Tag ohne lächeln ist ein verlorener Tag - nach diesem Motto lebe ich.', '#609ce2', 112),
(225, 59, 6, 'Facebook', NULL, 2010, 'Weil ich was Neues ausprobieren wollte… vorher war ich nichtmal aktiv in der Cosplayszene dabei, aber es hat mich einfach interessiert, wie es ist Maid zu sein. Vorallem aber weil die ersten Maids, die ich jemals gesehen habe, so hübsch aussahen. Ich wollte auch so aussehen wie die <3', '2013-09-04', 'Jungfrau', '1,64', 'Architektur, Singen, Essen, Schlafen', 'Sushi, Bulgogi, Bibimbap, Maid Umi''s Kochkünste, Ramen, … eigentlich zu viel um es aufzuzählen <3', 'Ach, ich mag sooo vieles~ Da kann man ich mich echt nicht entscheiden, was ich am aller aller liebsten mag... Aber Pfirsichringe sind schon pure Liebe~ Oder Cakepops mit Milchschokoladenüberzug in Pfirsichgeschmack <3', 'Alles was fett, süß und flauschig ist… meine Kuscheltiere!', 'Relaxo!! -> essen, schlafen, essen, schlafen~ Was für ein Leben~', NULL, 'In der Gundam (00) Welt, aber bitte ohne Krieg... weil die Technik da ist schon extremst <3 :DD Dann will ich meinen eigenen Gundam haben! Oha, wenn ich den steuern könnte :x...', 'Sakura aus Cardcaptor Sakura, weil sie so viele tolle Sachen mit ihren Tarotkarten machen kann und weil sie verdammt süße Kleider hat UND weil ich dann Kero an meiner Seite hätte!', 'Auf dem Riesenkarussel mit einer Zuckerwatte in der Hand ?', 'Doraemon´s Tasche!! Dann könnte ich mir seine Dinge mal kurz "borgen" /DD Vorallem seine Überallhin-Tür wäre verdammt praktisch~', 'Ich bin die Jenny und ich liebe es zu essen und zu zocken. Und das am besten gleichzeitig! <3 Mal schauen ob ich es schaffe euch in 7,5 cm hohen cm hohen Schuhen zu bedienen. >_<...!', '#cd0000', 112),
(226, 60, 6, 'Maid', NULL, 2013, 'Durch die Überredungskünste von Maid Jenny und Host Momo :D', '2013-11-19', 'Skorpion', '1,56', ' Ich beschäftige mich am liebsten mit koreanischer Popmusik und ihren Choreografien.', 'Viel zu viel was zur Auswahl steht um sich zu entscheiden >_<', 'Außer Vanilleeis nasche ich selten was :3', 'Ich mag keine Tiere >_<'''' Die beißen alle nur qq', 'Am liebsten wäre ich Pikachu. Es ist süß und liebenswert und wird oft in der Gegend herumgetragen <:', NULL, 'Ich denke, dass ich mich mit sehr vielen Welten anfreuden könnte. Ganz oben steht DeathNote, AngelBeats und Digimon.', 'Jeanne die Kamikaze Diebin, weil sie auch in den verzweifelsten Situationen nicht den Kopf hängen lässt :)', 'An allen möglichen Achterbahnen und Essensständen <:', 'Wenn ich mir nicht noch mehr Wünsche wünchen dürfte, würde ich mir Lebensglück wünschen. Außerdem würde ich mir wünschen, dass ich nichts im Leben bereuen würde.', 'Mein Name ist Tecky und ich liebe es zu K-Pop zu tanzen. Ich hoffe, ich schaffe es dir ein Lächeln ins Gesicht zu zaubern. <: ', '#f5c0c8', 112),
(227, 61, 6, 'Maid', NULL, 2013, 'Weil es mein Wille war! :D <3 Ach quatsch :) ich finde die Idee total super und es ist eine hübsche Arbeit :* Spaß macht es auch :) es war eine gute Entscheidung <3', '2013-10-09', 'Waage', NULL, 'Tanzen und joggen ;D', 'Milchreis <3', 'Yogurette <3', 'Hamster! Ich hatte den stärksten, besten und schlausten! Außerdem brachte die Serie "Hamtaro" mich durch die Kindheit :D', 'Espeon! Weil... PINK, elegant, schön und geheimnisvoll <3', NULL, 'Card Captor Sakura <3 Clamp schafft so großartige Welten :)', 'Ui ui ui <3 es MUSS aus Tokyo mew mew sein <3 und meine Wahl fällt auf Zakuro <3 Schade, dass ich so eine Grinsebacke bin und niemals so schön ernst aussehen werde wie sie. D: Aber sie ist eine wunderschöne und interessante Persönlichkeit v.v und so perfekt selbstbewusst :D so muss eine Frau sein!', 'Achterbahn und Shows! Jedoch weit entfernt von der Wasserbahn :DD', 'Hm... persönlich :) aber es wäre was typisches und schönes :) -> Veränderung ', 'Ich bin aufnahmefähig, motiviert und aktiv :D ', '#ff6db8', 112),
(228, 62, 6, 'Design', NULL, 2013, NULL, '2013-09-27', 'Waage', '1,72', 'Lesen, zeichnen, backen, fotografieren und Filme gucken ( am liebsten von Mavel *-*)', '​Thai Curry und alles mit Melonengeschmack *^*', 'Marshmallows, Melonen Bonbons und Schokokekse <3', NULL, 'Cherubi weil es rosa und flauschig aussieht ', NULL, ':3 Da könnt ich mich garnicht entscheiden..  Aber ich denke in der Welt von clamp würd ich mich sehr wohl fühlen. ', 'Sakura aus Card Captor Sakura, weil sie immer freundlich und hilfsbereit ist aber sich dabei nicht unterkriegen lässt.  Außerdem trägt sie immer sooo niedliche Outfits ^^', 'Auf dem Riesenrad, weil man von dort den ganzen Park überblicken kann und bei den Süßigkeitenständen *__*', 'Das ich alles, was ich schaffen will, auch erreichen kann und dass es allen gut geht, die ich liebe.', 'Aloha ich  bin Yui,  leicht verplant aber immer fröhlich und versuche immer mein Bestes zugeben. Kreativität ist für mich das Wichtigste und so erhält bei mir auch jeder Kuchen seinen eigenen Yui-Stempel :3 Auch bin ich sehr glücklich ein Teil dieses süßen Maid Cafes zusein <3', '#ffcf9e', 112),
(229, 40, 17, 'Maid', NULL, 2009, NULL, '2013-02-20', 'Fische', NULL, 'Pen and Paper Rollenspiele und Singen', 'Rotkohl + Klöße, Yukimi Daifuko', 'Ich kann mich nicht entscheiden, weil es so viele leckere süße Sachen gibt >_< Auf jeden Fall ist Zuckerwatte ganz oben bei mir auf der Liste.', NULL, 'Ich wäre gerne Mew! Ich mag Mew sowieso, es ist süß, verspielt und es kann fliegen! =D Gibt es ein besseres Pokemon? Außerdem hat es Psychokräfte!', NULL, 'Das ist eine schwierige Frage! Früher hab ich mir immer Gewünscht in der Welt von Inuyasha leben zu können. Ich fand es so toll im feudalen Japan zu leben, in dem Dämonen und Geister existieren. Aber heute würde ich glaube ich gerne in der Welt von Pokemon oder One-piece leben. Die Vorstellung einfach seine Sachen zu packen und in die Welt zu ziehen finde ich total schön.', 'Ich denke ich wäre gerne Utena aus dem gleichnamigen Anime. Sie ist so stark und kämpft für ihre Überzeugungen und ihre Freunde und schafft es allem zu trotzen obwohl sie von ihren Feinden oft unterschätzt wird. Das finde ich bewundernswert.', 'Entweder bei den Achterbahnen oder im Streichelzoo bei den Tieren! Auf keinen Fall würde man mich in der Nähe der Geisterbahn finden. Ich hab so Angst vor Geisterbahnen Q_Q', 'Ich würde mir wünschen das ich und meine Familie glücklich und zufrieden leben könnten. Eine Zuckerwattemaschine wäre bestimmt aber auch noch drin ;D', 'Ich bin offenherzig und erzähle gerne, kann aber auch gut zuhören. Ich mache gerne quatsch und ärger meine Freunde, kann aber auch ganz lieb und anhänglich sein >_< Ich denke mit mir kann man viel Spaß haben :-)', '#ffff01', 112),
(230, 50, 7, 'Maid', NULL, 2013, 'Durch neugier, interesse an der Japanischen Kultur, spaß an Shootings, liebe zu süßen und leckeren Törtchen usw und letztendlich durch meine Freundin May ;) und ich bereue es kein bischen, da ich super tolle und nette Leute kennen gelernt habe mit denen man die gleichen Interessen teilen darf und das macht es um so schöner!', '1988-02-15', 'Wassermann', '1,65', 'Cosplay und Bengalkatzen', 'ReisCurry', 'Eiscreme', 'Ich bin fasziniert von Katzen und damit meine ich nicht nur Hauskatzen sondern auch Wildkatzen, wie z. B. Geparden, Leoparden aber auch Löwen usw. Doch an erster Stelle steht bei mir die Bengalkatze. Ich besitze selber zwei von den Stubentigern und will sie nicht mehr missen. Sie haben einen tollen Charakter und sind echt einzigartige Tiere. Sie lieben Wasser, reden viel und sind Energiebündel, die bis ins hohe Alter total verspielt sind. Ihre wilde Leopardenmusterung macht sie so faszinierend. Ganz toll finde ich auch Abessiner und Savannah Katzen.', 'Pikachu. Es ist frei und immer voller Energie geladen und so manch einem könnte ein Stromschlag mal nicht schaden xD', NULL, 'In einem Mix aus verschiedenen. Wichtig wäre mir Frieden und der Schutz der Tiere, wo Mensch & Tier im Einklang leben. Wo Kinder behutsam aufwachsen können und man noch Träume hat und die Welt nicht von Hass erfüllt ist und Geld nicht die Welt regiert. Dort, wo wir die Welt nicht kaputt machen und die Natur geschätzt und respektiert wird. Und eine mit ganz viel Sonnenschein :)', 'Wer wäre denn nicht gerne eine Sailor Kriegerin im Kampf für die Gerechtigkeit?', 'Ich glaube überall *lach* an Spielbuden, Süßigkeitenständen und den größten und schnellsten Attraktionen. Wahrscheinlich aber an einem riesen Pferde Karussel, ich finde die altmodischen großen Karussels wunderschön und könnte sie stundenlang bewundern.', 'Natürlich mehr Wünsche, was soll der Geiz hehehe :D Aber ich kann schonmal einen verraten, ich würde super gerne mal nach Japan und außerdem dort selbst mal in einem Maid Cafe bedient werden ^-^', 'Ich bin mit Anime & Manga groß geworden, deswegen cosplay ich gerne. Und ich fühle mich als Maid pudelwohl :3 Außerdem liebe ich den Gyaru Style und die Lolita Mode ist ein Traum! :) Ich liebe Tiere über alles und finde, dass man sich viel mehr für den Tierschutz einsetzen sollte.  Ganz besonders liebe ich meine Bengalkatzen Simba & Cira. Sie sind alles für mich <3', '#ff0d86', 112),
