dort selbst mal in einem Maid Cafe bedient werden ^-^', 'Ich bin mit Anime & Manga groß geworden, daher cosplay ich gerne. Und ich fühle mich als Maid pudelwohl :3 Außerdem liebe ich den Gyaru Style und die Lolita Mode ist ein Traum! :) Ich liebe Tiere über alles und finde, dass man sich viel mehr für den Tierschutz einsetzen sollte.  Ganz besonders liebe ich meine Bengalkatzen Simba & Cira. Sie sind alles für mich <3', '#ff0d86', 112),
(232, 52, 7, 'Maid', NULL, 2013, 'Maid Café''s haben mir schon immer gut gefallen und ich wollte auch gerne mal in einem arbeiten.  Außerdem möchte ich viele neue Leute kennenlernen^^', '2013-04-04', 'Widder', '1,68', 'Lolita tragen, Dolls sammeln und Konzerte besuchen.', 'Sushi, Pizza, Pasta und Spinat :3', 'Kuchen natürlich, am liebsten mit Erdbeeren! Und Macarons <3', 'Ich liebe Alpacas! Die sind sooo flauschig und süß und gucken immer so lieb und treudoof *-*', 'Togepi! Es ist immer fröhlich und süß <3', NULL, 'Ich glaube die Digiwelt wäre ganz cool^^', 'Sailor Venus! Sie ist einfach die coolste :D', 'Bei den gebratenen Champignons und den Schokofrüchten, die liiiebe ich <3', 'Ein Leben wie Marie Antoinette xD', 'Ich bin eine Backfee, denn ich liebe backen einfach.', '#79d5ac', 112),
(233, 56, 7, 'Maid', NULL, 2011, 'Ich habe 2010 zum ersten Mal eine Con besucht und es war die Dokomi. Aus Zufall heraus war ich auf einmal eine Helferin und konnte die Con als Helferin und Gast genießen. Später habe ich dann erfahren, dass das LC neue Maids sucht. Da die Con mich sofort überzeugt hat und die Idee als Maid zu arbeiten sehr gefallen hat, wollte ich es gerne ausprobieren.  ', '2013-07-08', 'Krebs', '1,65', 'Manga lesen, spazieren gehen, mit Freunden treffen', 'Dim Sum, Sushi, Wassermelone und Dorianfrucht xD ', 'CHOCOLATE ', 'Katze. Katzen sind äußerst unabhängige Tiere und doch wenn sie Zuneigung  haben wollen, stellen sie sich so süß an, dass man sofort nachgeben muss und sie einfach lieb haben muss. ', 'Plusel und Minum. Die kleinen Häschen sind frech und doch so putzig', NULL, 'One Piece. Ich liebe die verschiedenen Inseln, die Oda Eiichiro sich einfallen lässt für die Abenteuer von Ruffy und co. Außerdem frage ich mich wie es sich wohl anfühlen würde eine Teufelsfrucht zu essen und dann Special power zu haben ', 'Keins, egal wie sehr ich als kleines Kind Sailor Moon oder Doremi nachgespielt habe, würde ich mich nicht mit einer assoziieren. Wenn dann andere Charaktere.', 'Achterbahn!!! Nichts ist besser als Achterbahn.', 'Ein wohl utopischer Wunsch, aber Weltfrieden wäre echt toll. Man sieht jeden Tag schlechte Nachrichten über Kriege jeder Art und es macht mich traurig mit anzusehen wie unschuldige Zivilisten mit in den Kämpfen hineingezogen werden. ', 'Konnichiwa Minna-san, ich bin manchmal etwas schüchtern. Also seid bitte ganz lieb zu mir. Ich liebe süße und niedliche Gegenstände, bin eine große Katzenliebhaberin und habe gaaaaaaanz große Angst vor Spinnen. ', '#9ec9f3', 112),
(234, 62, 7, 'Design', NULL, 2013, NULL, '2013-09-27', 'Waage', '1,72', 'Lesen, zeichnen, backen, fotografieren und Filme gucken ( am liebsten von Mavel *-*)', '​Thai Curry und alles mit Melonengeschmack *^*', 'Marshmallows, Melonen Bonbons und Schokokekse <3', NULL, 'Cherubi weil es rosa und flauschig aussieht ', NULL, ':3 Da könnt ich mich garnicht entscheiden..  Aber ich denke in der Welt von clamp würd ich mich sehr wohl fühlen. ', 'Sakura aus Card Captor Sakura, weil sie immer freundlich und hilfsbereit ist aber sich dabei nicht unterkriegen lässt.  Außerdem trägt sie immer sooo niedliche Outfits ^^', 'Auf dem Riesenrad, weil man von dort den ganzen Park überblicken kann und bei den Süßigkeitenständen *__*', 'Das ich alles, was ich schaffen will, auch erreichen kann und dass es allen gut geht, die ich liebe.', 'Aloha ich  bin Yui,  leicht verplant aber immer fröhlich. Ich versuche immer mein Bestes zugeben. Kreativität ist für mich das Wichtigste und so erhält bei mir auch jeder Kuchen seinen eigenen Yui-Stempel :3 Auch bin ich sehr glücklich ein Teil dieses süßen Maid Cafes zusein <3', '#ffcf9e', 112),
(235, 63, 6, 'Maid', NULL, 2013, NULL, '1996-01-28', 'Wassermann', '1,60', 'Backen, schwimmen, zocken', 'Ich liebe alles an Essen :D', 'Alles was aus Schokolade besteht . Ob Tafelschokolade, Torte, Kuchen, Kekse, Eis ...mhh lecker !', 'PANDAS! Groß, flauschig, süß und ihr schwarz weißes Aussehen macht sie einzigartig *-*', 'Schiggi ! Es war schon immer meine Erstwahl, denn es ist lustig, süß und wird groß und stark !', NULL, 'Dragonball! Wie toll es einfach wäre ein Supersayajin zu sein. Fliegen können und übermenschliche Kräfte zu haben~', 'Ich glaube Doremi (aus DoReMi) würde am besten zu mir passen. Sie ist immer fröhlich und leicht tollpatschig.', 'Natürlich an den Achterbahnen, Wildwasserbahnen eigentlich überall wo es einen Adrenalin-kick gibt !', 'Von der Fee würde ich mir eine Weltreise wünschen, mal alles sehen und überall Fotos machen.', 'ich bin Aiko - Immer fröhlich und ich liebe essen :3', '#cb5561', 112),
(236, 64, 6, 'Maid', NULL, 2011, 'Ich liebe Süßigkeiten und ich fand die Kleider immer schon so schön. Ich liebe es Menschen eine Freude zu machen, und ihnen den Tag mit ein bisschen Entertainment und Kuchen zu versüßen :3', '2013-06-09', 'Zwillinge', '1,58', 'Singen, tanzen, malen und Süßigkeiten essen :3', ' Erdbeertorteeeeeeee ^o^', 'Rote und grüne Gummibärchen', 'Panda, Katze, Schildkröte, Pinguin … >.<  Ich hab so viel Lieblingstiere, weil sie alle sooo süß sind auf ihre Art und Weise.', 'Ein Celebi dann kann ich durch die Zeit reisen.', NULL, 'Ich finde die Welt in der ich lebe am besten, die ist schon fast wie ein Anime XD', 'Ichigo aus Tokyo Mew Mew. Sie kann sich in eine Katze verwandeln :3 das will ich auch können.', ' Auf der schnellsten Achterbahn!', ' Ich würde mir noch mehr Wünsche wünschen, um die vielen Wünsche zu erfüllen, die ich habe.', 'Bin nicht groß >-< aber hab ein gaaaaaanz großes Herz!', '#02b5dd', 112),
(237, 65, 8, 'Maid', NULL, 2013, 'Ich wollte schon immer mal eine werden, weil ich Maids süß finde.', '1992-02-10', 'Wassermann', '1,59', 'Cosplayen, Freunde treffen, Mangas lesen,  Animes schauen, "Zocken" wenn man das mal so schreiben kann XD ', 'Sushi <3', 'Ich esse viele süße Sachen gerne und kann mich nicht entscheiden x.x', 'Der Wolf, weil er für mich eine persönliche Bedeutung hat ^-^', ' Mew <3 <3 Weil es ist klein, rosa und so mega süß *Q*', NULL, 'In zu vielen, haha. Elfenlied, Witchblade,  Gantz, Highschool Of The Dead, Shingeki No Kyojin, Hellsing, Najica, Dears und und und <3', 'Keins  ', ' Ich glaube ich wäre da, wo sich die meisten nicht rein trauen, also bei den schnellen und hohen Sachen ', 'Hmm, ich glaube ich würde mir wünschen, dass ich zaubern kann ^-^', 'Ich bin klein, verrückt, lieb und manchmal eine kleine Chaotin. ', '#cbf8e3', 112),
(238, 66, 7, 'Maid', NULL, 2013, 'Ich liebe es Menschen ein Lächeln aufs Gesicht zu zaubern und das kann man als Maid am besten :3', '2013-03-09', 'Fische', '1,75', 'Zeichnen, Onlinespiele/allgemein Spiele, Fotos und Videos machen :3', 'Pizza *-*', 'Oreo Kekse *-*', 'Ich habe kein wirkliches Lieblingstier, aber viele, die ich süß finde, wie zum Beispiel Katzen, Wölfe, Chinchillas und viele mehr :)', 'Ich wäre wahrscheinlich Blitza, ich liebe den Blitz und Donner über alles :)', 'Batman', 'In der Batman Welt *-*', 'Ich wäre Bunny aus Sailor Moon, sie ist schusselig aber wenn es drauf ankommt ist sie mit dem Herzen dabei <3', 'Auf der Achterbahn, ich liebe die Aktion ! :) ', 'Dass die Batman Welt, mit all ihren Schurken und Helden existiert *-* für manche ein Chaos für mich ein Traum ;)', 'Hallo, mein Name ist Honey :) Ich liebe Onlinespiele und die  Dc Comic Welten. Ich liebe es Leute glücklich zu machen und hoffe, dass ich auch euch ein Lächeln aufs Gesicht zaubern kann ;3', '#660066', 112),
(239, 68, 6, 'Maid', NULL, 2013, 'Das Konzept eines Maid Cafés hat mich schon länger interessiert. Der Kontakt zum Kunden ist ein völlig anderer, ein persönlicherer. Hinzu kommt noch, dass man die Möglichkeit hat in einem Team voller lieber Menschen zu arbeiten. ^-^/ ', '1995-12-11', 'Schütze', '1,72', 'Cosplayen, FFs lesen und schreiben', 'Da könnte ich mich nicht entscheiden... ^^''''', 'Jegliche Art von Schokolade', 'Hunde, da sie treudoof und wirklich immer für dich da sind :)', 'Woingenau! Er ist immer für einen Lacher gut ;D', NULL, 'Ich würde gerne in der Welt von One Piece leben, um die Grand Line mit meiner Crew zu besegeln. <3', 'Nico Robin :) Auch, wenn sie nicht das typische Magical Girl ist... Sie hat einen starken Charakter und setzt sich für ihre wahren Freunde ein!', 'Auf Geister- oder Achterbahnen <3', 'Ein gesundes und sorgenfreies Leben für Familie und Freunde. :)', 'Ich bin musikbegeistert und bereit meine gute Laune mit jedem meiner Gäste zu teilen ~(^-^)~', '#ccff99', 112),
