(244, 69, 9, 'Maid', NULL, 2013, 'Weil ich meine Erfahrungen erweitern wollte und mal ein wenig hinter die Kulissen schauen wollte wie das denn so als Maid ist :D', '1992-12-07', 'Schütze', '1,70', 'Musik hören, mit Freunden chillen, zocken.', 'Milchreis mit Zimt & Zucker', 'Snickers', 'Schlangen! Weil sie so wunderschön sind mit ihren Schuppen und den Augen, ich habe mich darin einfach verliebt :3', 'Ich denke ich wäre ein Lanturn, ich meine Wasser und Elektro gleichzeitig ist ja wohl mal der Wahnsinn :D', NULL, 'Natürlich in der Pokemon Welt!... oder in der Welt von ''Erementar Gerad'' ♥', 'Gar keins :D ich bin keine von diesen Träumerlienchen...', 'In diesen komischen Häusern, in denen alle Wände schief sind und man sich drin verläuft und gegen Sachen rennt :D', 'In meine Vergangenheit reisen zu können und meinem alten Ich sagen können was ich hätte besser machen können :]', 'Ich bin eine sehr kreative Maid mit ganz viel Temperament und Leidenschaft.', '#f00001', 112),
