(249, 71, 5, 'Maid', NULL, 2012, 'Anfang 2011 war ich das erste mal  im Lucky Chocolate Maid Café und ich fand die Atmosphäre da so toll und die Kleider waren auch so süß :D da wollte ich unbedingt mitmachen und auch mal die andere Seite der Con sehen :)', '2013-04-12', 'Widder', '1,58', 'Kochen <3', 'Alles was schmeckt (derzeitiger Favorit: Bulgogi <3)', 'EIS, POPCORN! *^* :D', 'Löwen :) es ist halt der König der Tiere ;P', 'ich wäre gern ein Vulpix: süß, klein, trotzdem eigensinnig, temperamentvoll  und nicht leicht zu erobern ;) und wenn es jemanden mag, dann auch von ganzem Herzen <33', NULL, 'One Piece *^* aber auch hier in der realen Welt wird es nie zu langweilig :D', 'Es ist kein typisches Magical Girl, aber ich wäre gerne Buttercup :DD sie ist stark, sehr frech, kann gemein sein, aber im Herzen ist sie sehr lieb <3', 'An den Imbissbuden :DDDD und an den Zuckerwaren (Zuckerwatte und Schokoäpfel FTW *^*) xD <3', 'Dass meine Familie und Freunde gesund bleiben und dass ich glücklich bin :3', 'Ich bin die kleine Umi, die unheimlich gerne isst und ich freue mich euch im Café zu bedienen <3', '#058d41', 112),
(250, 72, 3, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#ce9b02', 112),
