(252, 72, 5, 'Maid', NULL, 2012, 'Ich finde es toll in einer süßen Uniform mit süßen Maids zusammen zuarbeiten, in einem süßen Cafe :)  Mir macht es einfach total Spaß (^.^)//', '2013-09-12', 'Jungfrau', '1,69', 'Singen, Tanzen, Camwhoring, Cosplay, Shoppen, Zeit mit meinen Liebsten verbringen, Zeichnen und Malen, Schauspiel, Japanisch lernen...und und und...', 'Zu viel! ^.~', 'Schokolade mit Macadamianüssen und japanisches Konfekt mit Bohnenpaste *__*', 'Ich liebe sooo viele Tiere! Im Moment ahbe ich ein Meerschweinchen und einen Kater :)', 'Woingenau. Dann könnte ich immer im Heißluftbaloon fliegen +__+ yeah! ', NULL, 'Ich würde gerne im wandelnden Schloss leben >///< Das wäre schön und aufregend *^* ', 'Natürlich Sailor Moon >_< Weil sie lustig, hübsch und süß ist und dann auch noch ihren Traumann an ihrer Seite hat. Was will man mehr ^.~  ', 'Bei der Zuckerwatte! ', 'Das alle Menschen glücklich sind :) ', 'Ich bin ein verplantes, kreatives Persönchen, dass meistens ziemlich aufgedreht ist :0  Meine Stärke ist meine gute Laune (^-^) Ich mache gerne Quatsch und freue mich immer, neue Leute kenne zulernen. Aber gefährlich bin ich auch...habe mal Kung Fu gemacht waaahh~~ .`__´.  Kampf-Maid-Power! (>.<)', '#ce9b02', 112),
(253, 73, 3, NULL, NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#9b002f', 112),
(254, 73, 4, 'Maid', NULL, 2011, 'Als Maid bereitet es mir die größte Freude so viel Kontakt mit neuen Menschen zu haben und ihnen mit Gesprächen, Spielen und unseren leckeren Kuchen ein Lächeln auf ihr Gesicht zu zaubern.', '2013-04-04', 'Widder', NULL, 'Theater, Spielkonsolen, Cosplay', 'Vanilleeis mit heißen Kirschen', 'Helle Schokomuffins mit Schokoladenstückchen! Wenn man in hinein beißt, kommt einem immer die Frage auf: Bekomme ich jetzt ein Stück Schokolade ab oder nicht? Und wenn doch, schmeckt der auch so schon leckere Muffin noch viel besser!', 'Eulen. Sie sind wunderschöne und elegante Tiere. Sie strahlen eine unfassbare Stärke aus, dass man von ihnen fasziniert sein muss.', 'Glumanda! Ich friere immer sehr schnell und als Feuer-Pokemon könnte mir das nicht passieren! Davon ab sind Glumandas Weiterentwicklungen nicht so schwach und süß, als dass Team Rocket versuchen würde sie zu fangen. ', NULL, 'In der Digiwelt! Ein Digimon ist dein bester Freund und mit ihm dann auch noch zusammen spannende Abenteuer zu erleben, wäre das Größte. ', 'Eindeutig Michiru Kaioh von Sailor Moon! Als ich sie das erste mal im Anime in einem Park mit ihrer Violine gesehen habe, war es um mich geschehen. Den ganzen Tag habe ich meine Mutter angebettelt mir eine Geige zu kaufen und meine Haare zu färben, was sie mir, verständlicherweise, nicht erlaubt hat. Davon abgesehn, war ich früher in Haruka Tenoh verliebt und mein sehnlichster Wunsch war sie zu heiraten! ', 'Achterbahnen! Je schneller und gefährlicher, desto besser! Wenn man im Sitz sitzt, langsam die Schräge hoch fährt um im nächsten Moment in einen Looping durch zu starten ist das Größte! Wenn man dann genug von der ganzen Fahrerei hat, kann man dann in Ruhe einen leckeren selbstgebackenen Schokomuffin genießen.~ ', 'Nach meinem Leben möchte ich gerne eine Katze sein. Katzen sind schöne und vor allem eigenwillige Tiere. Und wenn ich sehe wie ich meine Katze immer verhätschel, könnte mir ein Leben als Katze ziemlich gut gefallen. Nur auf das Mäusejagen kann ich verzichten...', 'Hey! Ich bin Peggy und liebe es mit meiner Katze zu kuscheln! Ich freue mich schon euch bedienen zu dürfen <3 ', '#9b002f', 112),
(255, 74, 3, 'Entertainment', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#c99bfe', 112),
(256, 74, 4, 'Entertainment', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#c99bfe', 112),
(257, 74, 5, 'Entertainment', NULL, 2010, 'Eine Freundin bat mich damals mit ihr mitzumachen und ich fand die Idee in ein süßes Kleid zu schlüpfen und zu bedienen eine wunderbare und süße Idee. Außerdem ist es toll wie viele neue Leute man kennenlernt und wie schnell die Maids hier einem ans Herz wachsen <3', '2013-10-17', 'Waage', '1,63', 'Musik (hören, singen, tanzen und selber machen) <3', 'Crêpes, Sushi', 'Torten, in jeglicher Art, Form etc. Total lecker und vor allem vielseitig, da ist einfach immer was dabei, für jeden Geschmack, Anlass, Jahreszeit! Und so ein Stück Torte lässt einen doch gleich glücklicher werden, wenn man es sich auf der Zunge zergehen lässt, auch wenn es auf die Hüften schlägt! x3', 'Hm… schwierig, ich finde Wildkatzen total faszinierend und atemberaubend schön, aber genauso bin ich auch voll der Hundefan, Huskys oder Wölfe *__________* Also kein richtiges Lieblingstier, dafür bin ich viel zu tierverrückt in zu vieles <3', 'Vulnona, es ist ein edles und mysteriöses Pokémon, schwer zu fassen, hat magische Fähigkeiten und gehört dem Feuerelement an. Ich fand es schon immer wunderschön', NULL, 'Definitiv in der Digiwelt! Digimon können mit einem reden und man kann sicher viele Abenteuer mit ihnen erleben, so einen Digipartner zu haben ist doch sicher spannend! *___*', '„Stark, bereit, unbesiegbar, schön, entschlossen, mutig! “ Richtig: Jeanne, die Kamikaze Diebin! ? Warum? Sie ist eine bewundernswerte Person, als Kind habe ich sie für ihre Stärke immer sehr bewundert, außerdem ist sie nicht das typische Magical Girl, welches ständig gerettet werden muss, weint und schwach ist. Sie weiß mit ihren Problemen umzugehen und gibt nicht auf. Wenn sie sich verwandelt erkennt man nicht wer sie in Wirklichkeit ist, hat einen wunderbaren kleinen Engel der ihr hilft und ein relativ „normales“ Leben. Außerdem wollte ich schon immer ihren Wunderball haben, mit dem sie sich überall festhalten konnte, praktisches Ding! xD', 'Natürlich bei den Achterbahnen! So ein bisschen Nervenkitzel ab und zu ist einfach purer Fun! Aber ein bisschen Entspannung fürs Herz muss natürlich auch sein, also werde ich ab und zu auch mal am Karussell vorbei schauen und gucken ob vielleicht mein Prinz dort steht und wartet', 'Eine Zeitreise zu machen. Vergangenheit und Zukunft erkunden, in verschiedene Epochen reisen, dort die Trachten tragen, Speisen probieren, Sitten kennenlernen, aber auch zu wissen, wie das Leben vor der Menschheit war, Dinosaurier sehen und die Welt in 803789519 Jahren sehen! xD', 'Ich bin Miu, manchmal etwas tollpatschig aber meistens gut gelaunt und manchmal etwas abgedreht x3 Oh und ich liiiiiiiiebe Kuscheltiere <3', '#c99bfe', 112),
