(260, 75, 5, 'Maid', NULL, 2011, 'Ich fand Maids und die Idee vom Maidcafé schon immer total süß <3', '2013-11-06', 'Skorpion', '1,58', 'Zeichnen, Geige spielen, Tanzen, Animes und Mangas <3', 'Schokolade :)', 'Schokolade :)', 'Katze! Sie sind intelligent, elegant, trotzdem süß, verschmust und außerdem etwas listig. ', 'Ich wäre Vulpix :)', NULL, 'Hm...  wahrscheinlich Death Note... ist eigentlich unsere Welt, aber ein Death Note würde existieren! :D', 'Sailor Mars! Schon allein wegen den schwarzen Haaren und da meine Lieblings- und Maidfarbe Rot ist :D Aber auch ich kann manchmal bisschen zickig sein wie Sailor Mars, bin im Grunde aber ein ganz lieber Mensch :)', 'Beim Süßigkeitenstand :3 und wenn nicht dann auf dem Riesenrad :D', 'Seelenfrieden :) ', 'Ich bin am Anfang sehr schüchtern und rede nicht gerne, aber wenn man mich ein bisschen besser kennen lernt, merkt man, dass ich eigentlich ein sehr aufgeschlossener Mensch bin, mit dem man viel Spaß mit mir haben kann.', '#fe0000', 112),
(261, 76, 3, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#cfc4e4', 0),
(262, 76, 4, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#cfc4e4', 112),
(263, 76, 5, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#cfc4e4', 112),
(264, 76, 6, 'Maid', NULL, 2010, 'Ich glaube das war 2010. Damals war ich bei einem seperaten Event von dem Lucky Chocolate in Düsseldorf. Danach war ich so begeistert, dass ich mich auch als Maid beworben habe. Schließlich wurde ich angenommen und war das erste mal bei der Dokomi 2010 aktiv. :) ', '2013-12-22', 'Steinbock', '1,68', 'Musik (Saxophon spielen), Backen, Ausgehen, Festivals, Philosophie und so ein Kram. :D ', 'Schokolade. Am liebsten Kiloweise!!', 'SCHOKOLADE. TONNENWEISE!', 'Ich hab zwei! Einmal Eulen und Katzen. Eulen finde ich schon toll seit ich denken kann, da diese Tiere sehr weise und stolz wirken. Katzen hingegen sind die einzigen Haustiere die irgendwie noch ihr eigener Herr sind. Sie haben einen eigenen Willen und springen dir nicht hinterher wie ein Flummi. Sie sind unabhängig aber lieben trotzdem bedingungslos. ', 'Flegmon! Faul sein den ganzen Tag, das wärs!', NULL, 'Definitiv in der von One Piece. Ich will Reisen und die Welt sehen. Dabei noch einen Schatz suchen... der Gedanke gefällt mir!', 'Oha, das ist eine wirklich, wirklich schwere Frage. Ich persönlich sehe mich einfach so gar nicht als Magical Girl. Magical Girls sind entschlossene und mutige Persönlichkeiten, die oft eine Große Verantwortung in die Hand gelegt bekommen. Ich zweifel oft an meinen Fähigkeiten und bin glaube ich einzig und allein gut darin, Schokolade zu eliminieren. Daher sollten wir das bei mir mit dem Magical Girl lieber sein lassen ;)', 'Erst auf der abgefahrensten Achterbahn die es da so gibt. Danach würde ich (natürlich wenn mein Magen noch möchte) erstmal was essen und DANN (ganz wichtig! Ein Muss bei jedem Ausflug in den Freizeitpark!!) Maskottchen auf den Arm nehmen. :D', 'Einen nicht ausschöpfbaren Vorrat an Schokolade! Dafür muss dann eine Neue Einheit erfunden werden. Zum Beispiel Trillzionen Tonnen? (Trillzionen ist dann nicht eine Millionen hoch 3, sondern eine Trillionen hoch unendlich! OH JA!)', 'Hey alle zusammen! Fia mein Name, Maid seit 2010. Ich konnte im Jahr 2013 leider nicht im Cafe mitwirken, daher freue ich mich umso mehr auf 2014! Meinen Charakter würde ich als wuselig aber trotz allem auch als offen und freundlich bezeichnen... Zumindest gebe ich mir dabei aller beste Mühe. :) Wir sehen uns im Cafe! ', '#cfc4e4', 112),
(265, 77, 3, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#66cafc', 112),
