INSERT INTO `maid_versions` (`ID`, `RecordID`, `Version`, `Type`, `colour`, `since`, `maidreason`, `BDay`, `zodiac`, `size`, `hobbys`, `favfood`, `favsweet`, `favanimal`, `pokemon`, `anime`, `animelocation`, `magicalgirl`, `funfairlocation`, `wish`, `aboutme`, `mcolour`, `maidphotoID`) VALUES
(267, 77, 5, 'Maid', NULL, 2012, 'Weil ich Spaß an kreativer Arbeit, Mode und schön garnierten Süßigkeiten habe. ^^', '2013-12-20', 'Schütze', '1,68', 'Sport, zeichnen & kreatives Gestalten, etwas mit Freunden unternehmen, Sprachen lernen, reisen', 'Spinat & Lachs, Ramen, Okonomiyaki, gedünstetes oder gegrilltes Gemüse', 'Eiscreme & Joghurt, mitteldunkle Schokolade, Käsekuchen & Cup Cakes, Weihnachtsplätzchen, Lakritz… und zum Trinken: Chocolate Frappé', 'Füchse & Wölfe, sowie die domestizierte Version: Hunde  Sie sind hochintelligent, sie sind schnell, sie sind geheimnisvoll, gefährlich und trotzdem der beste Freund des Menschen, treu und stark. Ihr Fell ist weich und flauschig und der berühmte Hundeblick ist einfach unwiderstehlich. ', 'Ein FuchspokéMon, ob nun Vulpix, Evoli oder eine ihrer Weiterentwicklungen, weil ich Hunde super süß finde, aber das Geheimnisvolle an Katzen bewundere und Füchse beide Eigenschaften in sich vereinen. ', NULL, 'In der Fluch der Karibik Welt *trollolol* :D', 'Ich wäre lieber eine Revolverheldin wie Revy aus Black Lagoon. >:D', 'In der Wildwasserbahn! ', 'Ich möchte beamen und mich dadurch an verschiedene Orte teleportieren können – wie Son Goku. Nie wieder mit überfüllten Bussen oder Zügen fahren müssen, nie wieder an Bahnhöfen mit zwielichtigen Gestalten rumgammeln müssen, mich nie wieder über die Bahn ärgern, nie wieder eine Party absagen, weil man nachts nicht mehr nach Hause käme. Reisen an jeden Ort der Welt, ohne Hotel- oder Flugkosten, denn man kann ja jederzeit nach Hause.  DAS wäre die absolute Freiheit!! ', 'Ich bin lebenshungrig und wissbegierig, gerne unterwegs und würde am liebsten die ganze Welt bereisen, weil ich mehr von diesem wunderschönen Planeten sehen und begreifen will: verschiedene Kulturen, fremde Gerüche und Geräusche, ungewöhnliche Früchte, faszinierende Tiere, bunte Blumen und grüne Pflanzen, den blauen Himmel, das weite Meer, den Wind im Haar.  Ich liebe Freiheit und Athentisches, Farben und Lebensfreude.   Kreative Schaffensprozesse faszinieren mich, ob mit Stift & Papier, Lebensmitteln, Stoff, der Kamera oder am PC.   An sich bin ich eher eine ruhige Person, die lieber erst beobachtet, die Dinge hinterfragt und sich ihr eigenes Bild macht, bevor sie vorschnell handelt. Andererseits kann ich aber auch furchtbar spontan, abgedreht und verrückt sein.  Doch ich genieße auch faule und gemütliche Tage, ob zu Hause oder in einem guten Café. <3 ', '#66cafc', 112),
(268, 78, 3, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#ce398a', 112),
(269, 78, 4, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#ce398a', 112),
(270, 78, 5, 'Maid', NULL, 2012, '2011 wurde ich danke meines Bruders mal gaaaaanz spontan plötzlich Helferin. Ich habe dabei so viele neue nette Leute, Helfer und Maids kennen gelernt. Es war lustig und hat so Spaß gemacht und weil die Maids dabei auch noch alle so zuckersüß aussahen, hatte ich mich kurz danach sofort beworben. ', '2013-11-14', 'Skorpion', '1,58', 'Zeichnen (am liebsten Mangafiguren), Singen, Filme schauen und Süßigkeiten naschen', 'Mmmh ~ Ich weiß nicht…Erdbeeren? Sushi? Ramen? Fried Ice Cream? Zu viele Verführungen! Ich kann mich nicht entscheiden *o* ', 'Ich liebe Fried Ice Cream ~ Außen warm und knusprig ~ Innen kalt, süß und schmilzt langsam auf deine Zunge <3', 'Teacupschweinchen~ so klein und süß und knuffig und die NASE! <3 ', 'Ich wäre gerne Evoli ~ Evoli ist süß und sooo flauschig. Es hat so viel Potenzial und kann sich zu so viele verschiedene Pokemons entwickeln.', NULL, 'Noch immer Tsubasa Chronicle ~ Knuffiger Mokona und in der Welt von Tsubasa Chronicle gibt es noch so viele unterschiedliche Welten: vergangene und zukünftige Welten, Real-live ähnliche und Fantasy-Welten. Da ist einfach alles dabei! =3 ', 'Jeanne d’Arc! Sie ist ein bewundernswerter Chara ~ Stark, mutig, schön und entschlossen~ Man kann sie nur ins Herz schließen. Obwohl sie von klein auf ein hartes Leben hat, hat sie nie aufgegeben und wird dadurch nur immer stärker.  ', 'Bei der Wildwasserbahn! Es ist lustig wenn alle pitsch nass sind.', 'Ich würde mir wunderschöne Flügel wünschen damit ich die Welt von ganz oben sehen kann und viele Länder bereisen kann. Erste Station: Japan! <3', 'Ich bin etwas tollpatschig und vergesslich und eher schüchtern und ich verhasple mich deswegen manchmal weil ich dann so nervös bin… Gomenasai! >____< Aber ich gebe mein bestes weil es mir unglaublich viel Spaß macht euch zu bedienen und euch ein Lächeln ins Gesicht zu zaubern.', '#ce398a', 112),
