(273, 79, 5, 'Maid', NULL, 2011, 'Ich bin Maid geworden, weil ich es liebe Leuten eine freude zubereiten und an diesem Job sehr viel freude habe.', '2014-02-04', 'Wassermann', '1,61', 'Zeichnen, Reiten, Schwimmen, Cosplay', 'Milchsuppe, Pizza, Sushi, Nudeln', 'Ich liebe schoko-CuepeCakes, mit Streuseln und dann noch Sahne drauf, am besten bunte. ', 'Da kann ich mich nicht entscheiden aber ich sage mal Katzen und das weil ich selber auch 3 Katzen zuhause habe ', 'Also wenn dann vill. Arktos weil ich das einfach liebe und ich das auch früher in den Video-Spielen immer genommen habe, außerdem liebe ich Schnee, Winter und wenn es kälter ist :3 ', NULL, 'Ich würde gerne im Anime "Eden of the East" oder "Air Gear" leben weil es einfach nur interessant währe und ich einfach diese Animes sehr mag, auch wenn "Trinety Blood" oder "D.Gray-man" auch toll währen >.< ', 'Also wenn dann Dokuro-chan XD weil sie einfach nicht das übliche Magical Girl Opfer ist, da sie eine Waffe hat mit der sie einige mal ab und zu tot schlägt aber trotzdem iwie schon süß ist :3 ', 'Man würde mich denke ich an fast jedem Karusell finden oder besser ann allem was einen Überschlag macht und schnell ist, weil ich es liebe auf Achterbahnen zu gehen. ', 'Wenn ich einen Wunsch frei hätte würde ich es denke ich so machen das mein Leben wie in dem Anime Eden of the East währe, so dass ich auch einder der selecaos währe, weil ich das einfach so interessant fände, bzw, was man dann alles machen könnte. ', 'Hallo <3! Ich bin Tsuki, backe und koche gerne! Ich liebe Onlinespiele und werkel in meiner Freizeit gerne an meinen Cosplays!', '#95001e', 112),
