(276, 80, 5, 'Maid', NULL, 2012, 'Maid bin ich geworden weil ich quasi genötigt wurde von 2 Freundinnen. Als ich dann ein Seminar besucht habe und so herzlich aufgenommen wurde habe ich unglaublich viel Spaß gehabt und viel gelernt. Den Gästen einen schönen Tag zu bereiten macht mich glücklich :3', '2013-08-14', 'Löwe', '1,82', 'Meine Hobbys sind die Showgruppen in denen ich Mitglied bin also singen, tanzen und außerdem schwimmen und kochen', 'Lasagne', '- Ich liebe Eiscrem aber mein absoluter Favorit sind Erdbeeren in  weißer Schokolade ', 'Mein Lieblingstier ist schwierig auszuwählen ich mag so viele aber ich denke ich mag mit am meisten wildtiere wie den Wolf oder den Luchs. Sie sind wunderschön anzusehen wild und frei <3', 'Ich wäre auf jeden Fall ein Psiana denn meine beste Freundin ist ein Nachtara <3 Wir machen alles zusammen', NULL, 'In einer anderen Welt zu leben wäre bestimmt aufregend. Die Welt von Avatar (auch wenn es kein Anime ist) würde mich besonders Reizen weil ich gerne wüsste welches Element ich wohl bändigen würde (mein Tipp ist ja Wasser aber wer weiß)…', 'Ein spezielles Magical Girl habe ich nicht im Sinn. Doch vermutlich hätte ich Heilfähigkeiten denn ich bin eine wandelnde Apotheke und ein Verbandskasten', '- In Vergnügungsparks findest du mich immer an der schnellsten und wildesten Achterbahn ich liebe die schnelle fahrt und schreie wie ein kleines Mädchen.', 'Den Wunsch einer Fee muss man sich gut überlegen  und man darf ihn  nicht verraten sonst geht er nicht in Erfüllung ; )', 'Also was soll ich sagen ich bin ein wenig durchgedreht, tierlieb und ein Riese mit 1,83m', '#006600', 112),
(277, 81, 3, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#dbb7ff', 112),
(278, 81, 4, 'Maid', NULL, 0, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, NULL, '#dbb7ff', 112),
(279, 81, 5, 'Maid', NULL, 2012, 'Ich bin Maid geworden, weil es mir Spaß macht, Kuchen zu backen, zu dekorieren und euch damit eine Freude zu machen. Außerdem kann man immer süße Kleider tragen und neue Leute kennen lernen. Und ein nicht zu vergessener wichtiger Punkt. In so einem großen und tollen Maid Café zu arbeiten ist einfach nur eine super Erfahrung!', '2013-06-25', 'Krebs', '1,60', 'Nähen, Videospiele, Lesen', 'Wackelpudding, Erdbeeren, Fruchtzwerge', 'Schokokekse! *nomnomnom* Die überleben bei mir nie lange. Und ansonsten gerne alle Arten von Obst, das ist auch süß, macht aber nicht so dick :3', 'Eigentlich war es immer das Pferd. Ist es auch noch... aber in letzter Zeit bin ich seltsam addicted zu Tiger. Sie sind so flauschig *-* Ich hätte gern einen, wenn der nicht so groß werden würde.', 'Ich liebe alle Katzenpokemon (und Pummelluff). Am liebsten wäre ich ein Evoli, weil es so wandelbar ist wie ich selbst es bin.', NULL, 'Am besten gefallen mit mittelalterlich angehauchte Welten so wie in Claymore. Da würde ich mich, glaube ich, ziemlich wohl fühlen. Ich mag den rustikalen Charme und die mittelalterliche Kleidung sehr gerne und auch wenn die angenehmen Sachen der Neuzeit mir doch fehlen würden, ich nehm auch ein Bett aus Stroh <3', '     Ich war nie ein großer Magical Girls Fan, aber eine Serie hab ich dann doch gesehen und das war DoReMi. Und ich liebe Sofie! Sie ist einfach... genau wie ich :) ein bisschen sturköpfig aber immer für ihre Freunde da. Daher mag ich sie so gerne.', 'In der größten und schnellsten Achterbahn. Ich bin ein kleiner Adrenalinjunkie und könnte den ganzen Tag nur damit fahren.', 'Ganz egoistisch Unsterblichkeit. Auf der Welt gibt es so viel zu entdecken und ein Leben reicht gar nicht aus, um alles zu sehen. Und das finde ich so schade, dass ich gerne noch ein Leben und noch eins dran hängen möchte.', ': Ich bin Bibi und freue mich euch mit allerlei Kuchen den Tag versüßen zu dürfen :3 Und falls einmal eine Erdbeere auf eurer Torte fehlt, dann war ich es vielleicht, denn ich liebe Erdbeeren!', '#dbb7ff', 112),
(280, 81, 6, 'Maid', NULL, 2012, 'Ich bin Maid geworden, weil es mir Spaß macht, Kuchen zu backen, zu dekorieren und euch damit eine Freude zu machen. Außerdem kann man immer süße Kleider tragen und neue Leute kennen lernen. Und ein nicht zu vergessener wichtiger Punkt. In so einem großen und tollen Maid Café zu arbeiten ist einfach nur eine super Erfahrung!', '2013-06-25', 'Krebs', '1,60', 'Nähen, Videospiele, Lesen', 'Wackelpudding, Erdbeeren, Fruchtzwerge', 'Schokokekse! *nomnomnom* Die überleben bei mir nie lange. Und ansonsten gerne alle Arten von Obst, das ist auch süß, macht aber nicht so dick :3', 'Eigentlich war es immer das Pferd. Ist es auch noch... aber in letzter Zeit bin ich seltsam addicted zu Tiger. Sie sind so flauschig *-* Ich hätte gern einen, wenn der nicht so groß werden würde.', 'Ich liebe alle Katzenpokemon (und Pummelluff). Am liebsten wäre ich ein Evoli, weil es so wandelbar ist wie ich selbst es bin.', NULL, 'Am besten gefallen mit mittelalterlich angehauchte Welten so wie in Claymore. Da würde ich mich, glaube ich, ziemlich wohl fühlen. Ich mag den rustikalen Charme und die mittelalterliche Kleidung sehr gerne und auch wenn die angenehmen Sachen der Neuzeit mir doch fehlen würden, ich nehm auch ein Bett aus Stroh <3', '     Ich war nie ein großer Magical Girls Fan, aber eine Serie hab ich dann doch gesehen und das war DoReMi. Und ich liebe Sofie! Sie ist einfach... genau wie ich :) ein bisschen sturköpfig aber immer für ihre Freunde da. Daher mag ich sie so gerne.', 'In der größten und schnellsten Achterbahn. Ich bin ein kleiner Adrenalinjunkie und könnte den ganzen Tag nur damit fahren.', 'Ganz egoistisch Unsterblichkeit. Auf der Welt gibt es so viel zu entdecken und ein Leben reicht gar nicht aus, um alles zu sehen. Und das finde ich so schade, dass ich gerne noch ein Leben und noch eins dran hängen möchte.', ': Ich bin Bibi und freue mich euch mit allerlei Kuchen den Tag versüßen zu dürfen :3 Und falls einmal eine Erdbeere auf eurer Torte fehlt, dann war ich es vielleicht, denn ich liebe Erdbeeren!', '#dbb7ff', 112),
(281, 74, 6, 'Entertainment', NULL, 2010, 'Eine Freundin bat mich damals mit ihr mitzumachen und ich fand die Idee in ein süßes Kleid zu schlüpfen und zu bedienen eine wunderbare und süße Idee. Außerdem ist es toll wie viele neue Leute man kennenlernt und wie schnell die Maids hier einem ans Herz wachsen <3', '2013-10-17', 'Waage', '1,63', 'Musik (hören, singen, tanzen und selber machen) <3', 'Crêpes, Sushi', 'Torten, in jeglicher Art, Form etc. Total lecker und vor allem vielseitig, da ist einfach immer was dabei, für jeden Geschmack, Anlass, Jahreszeit! Und so ein Stück Torte lässt einen doch gleich glücklicher werden, wenn man es sich auf der Zunge zergehen lässt, auch wenn es auf die Hüften schlägt! x3', 'Hm… schwierig, ich finde Wildkatzen total faszinierend und atemberaubend schön, aber genauso bin ich auch voll der Hundefan, Huskys oder Wölfe *__________* Also kein richtiges Lieblingstier, dafür bin ich viel zu tierverrückt in zu vieles <3', 'Vulnona, es ist ein edles und mysteriöses Pokémon, schwer zu fassen, hat magische Fähigkeiten und gehört dem Feuerelement an. Ich fand es schon immer wunderschön', NULL, 'Definitiv in der Digiwelt! Digimon können mit einem reden und man kann sicher viele Abenteuer mit ihnen erleben, so einen Digipartner zu haben ist doch sicher spannend! *___*', '„Stark, bereit, unbesiegbar, schön, entschlossen, mutig! “ Richtig: Jeanne, die Kamikaze Diebin! ? Warum? Sie ist eine bewundernswerte Person, als Kind habe ich sie für ihre Stärke immer sehr bewundert, außerdem ist sie nicht das typische Magical Girl, welches ständig gerettet werden muss, weint und schwach ist. Sie weiß mit ihren Problemen umzugehen und gibt nicht auf. Wenn sie sich verwandelt erkennt man nicht wer sie in Wirklichkeit ist, hat einen wunderbaren kleinen Engel der ihr hilft und ein relativ „normales“ Leben. Außerdem wollte ich schon immer ihren Wunderball haben, mit dem sie sich überall festhalten konnte, praktisches Ding! xD', 'Natürlich bei den Achterbahnen! So ein bisschen Nervenkitzel ab und zu ist einfach purer Fun! Aber ein bisschen Entspannung fürs Herz muss natürlich auch sein, also werde ich ab und zu auch mal am Karussell vorbei schauen und gucken ob vielleicht mein Prinz dort steht und wartet', 'Eine Zeitreise zu machen. Vergangenheit und Zukunft erkunden, in verschiedene Epochen reisen, dort die Trachten tragen, Speisen probieren, Sitten kennenlernen, aber auch zu wissen, wie das Leben vor der Menschheit war, Dinosaurier sehen und die Welt in 803789519 Jahren sehen! xD', 'Ich bin Miu, manchmal etwas tollpatschig aber meistens gut gelaunt und manchmal etwas abgedreht x3 Oh und ich liiiiiiiiebe Kuscheltiere <3', '#c99bfe', 112),
(282, 59, 7, 'Facebook', NULL, 2010, 'Weil ich was Neues ausprobieren wollte… vorher war ich nichtmal aktiv in der Cosplayszene dabei, aber es hat mich einfach interessiert, wie es ist Maid zu sein. Vorallem aber weil die ersten Maids, die ich jemals gesehen habe, so hübsch aussahen. Ich wollte auch so aussehen wie die <3', '2013-09-04', 'Jungfrau', '1,64', 'Architektur, Singen, Essen, Schlafen', 'Sushi, Bulgogi, Bibimbap, Maid Umi''s Kochkünste, Ramen, … eigentlich zu viel um es aufzuzählen <3', 'Ach, ich mag sooo vieles~ Da kann man ich mich echt nicht entscheiden, was ich am aller aller liebsten mag... Aber Pfirsichringe sind schon pure Liebe~ Oder Cakepops mit Milchschokoladenüberzug in Pfirsichgeschmack <3', 'Alles was fett, süß und flauschig ist… meine Kuscheltiere!', 'Relaxo!! -> essen, schlafen, essen, schlafen~ Was für ein Leben~', NULL, 'In der Gundam (00) Welt, aber bitte ohne Krieg... weil die Technik da ist schon extremst <3 :DD Dann will ich meinen eigenen Gundam haben! Oha, wenn ich den steuern könnte :x...', 'Sakura aus Cardcaptor Sakura, weil sie so viele tolle Sachen mit ihren Tarotkarten machen kann und weil sie verdammt süße Kleider hat UND weil ich dann Kero an meiner Seite hätte!', 'Auf dem Riesenkarussel mit einer Zuckerwatte in der Hand ?', 'Doraemon´s Tasche!! Dann könnte ich mir seine Dinge mal kurz "borgen" /DD Vorallem seine Überallhin-Tür wäre verdammt praktisch~', 'Ich bin die Jenny und ich liebe es zu essen und zu zocken. Und das am besten gleichzeitig! <3 Mal schauen ob ich es schaffe euch in 7,5 cm hohen cm hohen Schuhen zu bedienen. >_<...!', '#cd0000', 112),
(283, 72, 6, 'Maid', NULL, 2012, 'Ich finde es toll in einer süßen Uniform mit süßen Maids zusammen zuarbeiten, in einem süßen Cafe :)  Mir macht es einfach total Spaß (^.^)//', '2013-09-12', 'Jungfrau', '1,69', 'Singen, Tanzen, Camwhoring, Cosplay, Shoppen, Zeit mit meinen Liebsten verbringen, Zeichnen und Malen, Schauspiel, Japanisch lernen...und und und...', 'Zu viel! ^.~', 'Schokolade mit Macadamianüssen und japanisches Konfekt mit Bohnenpaste *__*', 'Ich liebe sooo viele Tiere! Im Moment ahbe ich ein Meerschweinchen und einen Kater :)', 'Woingenau. Dann könnte ich immer im Heißluftbaloon fliegen +__+ yeah! ', NULL, 'Ich würde gerne im wandelnden Schloss leben >///< Das wäre schön und aufregend *^* ', 'Natürlich Sailor Moon >_< Weil sie lustig, hübsch und süß ist und dann auch noch ihren Traumann an ihrer Seite hat. Was will man mehr ^.~  ', 'Bei der Zuckerwatte! ', 'Das alle Menschen glücklich sind :) ', 'Ich bin ein verplantes, kreatives Persönchen, dass meistens ziemlich aufgedreht ist :0  Meine Stärke ist meine gute Laune (^-^) Ich mache gerne Quatsch und freue mich immer, neue Leute kenne zulernen. Aber gefährlich bin ich auch...habe mal Kung Fu gemacht waaahh~~ .`__´.  Kampf-Maid-Power! (>.<)', '#ce9b02', 112),
(284, 60, 7, 'Maid', NULL, 2013, 'Durch die Überredungskünste von Maid Jenny und Host Momo :D', '2013-11-19', 'Skorpion', '1,56', ' Ich beschäftige mich am liebsten mit koreanischer Popmusik und ihren Choreografien.', 'Viel zu viel was zur Auswahl steht um sich zu entscheiden >_<', 'Außer Vanilleeis nasche ich selten was :3', 'Ich mag keine Tiere >_<'''' Die beißen alle nur qq', 'Am liebsten wäre ich Pikachu. Es ist süß und liebenswert und wird oft in der Gegend herumgetragen <:', NULL, 'Ich denke, dass ich mich mit sehr vielen Welten anfreuden könnte. Ganz oben steht DeathNote, AngelBeats und Digimon.', 'Jeanne die Kamikaze Diebin, weil sie auch in den verzweifelsten Situationen nicht den Kopf hängen lässt :)', 'An allen möglichen Achterbahnen und Essensständen <:', 'Wenn ich mir nicht noch mehr Wünsche wünchen dürfte, würde ich mir Lebensglück wünschen. Außerdem würde ich mir wünschen, dass ich nichts im Leben bereuen würde.', 'Mein Name ist Tecky und ich liebe es zu K-Pop zu tanzen. Ich hoffe, ich schaffe es dir ein Lächeln ins Gesicht zu zaubern. <: ', '#f5c0c8', 112),
(285, 62, 8, 'Design', NULL, 2013, NULL, '2013-09-27', 'Waage', '1,72', 'Lesen, zeichnen, backen, fotografieren und Filme gucken ( am liebsten von Mavel *-*)', '​Thai Curry und alles mit Melonengeschmack *^*', 'Marshmallows, Melonen Bonbons und Schokokekse <3', NULL, 'Cherubi weil es rosa und flauschig aussieht ', NULL, ':3 Da könnt ich mich garnicht entscheiden..  Aber ich denke in der Welt von clamp würd ich mich sehr wohl fühlen. ', 'Sakura aus Card Captor Sakura, weil sie immer freundlich und hilfsbereit ist aber sich dabei nicht unterkriegen lässt.  Außerdem trägt sie immer sooo niedliche Outfits ^^', 'Auf dem Riesenrad, weil man von dort den ganzen Park überblicken kann und bei den Süßigkeitenständen *__*', 'Das ich alles, was ich schaffen will, auch erreichen kann und dass es allen gut geht, die ich liebe.', 'Aloha ich  bin Yui,  leicht verplant aber immer fröhlich. Ich versuche immer mein Bestes zugeben. Kreativität ist für mich das Wichtigste und so erhält bei mir auch jeder Kuchen seinen eigenen Yui-Stempel :3 Auch bin ich sehr glücklich ein Teil dieses süßen Maid Cafes zusein <3', '#ffcf9e', 112),
(286, 54, 8, 'Facebook', NULL, 2012, 'Es fing alles an mit "Kaichou wa Maid-sama" ^-^ Wahhh~ wäre es toll, wenn es auch Maid Cafés in Deutschland gäbe und so entdeckte ich zufällig das "Lucky Chocolate Maid Café" ♥ Es wäre sicher lustig und aufregend, in einem süßen Kleid, von leckerem Kuchen umgeben, die Gäste mit Freude und Spaß anzustecken. Und ich bin überglücklich, durch meinen Job als Maid viele liebe und tolle Maids kennengelernt zu haben und zusammen Goshujin-sama & Ojou-sama ein Lächeln herbeizuzaubern ^.~', '2013-01-27', 'Wassermann', '164 cm', 'Reisen, shoppen, Fashion & Design, Musik, Animes & Mangas ♥', 'Pfannkuchen, Nudeln & Pasta~ Alles was lecker ist und mich satt macht xD', 'Kyaaah~ Süßigkeiten sind doch ALLE sooo lecker *^*', 'Katzen, Kaninchen, Schmetterlinge, Pinguine ^.^', 'Evoli ist mein absolutes Lieblingspokémon und seine Weiterentwicklungen sind alle so cool !!! Da denke ich, dass Feelinara/Sylveon am besten zu mir passt, da es auch überall Schleifen trägt ^.~', 'Kaichou wa Maid-sama, Pandora Hearts, Shingeki No Kyoujin Attack On Titan', '"Uta no Prince-sama"-Welt mit vielen gut aussehenden Jungs, die mir viele schöne Songs vorsingen *schwärm* xDDD', 'Mew Ichigo (von Tokyo Mew Mew) ^o^ In einem süßen Café arbeiten, die Natur beschützen, gegen Aliens kämpfen (xD) und sich zwischendurch in eine Katze verwandeln *nya* =^.^=', 'Ich wäre überall zu finden bzw. zu suchen *haha* Achterbahnen, Karussells, Riesenrad und und und ~ bis hin an den Spielbuden, Süßigkeitenständen und und und ^.~', 'Hmmm~ Wünsche darf man doch nicht verraten, oder? Sonst gehen sie doch nicht in Erfüllung, ne ^.~ ', 'Ich bin die fröhliche Maid Aimi, die (große) Schleifen über alles liebt *^*. Schau doch im "Lucky Chocolate Maid Café" vorbei und ich begrüße dich mit einem herzlichen "Okaerinasaimase" ^.~ ♥', '#921a7e', 112),
(287, 74, 7, 'Entertainment', NULL, 2010, 'Eine Freundin bat mich damals mit ihr mitzumachen und ich fand die Idee in ein süßes Kleid zu schlüpfen und zu bedienen eine wunderbare und süße Idee. Außerdem ist es toll wie viele neue Leute man kennenlernt und wie schnell die Maids hier einem ans Herz wachsen <3', '2013-10-17', 'Waage', '1,63', 'Musik (hören, singen, tanzen und selber machen) <3', 'Crêpes, Sushi', 'Torten, in jeglicher Art, Form etc. Total lecker und vor allem vielseitig, da ist einfach immer was dabei, für jeden Geschmack, Anlass, Jahreszeit! Und so ein Stück Torte lässt einen doch gleich glücklicher werden, wenn man es sich auf der Zunge zergehen lässt, auch wenn es auf die Hüften schlägt! x3', 'Hm… schwierig, ich finde Wildkatzen total faszinierend und atemberaubend schön, aber genauso bin ich auch voll der Hundefan, Huskys oder Wölfe *__________* Also kein richtiges Lieblingstier, dafür bin ich viel zu tierverrückt in zu vieles <3', 'Vulnona, es ist ein edles und mysteriöses Pokémon, schwer zu fassen, hat magische Fähigkeiten und gehört dem Feuerelement an. Ich fand es schon immer wunderschön', NULL, 'Definitiv in der Digiwelt! Digimon können mit einem reden und man kann sicher viele Abenteuer mit ihnen erleben, so einen Digipartner zu haben ist doch sicher spannend! *___*', '„Stark, bereit, unbesiegbar, schön, entschlossen, mutig! “ Richtig: Jeanne, die Kamikaze Diebin! ? Warum? Sie ist eine bewundernswerte Person, als Kind habe ich sie für ihre Stärke immer sehr bewundert, außerdem ist sie nicht das typische Magical Girl, welches ständig gerettet werden muss, weint und schwach ist. Sie weiß mit ihren Problemen umzugehen und gibt nicht auf. Wenn sie sich verwandelt erkennt man nicht wer sie in Wirklichkeit ist, hat einen wunderbaren kleinen Engel der ihr hilft und ein relativ „normales“ Leben. Außerdem wollte ich schon immer ihren Wunderball haben, mit dem sie sich überall festhalten konnte, praktisches Ding! xD', 'Natürlich bei den Achterbahnen! So ein bisschen Nervenkitzel ab und zu ist einfach purer Fun! Aber ein bisschen Entspannung fürs Herz muss natürlich auch sein, also werde ich ab und zu auch mal am Karussell vorbei schauen und gucken ob vielleicht mein Prinz dort steht und wartet', 'Eine Zeitreise zu machen. Vergangenheit und Zukunft erkunden, in verschiedene Epochen reisen, dort die Trachten tragen, Speisen probieren, Sitten kennenlernen, aber auch zu wissen, wie das Leben vor der Menschheit war, Dinosaurier sehen und die Welt in 803789519 Jahren sehen! xD', 'Ich bin Miu, manchmal etwas tollpatschig aber meistens gut gelaunt und manchmal etwas abgedreht x3 Oh und ich liiiiiiiiebe Kuscheltiere <3', '#c99bfe', 112),
(288, 72, 7, 'Maid', NULL, 2012, 'Ich finde es toll in einer süßen Uniform mit süßen Maids zusammen zuarbeiten, in einem süßen Cafe :)  Mir macht es einfach total Spaß (^.^)//', '2013-09-12', 'Jungfrau', '1,69', 'Singen, Tanzen, Camwhoring, Cosplay, Shoppen, Zeit mit meinen Liebsten verbringen, Zeichnen und Malen, Schauspiel, Japanisch lernen...und und und...', 'Zu viel! ^.~', 'Schokolade mit Macadamianüssen und japanisches Konfekt mit Bohnenpaste *__*', 'Ich liebe sooo viele Tiere! Im Moment ahbe ich ein Meerschweinchen und einen Kater :)', 'Woingenau. Dann könnte ich immer im Heißluftbaloon fliegen +__+ yeah! ', NULL, 'Ich würde gerne im wandelnden Schloss leben >///< Das wäre schön und aufregend *^* ', 'Natürlich Sailor Moon >_< Weil sie lustig, hübsch und süß ist und dann auch noch ihren Traumann an ihrer Seite hat. Was will man mehr ^.~  ', 'Bei der Zuckerwatte! ', 'Das alle Menschen glücklich sind :) ', 'Ich bin ein verplantes, kreatives Persönchen, dass meistens ziemlich aufgedreht ist :0  Meine Stärke ist meine gute Laune (^-^) Ich mache gerne Quatsch und freue mich immer, neue Leute kenne zulernen. Aber gefährlich bin ich auch...habe mal Kung Fu gemacht waaahh~~ .`__´.  Kampf-Maid-Power! (>.<)', '#ce9b02', 112),
(289, 62, 9, 'Design', NULL, 2013, NULL, '2013-09-27', 'Waage', '1,72', 'Lesen, zeichnen, backen, fotografieren und Filme gucken ( am liebsten von Mavel *-*)', '​Thai Curry und alles mit Melonengeschmack *^*', 'Marshmallows, Melonen Bonbons und Schokokekse <3', NULL, 'Cherubi weil es rosa und flauschig aussieht ', NULL, ':3 Da könnt ich mich garnicht entscheiden..  Aber ich denke in der Welt von clamp würd ich mich sehr wohl fühlen. ', 'Sakura aus Card Captor Sakura, weil sie immer freundlich und hilfsbereit ist aber sich dabei nicht unterkriegen lässt.  Außerdem trägt sie immer sooo niedliche Outfits ^^', 'Auf dem Riesenrad, weil man von dort den ganzen Park überblicken kann und bei den Süßigkeitenständen *__*', 'Das ich alles, was ich schaffen will, auch erreichen kann und dass es allen gut geht, die ich liebe.', 'Aloha ich  bin Yui,  leicht verplant aber immer fröhlich. Ich versuche immer mein Bestes zugeben. Kreativität ist für mich das Wichtigste und so erhält bei mir auch jeder Kuchen seinen eigenen Yui-Stempel :3 Auch bin ich sehr glücklich ein Teil dieses süßen Maid Cafes zusein <3', '#ffcf9e', 112),
(290, 54, 9, 'Facebook', NULL, 2012, 'Es fing alles an mit "Kaichou wa Maid-sama" ^-^ Wahhh~ wäre es toll, wenn es auch Maid Cafés in Deutschland gäbe und so entdeckte ich zufällig das "Lucky Chocolate Maid Café" ♥ Es wäre sicher lustig und aufregend, in einem süßen Kleid, von leckerem Kuchen umgeben, die Gäste mit Freude und Spaß anzustecken. Und ich bin überglücklich, durch meinen Job als Maid viele liebe und tolle Maids kennengelernt zu haben und zusammen Goshujin-sama & Ojou-sama ein Lächeln herbeizuzaubern ^.~', '2013-01-27', 'Wassermann', '164 cm', 'Reisen, shoppen, Fashion & Design, Musik, Animes & Mangas ♥', 'Pfannkuchen, Nudeln & Pasta~ Alles was lecker ist und mich satt macht xD', 'Kyaaah~ Süßigkeiten sind doch ALLE sooo lecker *^*', 'Katzen, Kaninchen, Schmetterlinge, Pinguine ^.^', 'Evoli ist mein absolutes Lieblingspokémon und seine Weiterentwicklungen sind alle so cool !!! Da denke ich, dass Feelinara/Sylveon am besten zu mir passt, da es auch überall Schleifen trägt ^.~', 'Kaichou wa Maid-sama, Pandora Hearts, Shingeki No Kyoujin Attack On Titan', '"Uta no Prince-sama"-Welt mit vielen gut aussehenden Jungs, die mir viele schöne Songs vorsingen *schwärm* xDDD', 'Mew Ichigo (von Tokyo Mew Mew) ^o^ In einem süßen Café arbeiten, die Natur beschützen, gegen Aliens kämpfen (xD) und sich zwischendurch in eine Katze verwandeln *nya* =^.^=', 'Ich wäre überall zu finden bzw. zu suchen *haha* Achterbahnen, Karussells, Riesenrad und und und ~ bis hin an den Spielbuden, Süßigkeitenständen und und und ^.~', 'Hmmm~ Wünsche darf man doch nicht verraten, oder? Sonst gehen sie doch nicht in Erfüllung, ne ^.~ ', 'Ich bin die fröhliche Maid Aimi, die (große) Schleifen über alles liebt *^*. Schau doch im "Lucky Chocolate Maid Café" vorbei und ich begrüße dich mit einem herzlichen "Okaerinasaimase" ^.~ ♥', '#921a7e', 112),
(291, 59, 8, 'Facebook', NULL, 2010, 'Weil ich was Neues ausprobieren wollte… vorher war ich nichtmal aktiv in der Cosplayszene dabei, aber es hat mich einfach interessiert, wie es ist Maid zu sein. Vorallem aber weil die ersten Maids, die ich jemals gesehen habe, so hübsch aussahen. Ich wollte auch so aussehen wie die <3', '2013-09-04', 'Jungfrau', '1,64', 'Architektur, Singen, Essen, Schlafen', 'Sushi, Bulgogi, Bibimbap, Maid Umi''s Kochkünste, Ramen, … eigentlich zu viel um es aufzuzählen <3', 'Ach, ich mag sooo vieles~ Da kann man ich mich echt nicht entscheiden, was ich am aller aller liebsten mag... Aber Pfirsichringe sind schon pure Liebe~ Oder Cakepops mit Milchschokoladenüberzug in Pfirsichgeschmack <3', 'Alles was fett, süß und flauschig ist… meine Kuscheltiere!', 'Relaxo!! -> essen, schlafen, essen, schlafen~ Was für ein Leben~', NULL, 'In der Gundam (00) Welt, aber bitte ohne Krieg... weil die Technik da ist schon extremst <3 :DD Dann will ich meinen eigenen Gundam haben! Oha, wenn ich den steuern könnte :x...', 'Sakura aus Cardcaptor Sakura, weil sie so viele tolle Sachen mit ihren Tarotkarten machen kann und weil sie verdammt süße Kleider hat UND weil ich dann Kero an meiner Seite hätte!', 'Auf dem Riesenkarussel mit einer Zuckerwatte in der Hand ?', 'Doraemon´s Tasche!! Dann könnte ich mir seine Dinge mal kurz "borgen" /DD Vorallem seine Überallhin-Tür wäre verdammt praktisch~', 'Ich bin die Jenny und ich liebe es zu essen und zu zocken. Und das am besten gleichzeitig! <3 Mal schauen ob ich es schaffe euch in 7,5 cm hohen cm hohen Schuhen zu bedienen. >_<...!', '#cd0000', 112),
