(294, 76, 7, 'Maid', NULL, 2010, 'Ich glaube das war 2010. Damals war ich bei einem seperaten Event von dem Lucky Chocolate in Düsseldorf. Danach war ich so begeistert, dass ich mich auch als Maid beworben habe. Schließlich wurde ich angenommen und war das erste mal bei der Dokomi 2010 aktiv. :) ', '2013-12-22', 'Steinbock', '1,68', 'Musik (Saxophon spielen), Backen, Ausgehen, Festivals, Philosophie und so ein Kram. :D ', 'Schokolade. Am liebsten Kiloweise!!', 'SCHOKOLADE. TONNENWEISE!', 'Ich hab zwei! Einmal Eulen und Katzen. Eulen finde ich schon toll seit ich denken kann, da diese Tiere sehr weise und stolz wirken. Katzen hingegen sind die einzigen Haustiere die irgendwie noch ihr eigener Herr sind. Sie haben einen eigenen Willen und springen dir nicht hinterher wie ein Flummi. Sie sind unabhängig aber lieben trotzdem bedingungslos. ', 'Flegmon! Faul sein den ganzen Tag, das wärs!', NULL, 'Definitiv in der von One Piece. Ich will Reisen und die Welt sehen. Dabei noch einen Schatz suchen... der Gedanke gefällt mir!', 'Oha, das ist eine wirklich, wirklich schwere Frage. Ich persönlich sehe mich einfach so gar nicht als Magical Girl. Magical Girls sind entschlossene und mutige Persönlichkeiten, die oft eine Große Verantwortung in die Hand gelegt bekommen. Ich zweifel oft an meinen Fähigkeiten und bin glaube ich einzig und allein gut darin, Schokolade zu eliminieren. Daher sollten wir das bei mir mit dem Magical Girl lieber sein lassen ;)', 'Erst auf der abgefahrensten Achterbahn die es da so gibt. Danach würde ich (natürlich wenn mein Magen noch möchte) erstmal was essen und DANN (ganz wichtig! Ein Muss bei jedem Ausflug in den Freizeitpark!!) Maskottchen auf den Arm nehmen. :D', 'Einen nicht ausschöpfbaren Vorrat an Schokolade! Dafür muss dann eine Neue Einheit erfunden werden. Zum Beispiel Trillzionen Tonnen? (Trillzionen ist dann nicht eine Millionen hoch 3, sondern eine Trillionen hoch unendlich! OH JA!)', 'Hey alle zusammen! Fia mein Name, Maid seit 2010. Ich konnte im Jahr 2013 leider nicht im Cafe mitwirken, daher freue ich mich umso mehr auf 2014! Meinen Charakter würde ich als wuselig aber trotz allem auch als offen und freundlich bezeichnen... Zumindest gebe ich mir dabei aller beste Mühe. :) Wir sehen uns im Cafe! ', '#cfc4e4', 112),
(295, 76, 8, 'Maid', NULL, 2010, 'Ich glaube das war 2010. Damals war ich bei einem seperaten Event von dem Lucky Chocolate in Düsseldorf. Danach war ich so begeistert, dass ich mich auch als Maid beworben habe. Schließlich wurde ich angenommen und war das erste mal bei der Dokomi 2010 aktiv. :) ', '2013-12-22', 'Steinbock', '1,68', 'Musik (Saxophon spielen), Backen, Ausgehen, Festivals, Philosophie und so ein Kram. :D ', 'Schokolade. Am liebsten Kiloweise!!', 'SCHOKOLADE. TONNENWEISE!', 'Ich hab zwei! Einmal Eulen und Katzen. Eulen finde ich schon toll seit ich denken kann, da diese Tiere sehr weise und stolz wirken. Katzen hingegen sind die einzigen Haustiere die irgendwie noch ihr eigener Herr sind. Sie haben einen eigenen Willen und springen dir nicht hinterher wie ein Flummi. Sie sind unabhängig aber lieben trotzdem bedingungslos. ', 'Flegmon! Faul sein den ganzen Tag, das wärs!', NULL, 'Definitiv in der von One Piece. Ich will Reisen und die Welt sehen. Dabei noch einen Schatz suchen... der Gedanke gefällt mir!', 'Oha, das ist eine wirklich, wirklich schwere Frage. Ich persönlich sehe mich einfach so gar nicht als Magical Girl. Magical Girls sind entschlossene und mutige Persönlichkeiten, die oft eine Große Verantwortung in die Hand gelegt bekommen. Ich zweifel oft an meinen Fähigkeiten und bin glaube ich einzig und allein gut darin, Schokolade zu eliminieren. Daher sollten wir das bei mir mit dem Magical Girl lieber sein lassen ;)', 'Erst auf der abgefahrensten Achterbahn die es da so gibt. Danach würde ich (natürlich wenn mein Magen noch möchte) erstmal was essen und DANN (ganz wichtig! Ein Muss bei jedem Ausflug in den Freizeitpark!!) Maskottchen auf den Arm nehmen. :D', 'Einen nicht ausschöpfbaren Vorrat an Schokolade! Dafür muss dann eine Neue Einheit erfunden werden. Zum Beispiel Trillzionen Tonnen? (Trillzionen ist dann nicht eine Millionen hoch 3, sondern eine Trillionen hoch unendlich! OH JA!)', 'Hey alle zusammen! Fia mein Name, Maid seit 2010. Ich konnte im Jahr 2013 leider nicht im Cafe mitwirken, daher freue ich mich umso mehr auf 2014! Meinen Charakter würde ich als wuselig aber trotz allem auch als offen und freundlich bezeichnen... Zumindest gebe ich mir dabei aller beste Mühe. :) Wir sehen uns im Cafe! ', '#cfc4e4', 112),
(296, 64, 7, 'Maid', NULL, 2011, 'Ich liebe Süßigkeiten und ich fand die Kleider immer schon so schön. Ich liebe es Menschen eine Freude zu machen, und ihnen den Tag mit ein bisschen Entertainment und Kuchen zu versüßen :3', '2013-06-09', 'Zwillinge', '1,58', 'Singen, tanzen, malen und Süßigkeiten essen :3', ' Erdbeertorteeeeeeee ^o^', 'Rote und grüne Gummibärchen', 'Panda, Katze, Schildkröte, Pinguin … >.<  Ich hab so viel Lieblingstiere, weil sie alle sooo süß sind auf ihre Art und Weise.', 'Ein Celebi dann kann ich durch die Zeit reisen.', NULL, 'Ich finde die Welt in der ich lebe am besten, die ist schon fast wie ein Anime XD', 'Ichigo aus Tokyo Mew Mew. Sie kann sich in eine Katze verwandeln :3 das will ich auch können.', ' Auf der schnellsten Achterbahn!', ' Ich würde mir noch mehr Wünsche wünschen, um die vielen Wünsche zu erfüllen, die ich habe.', 'Bin nicht groß >-< aber hab ein gaaaaaanz großes Herz!', '#02b5dd', 112),
(297, 79, 6, 'Maid', NULL, 2011, 'Ich bin Maid geworden, weil ich es liebe Leuten eine freude zubereiten und an diesem Job sehr viel freude habe.', '2014-02-04', 'Wassermann', '1,61', 'Zeichnen, Reiten, Schwimmen, Cosplay', 'Milchsuppe, Pizza, Sushi, Nudeln', 'Ich liebe schoko-CuepeCakes, mit Streuseln und dann noch Sahne drauf, am besten bunte. ', 'Da kann ich mich nicht entscheiden aber ich sage mal Katzen und das weil ich selber auch 3 Katzen zuhause habe ', 'Also wenn dann vill. Arktos weil ich das einfach liebe und ich das auch früher in den Video-Spielen immer genommen habe, außerdem liebe ich Schnee, Winter und wenn es kälter ist :3 ', NULL, 'Ich würde gerne im Anime "Eden of the East" oder "Air Gear" leben weil es einfach nur interessant währe und ich einfach diese Animes sehr mag, auch wenn "Trinety Blood" oder "D.Gray-man" auch toll währen >.< ', 'Also wenn dann Dokuro-chan XD weil sie einfach nicht das übliche Magical Girl Opfer ist, da sie eine Waffe hat mit der sie einige mal ab und zu tot schlägt aber trotzdem iwie schon süß ist :3 ', 'Man würde mich denke ich an fast jedem Karusell finden oder besser ann allem was einen Überschlag macht und schnell ist, weil ich es liebe auf Achterbahnen zu gehen. ', 'Wenn ich einen Wunsch frei hätte würde ich es denke ich so machen das mein Leben wie in dem Anime Eden of the East währe, so dass ich auch einder der selecaos währe, weil ich das einfach so interessant fände, bzw, was man dann alles machen könnte. ', 'Hallo <3! Ich bin Tsuki, backe und koche gerne! Ich liebe Onlinespiele und werkel in meiner Freizeit gerne an meinen Cosplays!', '#95001e', 112),
(298, 79, 7, 'Maid', NULL, 2011, 'Ich bin Maid geworden, weil ich es liebe Leuten eine freude zubereiten und an diesem Job sehr viel freude habe.', '2014-02-04', 'Wassermann', '1,61', 'Zeichnen, Reiten, Schwimmen, Cosplay', 'Milchsuppe, Pizza, Sushi, Nudeln', 'Ich liebe schoko-CuepeCakes, mit Streuseln und dann noch Sahne drauf, am besten bunte. ', 'Da kann ich mich nicht entscheiden aber ich sage mal Katzen und das weil ich selber auch 3 Katzen zuhause habe ', 'Also wenn dann vill. Arktos weil ich das einfach liebe und ich das auch früher in den Video-Spielen immer genommen habe, außerdem liebe ich Schnee, Winter und wenn es kälter ist :3 ', NULL, 'Ich würde gerne im Anime "Eden of the East" oder "Air Gear" leben weil es einfach nur interessant währe und ich einfach diese Animes sehr mag, auch wenn "Trinety Blood" oder "D.Gray-man" auch toll währen >.< ', 'Also wenn dann Dokuro-chan XD weil sie einfach nicht das übliche Magical Girl Opfer ist, da sie eine Waffe hat mit der sie einige mal ab und zu tot schlägt aber trotzdem iwie schon süß ist :3 ', 'Man würde mich denke ich an fast jedem Karusell finden oder besser ann allem was einen Überschlag macht und schnell ist, weil ich es liebe auf Achterbahnen zu gehen. ', 'Wenn ich einen Wunsch frei hätte würde ich es denke ich so machen das mein Leben wie in dem Anime Eden of the East währe, so dass ich auch einder der selecaos währe, weil ich das einfach so interessant fände, bzw, was man dann alles machen könnte. ', 'Hallo <3! Ich bin Tsuki, backe und koche gerne! Ich liebe Onlinespiele und werkel in meiner Freizeit gerne an meinen Cosplays!', '#95001e', 112),
(299, 73, 5, 'Maid', NULL, 2011, 'Als Maid bereitet es mir die größte Freude so viel Kontakt mit neuen Menschen zu haben und ihnen mit Gesprächen, Spielen und unseren leckeren Kuchen ein Lächeln auf ihr Gesicht zu zaubern.', '2013-04-04', 'Widder', NULL, 'Theater, Spielkonsolen, Cosplay', 'Vanilleeis mit heißen Kirschen', 'Helle Schokomuffins mit Schokoladenstückchen! Wenn man in hinein beißt, kommt einem immer die Frage auf: Bekomme ich jetzt ein Stück Schokolade ab oder nicht? Und wenn doch, schmeckt der auch so schon leckere Muffin noch viel besser!', 'Eulen. Sie sind wunderschöne und elegante Tiere. Sie strahlen eine unfassbare Stärke aus, dass man von ihnen fasziniert sein muss.', 'Glumanda! Ich friere immer sehr schnell und als Feuer-Pokemon könnte mir das nicht passieren! Davon ab sind Glumandas Weiterentwicklungen nicht so schwach und süß, als dass Team Rocket versuchen würde sie zu fangen. ', NULL, 'In der Digiwelt! Ein Digimon ist dein bester Freund und mit ihm dann auch noch zusammen spannende Abenteuer zu erleben, wäre das Größte. ', 'Eindeutig Michiru Kaioh von Sailor Moon! Als ich sie das erste mal im Anime in einem Park mit ihrer Violine gesehen habe, war es um mich geschehen. Den ganzen Tag habe ich meine Mutter angebettelt mir eine Geige zu kaufen und meine Haare zu färben, was sie mir, verständlicherweise, nicht erlaubt hat. Davon abgesehn, war ich früher in Haruka Tenoh verliebt und mein sehnlichster Wunsch war sie zu heiraten! ', 'Achterbahnen! Je schneller und gefährlicher, desto besser! Wenn man im Sitz sitzt, langsam die Schräge hoch fährt um im nächsten Moment in einen Looping durch zu starten ist das Größte! Wenn man dann genug von der ganzen Fahrerei hat, kann man dann in Ruhe einen leckeren selbstgebackenen Schokomuffin genießen.~ ', 'Nach meinem Leben möchte ich gerne eine Katze sein. Katzen sind schöne und vor allem eigenwillige Tiere. Und wenn ich sehe wie ich meine Katze immer verhätschel, könnte mir ein Leben als Katze ziemlich gut gefallen. Nur auf das Mäusejagen kann ich verzichten...', 'Hey! Ich bin Peggy und liebe es mit meiner Katze zu kuscheln! Ich freue mich schon euch bedienen zu dürfen <3 ', '#9b002f', 112),
(300, 75, 6, 'Maid', NULL, 2011, 'Ich fand Maids und die Idee vom Maidcafé schon immer total süß <3', '2013-11-06', 'Skorpion', '1,58', 'Zeichnen, Geige spielen, Tanzen, Animes und Mangas <3', 'Schokolade :)', 'Schokolade :)', 'Katze! Sie sind intelligent, elegant, trotzdem süß, verschmust und außerdem etwas listig. ', 'Ich wäre Vulpix :)', NULL, 'Hm...  wahrscheinlich Death Note... ist eigentlich unsere Welt, aber ein Death Note würde existieren! :D', 'Sailor Mars! Schon allein wegen den schwarzen Haaren und da meine Lieblings- und Maidfarbe Rot ist :D Aber auch ich kann manchmal bisschen zickig sein wie Sailor Mars, bin im Grunde aber ein ganz lieber Mensch :)', 'Beim Süßigkeitenstand :3 und wenn nicht dann auf dem Riesenrad :D', 'Seelenfrieden :) ', 'Ich bin am Anfang sehr schüchtern und rede nicht gerne, aber wenn man mich ein bisschen besser kennen lernt, merkt man, dass ich eigentlich ein sehr aufgeschlossener Mensch bin, mit dem man viel Spaß mit mir haben kann.', '#fe0000', 112),
(301, 73, 6, 'Maid', NULL, 2011, 'Als Maid bereitet es mir die größte Freude so viel Kontakt mit neuen Menschen zu haben und ihnen mit Gesprächen, Spielen und unseren leckeren Kuchen ein Lächeln auf ihr Gesicht zu zaubern.', '2013-04-04', 'Widder', NULL, 'Theater, Spielkonsolen, Cosplay', 'Vanilleeis mit heißen Kirschen', 'Helle Schokomuffins mit Schokoladenstückchen! Wenn man in hinein beißt, kommt einem immer die Frage auf: Bekomme ich jetzt ein Stück Schokolade ab oder nicht? Und wenn doch, schmeckt der auch so schon leckere Muffin noch viel besser!', 'Eulen. Sie sind wunderschöne und elegante Tiere. Sie strahlen eine unfassbare Stärke aus, dass man von ihnen fasziniert sein muss.', 'Glumanda! Ich friere immer sehr schnell und als Feuer-Pokemon könnte mir das nicht passieren! Davon ab sind Glumandas Weiterentwicklungen nicht so schwach und süß, als dass Team Rocket versuchen würde sie zu fangen. ', NULL, 'In der Digiwelt! Ein Digimon ist dein bester Freund und mit ihm dann auch noch zusammen spannende Abenteuer zu erleben, wäre das Größte. ', 'Eindeutig Michiru Kaioh von Sailor Moon! Als ich sie das erste mal im Anime in einem Park mit ihrer Violine gesehen habe, war es um mich geschehen. Den ganzen Tag habe ich meine Mutter angebettelt mir eine Geige zu kaufen und meine Haare zu färben, was sie mir, verständlicherweise, nicht erlaubt hat. Davon abgesehn, war ich früher in Haruka Tenoh verliebt und mein sehnlichster Wunsch war sie zu heiraten! ', 'Achterbahnen! Je schneller und gefährlicher, desto besser! Wenn man im Sitz sitzt, langsam die Schräge hoch fährt um im nächsten Moment in einen Looping durch zu starten ist das Größte! Wenn man dann genug von der ganzen Fahrerei hat, kann man dann in Ruhe einen leckeren selbstgebackenen Schokomuffin genießen.~ ', 'Nach meinem Leben möchte ich gerne eine Katze sein. Katzen sind schöne und vor allem eigenwillige Tiere. Und wenn ich sehe wie ich meine Katze immer verhätschel, könnte mir ein Leben als Katze ziemlich gut gefallen. Nur auf das Mäusejagen kann ich verzichten...', 'Hey! Ich bin Peggy und liebe es mit meiner Katze zu kuscheln! Ich freue mich schon euch bedienen zu dürfen <3 ', '#9b002f', 112),
(302, 75, 7, 'Maid', NULL, 2011, 'Ich fand Maids und die Idee vom Maidcafé schon immer total süß <3', '2013-11-06', 'Skorpion', '1,58', 'Zeichnen, Geige spielen, Tanzen, Animes und Mangas <3', 'Schokolade :)', 'Schokolade :)', 'Katze! Sie sind intelligent, elegant, trotzdem süß, verschmust und außerdem etwas listig. ', 'Ich wäre Vulpix :)', NULL, 'Hm...  wahrscheinlich Death Note... ist eigentlich unsere Welt, aber ein Death Note würde existieren! :D', 'Sailor Mars! Schon allein wegen den schwarzen Haaren und da meine Lieblings- und Maidfarbe Rot ist :D Aber auch ich kann manchmal bisschen zickig sein wie Sailor Mars, bin im Grunde aber ein ganz lieber Mensch :)', 'Beim Süßigkeitenstand :3 und wenn nicht dann auf dem Riesenrad :D', 'Seelenfrieden :) ', 'Ich bin am Anfang sehr schüchtern und rede nicht gerne, aber wenn man mich ein bisschen besser kennen lernt, merkt man, dass ich eigentlich ein sehr aufgeschlossener Mensch bin, mit dem man viel Spaß mit mir haben kann.', '#fe0000', 112);
INSERT INTO `maid_versions` (`ID`, `RecordID`, `Version`, `Type`, `colour`, `since`, `maidreason`, `BDay`, `zodiac`, `size`, `hobbys`, `favfood`, `favsweet`, `favanimal`, `pokemon`, `anime`, `animelocation`, `magicalgirl`, `funfairlocation`, `wish`, `aboutme`, `mcolour`, `maidphotoID`) VALUES
(303, 56, 8, 'Maid', NULL, 2011, 'Ich habe 2010 zum ersten Mal eine Con besucht und es war die Dokomi. Aus Zufall heraus war ich auf einmal eine Helferin und konnte die Con als Helferin und Gast genießen. Später habe ich dann erfahren, dass das LC neue Maids sucht. Da die Con mich sofort überzeugt hat und die Idee als Maid zu arbeiten sehr gefallen hat, wollte ich es gerne ausprobieren.  ', '2013-07-08', 'Krebs', '1,65', 'Manga lesen, spazieren gehen, mit Freunden treffen', 'Dim Sum, Sushi, Wassermelone und Dorianfrucht xD ', 'CHOCOLATE ', 'Katze. Katzen sind äußerst unabhängige Tiere und doch wenn sie Zuneigung  haben wollen, stellen sie sich so süß an, dass man sofort nachgeben muss und sie einfach lieb haben muss. ', 'Plusel und Minum. Die kleinen Häschen sind frech und doch so putzig', NULL, 'One Piece. Ich liebe die verschiedenen Inseln, die Oda Eiichiro sich einfallen lässt für die Abenteuer von Ruffy und co. Außerdem frage ich mich wie es sich wohl anfühlen würde eine Teufelsfrucht zu essen und dann Special power zu haben ', 'Keins, egal wie sehr ich als kleines Kind Sailor Moon oder Doremi nachgespielt habe, würde ich mich nicht mit einer assoziieren. Wenn dann andere Charaktere.', 'Achterbahn!!! Nichts ist besser als Achterbahn.', 'Ein wohl utopischer Wunsch, aber Weltfrieden wäre echt toll. Man sieht jeden Tag schlechte Nachrichten über Kriege jeder Art und es macht mich traurig mit anzusehen wie unschuldige Zivilisten mit in den Kämpfen hineingezogen werden. ', 'Konnichiwa Minna-san, ich bin manchmal etwas schüchtern. Also seid bitte ganz lieb zu mir. Ich liebe süße und niedliche Gegenstände, bin eine große Katzenliebhaberin und habe gaaaaaaanz große Angst vor Spinnen. ', '#9ec9f3', 112),
(304, 78, 6, 'Maid', NULL, 2012, '2011 wurde ich danke meines Bruders mal gaaaaanz spontan plötzlich Helferin. Ich habe dabei so viele neue nette Leute, Helfer und Maids kennen gelernt. Es war lustig und hat so Spaß gemacht und weil die Maids dabei auch noch alle so zuckersüß aussahen, hatte ich mich kurz danach sofort beworben. ', '2013-11-14', 'Skorpion', '1,58', 'Zeichnen (am liebsten Mangafiguren), Singen, Filme schauen und Süßigkeiten naschen', 'Mmmh ~ Ich weiß nicht…Erdbeeren? Sushi? Ramen? Fried Ice Cream? Zu viele Verführungen! Ich kann mich nicht entscheiden *o* ', 'Ich liebe Fried Ice Cream ~ Außen warm und knusprig ~ Innen kalt, süß und schmilzt langsam auf deine Zunge <3', 'Teacupschweinchen~ so klein und süß und knuffig und die NASE! <3 ', 'Ich wäre gerne Evoli ~ Evoli ist süß und sooo flauschig. Es hat so viel Potenzial und kann sich zu so viele verschiedene Pokemons entwickeln.', NULL, 'Noch immer Tsubasa Chronicle ~ Knuffiger Mokona und in der Welt von Tsubasa Chronicle gibt es noch so viele unterschiedliche Welten: vergangene und zukünftige Welten, Real-live ähnliche und Fantasy-Welten. Da ist einfach alles dabei! =3 ', 'Jeanne d’Arc! Sie ist ein bewundernswerter Chara ~ Stark, mutig, schön und entschlossen~ Man kann sie nur ins Herz schließen. Obwohl sie von klein auf ein hartes Leben hat, hat sie nie aufgegeben und wird dadurch nur immer stärker.  ', 'Bei der Wildwasserbahn! Es ist lustig wenn alle pitsch nass sind.', 'Ich würde mir wunderschöne Flügel wünschen damit ich die Welt von ganz oben sehen kann und viele Länder bereisen kann. Erste Station: Japan! <3', 'Ich bin etwas tollpatschig und vergesslich und eher schüchtern und ich verhasple mich deswegen manchmal weil ich dann so nervös bin… Gomenasai! >____< Aber ich gebe mein bestes weil es mir unglaublich viel Spaß macht euch zu bedienen und euch ein Lächeln ins Gesicht zu zaubern.', '#ce398a', 112),
(305, 80, 6, 'Maid', NULL, 2012, 'Maid bin ich geworden weil ich quasi genötigt wurde von 2 Freundinnen. Als ich dann ein Seminar besucht habe und so herzlich aufgenommen wurde habe ich unglaublich viel Spaß gehabt und viel gelernt. Den Gästen einen schönen Tag zu bereiten macht mich glücklich :3', '2013-08-14', 'Löwe', '1,82', 'Meine Hobbys sind die Showgruppen in denen ich Mitglied bin also singen, tanzen und außerdem schwimmen und kochen', 'Lasagne', '- Ich liebe Eiscrem aber mein absoluter Favorit sind Erdbeeren in  weißer Schokolade ', 'Mein Lieblingstier ist schwierig auszuwählen ich mag so viele aber ich denke ich mag mit am meisten wildtiere wie den Wolf oder den Luchs. Sie sind wunderschön anzusehen wild und frei <3', 'Ich wäre auf jeden Fall ein Psiana denn meine beste Freundin ist ein Nachtara <3 Wir machen alles zusammen', NULL, 'In einer anderen Welt zu leben wäre bestimmt aufregend. Die Welt von Avatar (auch wenn es kein Anime ist) würde mich besonders Reizen weil ich gerne wüsste welches Element ich wohl bändigen würde (mein Tipp ist ja Wasser aber wer weiß)…', 'Ein spezielles Magical Girl habe ich nicht im Sinn. Doch vermutlich hätte ich Heilfähigkeiten denn ich bin eine wandelnde Apotheke und ein Verbandskasten', '- In Vergnügungsparks findest du mich immer an der schnellsten und wildesten Achterbahn ich liebe die schnelle fahrt und schreie wie ein kleines Mädchen.', 'Den Wunsch einer Fee muss man sich gut überlegen  und man darf ihn  nicht verraten sonst geht er nicht in Erfüllung ; )', 'Also was soll ich sagen ich bin ein wenig durchgedreht, tierlieb und ein Riese mit 1,83m', '#006600', 112),
(306, 52, 8, 'Maid', NULL, 2013, 'Maid Café''s haben mir schon immer gut gefallen und ich wollte auch gerne mal in einem arbeiten.  Außerdem möchte ich viele neue Leute kennenlernen^^', '2013-04-04', 'Widder', '1,68', 'Lolita tragen, Dolls sammeln und Konzerte besuchen.', 'Sushi, Pizza, Pasta und Spinat :3', 'Kuchen natürlich, am liebsten mit Erdbeeren! Und Macarons <3', 'Ich liebe Alpacas! Die sind sooo flauschig und süß und gucken immer so lieb und treudoof *-*', 'Togepi! Es ist immer fröhlich und süß <3', NULL, 'Ich glaube die Digiwelt wäre ganz cool^^', 'Sailor Venus! Sie ist einfach die coolste :D', 'Bei den gebratenen Champignons und den Schokofrüchten, die liiiebe ich <3', 'Ein Leben wie Marie Antoinette xD', 'Ich bin eine Backfee, denn ich liebe backen einfach.', '#79d5ac', 112),
(307, 80, 7, 'Maid', NULL, 2012, 'Maid bin ich geworden weil ich quasi genötigt wurde von 2 Freundinnen. Als ich dann ein Seminar besucht habe und so herzlich aufgenommen wurde habe ich unglaublich viel Spaß gehabt und viel gelernt. Den Gästen einen schönen Tag zu bereiten macht mich glücklich :3', '2013-08-14', 'Löwe', '1,82', 'Meine Hobbys sind die Showgruppen in denen ich Mitglied bin also singen, tanzen und außerdem schwimmen und kochen', 'Lasagne', '- Ich liebe Eiscrem aber mein absoluter Favorit sind Erdbeeren in  weißer Schokolade ', 'Mein Lieblingstier ist schwierig auszuwählen ich mag so viele aber ich denke ich mag mit am meisten wildtiere wie den Wolf oder den Luchs. Sie sind wunderschön anzusehen wild und frei <3', 'Ich wäre auf jeden Fall ein Psiana denn meine beste Freundin ist ein Nachtara <3 Wir machen alles zusammen', NULL, 'In einer anderen Welt zu leben wäre bestimmt aufregend. Die Welt von Avatar (auch wenn es kein Anime ist) würde mich besonders Reizen weil ich gerne wüsste welches Element ich wohl bändigen würde (mein Tipp ist ja Wasser aber wer weiß)…', 'Ein spezielles Magical Girl habe ich nicht im Sinn. Doch vermutlich hätte ich Heilfähigkeiten denn ich bin eine wandelnde Apotheke und ein Verbandskasten', '- In Vergnügungsparks findest du mich immer an der schnellsten und wildesten Achterbahn ich liebe die schnelle fahrt und schreie wie ein kleines Mädchen.', 'Den Wunsch einer Fee muss man sich gut überlegen  und man darf ihn  nicht verraten sonst geht er nicht in Erfüllung ; )', 'Also was soll ich sagen ich bin ein wenig durchgedreht, tierlieb und ein Riese mit 1,83m', '#006600', 112),
(308, 72, 9, 'Maid', NULL, 2012, 'Ich finde es toll in einer süßen Uniform mit süßen Maids zusammen zuarbeiten, in einem süßen Cafe :)  Mir macht es einfach total Spaß (^.^)//', '2013-09-12', 'Jungfrau', '1,69', 'Singen, Tanzen, Camwhoring, Cosplay, Shoppen, Zeit mit meinen Liebsten verbringen, Zeichnen und Malen, Schauspiel, Japanisch lernen...und und und...', 'Zu viel! ^.~', 'Schokolade mit Macadamianüssen und japanisches Konfekt mit Bohnenpaste *__*', 'Ich liebe sooo viele Tiere! Im Moment ahbe ich ein Meerschweinchen und einen Kater :)', 'Woingenau. Dann könnte ich immer im Heißluftbaloon fliegen +__+ yeah! ', NULL, 'Ich würde gerne im wandelnden Schloss leben >///< Das wäre schön und aufregend *^* ', 'Natürlich Sailor Moon >_< Weil sie lustig, hübsch und süß ist und dann auch noch ihren Traumann an ihrer Seite hat. Was will man mehr ^.~  ', 'Bei der Zuckerwatte! ', 'Das alle Menschen glücklich sind :) ', 'Ich bin ein verplantes, kreatives Persönchen, dass meistens ziemlich aufgedreht ist :0  Meine Stärke ist meine gute Laune (^-^) Ich mache gerne Quatsch und freue mich immer, neue Leute kenne zulernen. Aber gefährlich bin ich auch...habe mal Kung Fu gemacht waaahh~~ .`__´.  Kampf-Maid-Power! (>.<)', '#ce9b02', 112),
(309, 72, 10, 'Maid', NULL, 2012, 'Ich finde es toll in einer süßen Uniform mit süßen Maids zusammen zuarbeiten, in einem süßen Cafe :)  Mir macht es einfach total Spaß (^.^)//', '2013-09-12', 'Jungfrau', '1,69', 'Singen, Tanzen, Camwhoring, Cosplay, Shoppen, Zeit mit meinen Liebsten verbringen, Zeichnen und Malen, Schauspiel, Japanisch lernen...und und und...', 'Zu viel! ^.~', 'Schokolade mit Macadamianüssen und japanisches Konfekt mit Bohnenpaste *__*', 'Ich liebe sooo viele Tiere! Im Moment ahbe ich ein Meerschweinchen und einen Kater :)', 'Woingenau. Dann könnte ich immer im Heißluftbaloon fliegen +__+ yeah! ', NULL, 'Ich würde gerne im wandelnden Schloss leben >///< Das wäre schön und aufregend *^* ', 'Natürlich Sailor Moon >_< Weil sie lustig, hübsch und süß ist und dann auch noch ihren Traumann an ihrer Seite hat. Was will man mehr ^.~  ', 'Bei der Zuckerwatte! ', 'Das alle Menschen glücklich sind :) ', 'Ich bin ein verplantes, kreatives Persönchen, dass meistens ziemlich aufgedreht ist :0  Meine Stärke ist meine gute Laune (^-^) Ich mache gerne Quatsch und freue mich immer, neue Leute kenne zulernen. Aber gefährlich bin ich auch...habe mal Kung Fu gemacht waaahh~~ .`__´.  Kampf-Maid-Power! (>.<)', '#ce9b02', 112),
(310, 81, 7, 'Maid', NULL, 2012, 'Ich bin Maid geworden, weil es mir Spaß macht, Kuchen zu backen, zu dekorieren und euch damit eine Freude zu machen. Außerdem kann man immer süße Kleider tragen und neue Leute kennen lernen. Und ein nicht zu vergessener wichtiger Punkt. In so einem großen und tollen Maid Café zu arbeiten ist einfach nur eine super Erfahrung!', '2013-06-25', 'Krebs', '1,60', 'Nähen, Videospiele, Lesen', 'Wackelpudding, Erdbeeren, Fruchtzwerge', 'Schokokekse! *nomnomnom* Die überleben bei mir nie lange. Und ansonsten gerne alle Arten von Obst, das ist auch süß, macht aber nicht so dick :3', 'Eigentlich war es immer das Pferd. Ist es auch noch... aber in letzter Zeit bin ich seltsam addicted zu Tiger. Sie sind so flauschig *-* Ich hätte gern einen, wenn der nicht so groß werden würde.', 'Ich liebe alle Katzenpokemon (und Pummelluff). Am liebsten wäre ich ein Evoli, weil es so wandelbar ist wie ich selbst es bin.', NULL, 'Am besten gefallen mit mittelalterlich angehauchte Welten so wie in Claymore. Da würde ich mich, glaube ich, ziemlich wohl fühlen. Ich mag den rustikalen Charme und die mittelalterliche Kleidung sehr gerne und auch wenn die angenehmen Sachen der Neuzeit mir doch fehlen würden, ich nehm auch ein Bett aus Stroh <3', '     Ich war nie ein großer Magical Girls Fan, aber eine Serie hab ich dann doch gesehen und das war DoReMi. Und ich liebe Sofie! Sie ist einfach... genau wie ich :) ein bisschen sturköpfig aber immer für ihre Freunde da. Daher mag ich sie so gerne.', 'In der größten und schnellsten Achterbahn. Ich bin ein kleiner Adrenalinjunkie und könnte den ganzen Tag nur damit fahren.', 'Ganz egoistisch Unsterblichkeit. Auf der Welt gibt es so viel zu entdecken und ein Leben reicht gar nicht aus, um alles zu sehen. Und das finde ich so schade, dass ich gerne noch ein Leben und noch eins dran hängen möchte.', ': Ich bin Bibi und freue mich euch mit allerlei Kuchen den Tag versüßen zu dürfen :3 Und falls einmal eine Erdbeere auf eurer Torte fehlt, dann war ich es vielleicht, denn ich liebe Erdbeeren!', '#dbb7ff', 112),
(311, 77, 6, 'Maid', NULL, 2012, 'Weil ich Spaß an kreativer Arbeit, Mode und schön garnierten Süßigkeiten habe. ^^', '2013-12-20', 'Schütze', '1,68', 'Sport, zeichnen & kreatives Gestalten, etwas mit Freunden unternehmen, Sprachen lernen, reisen', 'Spinat & Lachs, Ramen, Okonomiyaki, gedünstetes oder gegrilltes Gemüse', 'Eiscreme & Joghurt, mitteldunkle Schokolade, Käsekuchen & Cup Cakes, Weihnachtsplätzchen, Lakritz… und zum Trinken: Chocolate Frappé', 'Füchse & Wölfe, sowie die domestizierte Version: Hunde  Sie sind hochintelligent, sie sind schnell, sie sind geheimnisvoll, gefährlich und trotzdem der beste Freund des Menschen, treu und stark. Ihr Fell ist weich und flauschig und der berühmte Hundeblick ist einfach unwiderstehlich. ', 'Ein FuchspokéMon, ob nun Vulpix, Evoli oder eine ihrer Weiterentwicklungen, weil ich Hunde super süß finde, aber das Geheimnisvolle an Katzen bewundere und Füchse beide Eigenschaften in sich vereinen. ', NULL, 'In der Fluch der Karibik Welt *trollolol* :D', 'Ich wäre lieber eine Revolverheldin wie Revy aus Black Lagoon. >:D', 'In der Wildwasserbahn! ', 'Ich möchte beamen und mich dadurch an verschiedene Orte teleportieren können – wie Son Goku. Nie wieder mit überfüllten Bussen oder Zügen fahren müssen, nie wieder an Bahnhöfen mit zwielichtigen Gestalten rumgammeln müssen, mich nie wieder über die Bahn ärgern, nie wieder eine Party absagen, weil man nachts nicht mehr nach Hause käme. Reisen an jeden Ort der Welt, ohne Hotel- oder Flugkosten, denn man kann ja jederzeit nach Hause.  DAS wäre die absolute Freiheit!! ', 'Ich bin lebenshungrig und wissbegierig, gerne unterwegs und würde am liebsten die ganze Welt bereisen, weil ich mehr von diesem wunderschönen Planeten sehen und begreifen will: verschiedene Kulturen, fremde Gerüche und Geräusche, ungewöhnliche Früchte, faszinierende Tiere, bunte Blumen und grüne Pflanzen, den blauen Himmel, das weite Meer, den Wind im Haar.  Ich liebe Freiheit und Athentisches, Farben und Lebensfreude.   Kreative Schaffensprozesse faszinieren mich, ob mit Stift & Papier, Lebensmitteln, Stoff, der Kamera oder am PC.   An sich bin ich eher eine ruhige Person, die lieber erst beobachtet, die Dinge hinterfragt und sich ihr eigenes Bild macht, bevor sie vorschnell handelt. Andererseits kann ich aber auch furchtbar spontan, abgedreht und verrückt sein.  Doch ich genieße auch faule und gemütliche Tage, ob zu Hause oder in einem guten Café. <3 ', '#66cafc', 112),
(312, 69, 12, 'Maid', NULL, 2013, 'Weil ich meine Erfahrungen erweitern wollte und mal ein wenig hinter die Kulissen schauen wollte wie das denn so als Maid ist :D', '1992-12-07', 'Schütze', '1,70', 'Musik hören, mit Freunden chillen, zocken.', 'Milchreis mit Zimt & Zucker', 'Snickers', 'Schlangen! Weil sie so wunderschön sind mit ihren Schuppen und den Augen, ich habe mich darin einfach verliebt :3', 'Ich denke ich wäre ein Lanturn, ich meine Wasser und Elektro gleichzeitig ist ja wohl mal der Wahnsinn :D', NULL, 'Natürlich in der Pokemon Welt!... oder in der Welt von ''Erementar Gerad'' ♥', 'Gar keins :D ich bin keine von diesen Träumerlienchen...', 'In diesen komischen Häusern, in denen alle Wände schief sind und man sich drin verläuft und gegen Sachen rennt :D', 'In meine Vergangenheit reisen zu können und meinem alten Ich sagen können was ich hätte besser machen können :]', 'Sehr kreativ & habe ganz viel Temperament und Leidenschaft.', '#f00001', 112),
(313, 65, 9, 'Maid', NULL, 2013, 'Ich wollte schon immer mal eine werden, weil ich Maids süß finde.', '1992-02-10', 'Wassermann', '1,59', 'Cosplayen, Freunde treffen, Mangas lesen,  Animes schauen, "Zocken" wenn man das mal so schreiben kann XD ', 'Sushi <3', 'Ich esse viele süße Sachen gerne und kann mich nicht entscheiden x.x', 'Der Wolf, weil er für mich eine persönliche Bedeutung hat ^-^', ' Mew <3 <3 Weil es ist klein, rosa und so mega süß *Q*', NULL, 'In zu vielen, haha. Elfenlied, Witchblade,  Gantz, Highschool Of The Dead, Shingeki No Kyojin, Hellsing, Najica, Dears und und und <3', 'Keins  ', ' Ich glaube ich wäre da, wo sich die meisten nicht rein trauen, also bei den schnellen und hohen Sachen ', 'Hmm, ich glaube ich würde mir wünschen, dass ich zaubern kann ^-^', 'Ich bin klein, verrückt, lieb und manchmal eine kleine Chaotin. ', '#cbf8e3', 112),
(314, 61, 7, 'Maid', NULL, 2013, 'Weil es mein Wille war! :D <3 Ach quatsch :) ich finde die Idee total super und es ist eine hübsche Arbeit :* Spaß macht es auch :) es war eine gute Entscheidung <3', '2013-10-09', 'Waage', NULL, 'Tanzen und joggen ;D', 'Milchreis <3', 'Yogurette <3', 'Hamster! Ich hatte den stärksten, besten und schlausten! Außerdem brachte die Serie "Hamtaro" mich durch die Kindheit :D', 'Espeon! Weil... PINK, elegant, schön und geheimnisvoll <3', NULL, 'Card Captor Sakura <3 Clamp schafft so großartige Welten :)', 'Ui ui ui <3 es MUSS aus Tokyo mew mew sein <3 und meine Wahl fällt auf Zakuro <3 Schade, dass ich so eine Grinsebacke bin und niemals so schön ernst aussehen werde wie sie. D: Aber sie ist eine wunderschöne und interessante Persönlichkeit v.v und so perfekt selbstbewusst :D so muss eine Frau sein!', 'Achterbahn und Shows! Jedoch weit entfernt von der Wasserbahn :DD', 'Hm... persönlich :) aber es wäre was typisches und schönes :) -> Veränderung ', 'Ich bin aufnahmefähig, motiviert und aktiv :D ', '#ff6db8', 112),
(315, 48, 7, 'Maid', NULL, 2013, 'Da meine Schwester bereits zum Lucky Chocolate Maid Café gehört hat, habe ich des öfteren von ihrer Arbeit im Café und den Treffen mit den Maids gehört und gemerkt, dass sie mit Begeisterung dabei ist. Dann schlug sie mir vor, dass ich mich doch auch mal bewerben sollte. Ich war überrascht aber habe schnell gemerkt, dass mir dieser Gedanke gefiel (wer kann zu diesen Maids schon nein sagen?)! Zum Glück haben sie mich aufgenommen :3 Dieses super süße Team ist nämlich genau so umwerfend niedlich wie es mir beschrieben wurde!^^', '2014-01-24', 'Wassermann', '1,67', 'Lesen, klettern, shoppen (am liebsten mit anderen süßen Mädels), kochen, backen und viiiieles mehr', 'Lasagne von Mama :3', 'Nimm 2 Soft (sooo weich, fruchtig und lecker...nomnom) =^.^= Aber auch Pfirsichringen und Lollies kann ich nicht widerstehen...*pureLiebe*', 'Katzen  sind meine  absoluten Lieblingstiere, weil sie einfach wunderschön sind, mit mir kuscheln wenn es mir mal schlecht geht und trotzdem ihren eigenen Kopf haben. Sie bringen mich zum lachen wenn sie mal wieder tollpatschig von einem Regal fallen oder total begeistert hinter einer Fliege her rennen...außerdem sind sie einfach nur süß. <3', 'Bei soo vielen Pokemon kann ich mich nicht festlegen, weil mir einige gefallen. Eins steht aber fest. Ich wäre ein wildes, da die Freiheit dann für mich verlockender wäre als alles andere. :D', NULL, 'Ich könnte mich bei den ganzen tollen und außergewöhnlichen Welten nicht entscheiden! Am liebsten würde ich von einer Welt zur nächsten reisen :3', 'Ich wäre super gerne Yuuki Asuna, da sie  eine starke Person ist und mutig ihre Freunde beschützt. Ich würde auch gerne mit einem Schwert umgehen können. Zudem ist sie sehr hübsch und hat Kirito an ihrer Seite. <3 Und in der 2. virtuellen Welt kann sie fliegen was mein absoluter Traum ist. *o* ', 'Überall wo ich einen Adrenalinkick bekomme xD...also alles vom freien Fall bis zur Wildwasserbahn.', 'Meine geheimsten Wünsche verrate ich nicht^^'' Aber ein paar einfache Wünsche, die man sich selbst erfüllen kann habe ich auch...fragt mich doch beim nächsten Besuch in unserem Café danach :3', 'Mein Name ist Lulu und ich bin eine quirlige, motivierte Maid. Ich hoffe gaaaanz viele glückliche Gesichter im Café bedienen zu dürfen. ^^', '#fa8073', 112),
(316, 68, 11, 'Maid', NULL, 2013, 'Das Konzept eines Maid Cafés hat mich schon länger interessiert. Der Kontakt zum Kunden ist ein völlig anderer, ein persönlicherer. Hinzu kommt noch, dass man die Möglichkeit hat in einem Team voller lieber Menschen zu arbeiten. ^-^/ ', '1995-12-11', 'Schütze', '1,72', 'Cosplayen, FFs lesen und schreiben', 'Da könnte ich mich nicht entscheiden... ^^''''', 'Jegliche Art von Schokolade', 'Hunde, da sie treudoof und wirklich immer für dich da sind :)', 'Woingenau! Er ist immer für einen Lacher gut ;D', NULL, 'Ich würde gerne in der Welt von One Piece leben, um die Grand Line mit meiner Crew zu besegeln. <3', 'Nico Robin :) Auch, wenn sie nicht das typische Magical Girl ist... Sie hat einen starken Charakter und setzt sich für ihre wahren Freunde ein!', 'Auf Geister- oder Achterbahnen <3', 'Ein gesundes und sorgenfreies Leben für Familie und Freunde. :)', 'Musikbegeistert & bereit meine gute Laune mit den Gästen zu teilen ~(^-^)~', '#ccff99', 112),
(317, 63, 7, 'Maid', NULL, 2013, NULL, '1996-01-28', 'Wassermann', '1,60', 'Backen, schwimmen, zocken', 'Ich liebe alles an Essen :D', 'Alles was aus Schokolade besteht . Ob Tafelschokolade, Torte, Kuchen, Kekse, Eis ...mhh lecker !', 'PANDAS! Groß, flauschig, süß und ihr schwarz weißes Aussehen macht sie einzigartig *-*', 'Schiggi ! Es war schon immer meine Erstwahl, denn es ist lustig, süß und wird groß und stark !', NULL, 'Dragonball! Wie toll es einfach wäre ein Supersayajin zu sein. Fliegen können und übermenschliche Kräfte zu haben~', 'Ich glaube Doremi (aus DoReMi) würde am besten zu mir passen. Sie ist immer fröhlich und leicht tollpatschig.', 'Natürlich an den Achterbahnen, Wildwasserbahnen eigentlich überall wo es einen Adrenalin-kick gibt !', 'Von der Fee würde ich mir eine Weltreise wünschen, mal alles sehen und überall Fotos machen.', 'ich bin Aiko - Immer fröhlich und ich liebe essen :3', '#cb5561', 112),
(318, 66, 8, 'Maid', NULL, 2013, 'Ich liebe es Menschen ein Lächeln aufs Gesicht zu zaubern und das kann man als Maid am besten :3', '2013-03-09', 'Fische', '1,75', 'Zeichnen, Onlinespiele/allgemein Spiele, Fotos und Videos machen :3', 'Pizza *-*', 'Oreo Kekse *-*', 'Ich habe kein wirkliches Lieblingstier, aber viele, die ich süß finde, wie zum Beispiel Katzen, Wölfe, Chinchillas und viele mehr :)', 'Ich wäre wahrscheinlich Blitza, ich liebe den Blitz und Donner über alles :)', 'Batman', 'In der Batman Welt *-*', 'Ich wäre Bunny aus Sailor Moon, sie ist schusselig aber wenn es drauf ankommt ist sie mit dem Herzen dabei <3', 'Auf der Achterbahn, ich liebe die Aktion ! :) ', 'Dass die Batman Welt, mit all ihren Schurken und Helden existiert *-* für manche ein Chaos für mich ein Traum ;)', 'Hallo, mein Name ist Honey :) Ich liebe Onlinespiele und die  Dc Comic Welten. Ich liebe es Leute glücklich zu machen und hoffe, dass ich auch euch ein Lächeln aufs Gesicht zaubern kann ;3', '#660066', 112),
(319, 58, 7, 'Maid', NULL, 2012, 'Aufgrund einer süßen Idee, die mir vorgeschlagen wurde. Ich konnte nicht widerstehen =)', '2013-01-27', 'Wassermann', '1,63', 'Tanzen, shoppen, reisen, feiern, lesen', 'Marmorkuchen, Erdbeeren', 'Schokokekse', 'Schildkröten sind die Ruhe selbst =) und Babyschildkröten sind einfach zuckersüß <3', 'Relaxo...ich liebe es zu schlafen', NULL, NULL, NULL, 'Irgendwo auf einer Achterbahn', 'Alles Glück dieser Welt für die Liebsten', 'Ein Tag ohne lächeln ist ein verlorener Tag - nach diesem Motto lebe ich.', '#609ce2', 112),
(320, 60, 8, 'Maid', NULL, 2013, 'Durch die Überredungskünste von Maid Jenny und Host Momo :D', '2013-11-19', 'Skorpion', '1,56', ' Ich beschäftige mich am liebsten mit koreanischer Popmusik und ihren Choreografien.', 'Viel zu viel was zur Auswahl steht um sich zu entscheiden >_<', 'Außer Vanilleeis nasche ich selten was :3', 'Ich mag keine Tiere >_<'''' Die beißen alle nur qq', 'Am liebsten wäre ich Pikachu. Es ist süß und liebenswert und wird oft in der Gegend herumgetragen <:', NULL, 'Ich denke, dass ich mich mit sehr vielen Welten anfreuden könnte. Ganz oben steht DeathNote, AngelBeats und Digimon.', 'Jeanne die Kamikaze Diebin, weil sie auch in den verzweifelsten Situationen nicht den Kopf hängen lässt :)', 'An allen möglichen Achterbahnen und Essensständen <:', 'Wenn ich mir nicht noch mehr Wünsche wünchen dürfte, würde ich mir Lebensglück wünschen. Außerdem würde ich mir wünschen, dass ich nichts im Leben bereuen würde.', 'Mein Name ist Tecky und ich liebe es zu K-Pop zu tanzen. Ich hoffe, ich schaffe es dir ein Lächeln ins Gesicht zu zaubern. <: ', '#f5c0c8', 112),
(321, 53, 7, 'Maid', NULL, 2013, 'Weil ich Menschen so gerne mit Tanzen/Singen/Spielen oder einfach nur einem netten Schwätzchen unterhalte. Und wo würde das besser gehen als in diesem Maid Café? Der Alltag ist schließlich ernst genug ;)', '2013-09-09', 'Jungfrau', '1,72', 'Cosplay, Singen, Zeichnen', 'Sushi & Obstsalat', 'Eiskonfekt :D', ' Ich denke das Faultier. Seine Augen sind so groß und die Gesichter sind so herzlich!!', 'Karpador  und ich würde nur noch Platscher einsetzen ^.~ ', NULL, 'Ich wäre gerne die beste Freundin von Sawako (Kimi ni Todoke). Ich liebe dieses Mädchen, sie hat einen unglaublich reinen Charakter ^.^', 'Iva aus Karneval! Sie ist zwar kein typisches Magical Girl, aber ihre Fähigkeiten sind beneidenswert (sie kämpft mit Diamanten O.O) und sie geht für ihre Freunde durch´s Feuer. ', 'Auf den Freefalltowern oder auf den Themenfahrten', 'Gesundheit für meine Lieben. Und mich einmal mit einem antiken Römer oder Griechen unterhalten können und fragen, wie das Leben damals wirklich war!!', 'Ich bin leicht chaotisch, aber aufgeweckt. Ich liebe Singen und Lachen & möchte euch mit guter Laune anstecken :D Ich freue mich sehr darauf, euch demnächst bedienen zu dürfen ;P ', '#ff7f50', 112),
(322, 49, 7, 'Maid', NULL, 0, 'Ich bin Maid geworden um mich neu zu fordern, neue Leute kennen zu lernen und einfach nur Spaß zu haben :D', '1991-07-16', 'Krebs', '1,65', 'Cosplay, Showgruppe D.A.N.G.O, singen', 'Salat, Thunfisch/Lachs Onigiri, Pilze', 'Kinderpingui und HariboSpaghetti', 'Mein Lieblings- Landsäugetiere bzw. -Tiere sind katzenartige. ich bin mit Katzen aufgewachsen und deswegen verrückt nach Vertretern der Katzenfamilie ^^ Mein Liebstes Meerestier ist der Orca. Ich hab früher sehr oft Free Willy geguckt und träume oft davon einmal mit einem Orca zu schwimmen :3', 'Ich wäre ein Nachtara  weil ich einfach ein Nachtmensch bin und Katzen und den Mond liebe oder ich wäre ein Ampharos, weil es einfach mein Lieblings Elektro-Pokémon ist welches ich, wenn es denn geht immer in meinem Team habe ^_^', NULL, 'Es gibt so viele tolle Welten o.o Digimon, Pokemon, Fairy Tail...', 'Da ist erstmal die frage wer jetz alles zum Magicalgirl zählt aber Blair aus Soul Eater oder Erza Scarlet aus Fairy Tail.', 'Überall und Nirgendwo am besten hat man meine Handynummer xD', 'Ich würde mir wünschen endlich meinen Traumberuf als Tierpflegerin ausüben zu können ^^', 'Ich bin lustig, aufgeweckt, kontaktfreudig, kreativ, hilfsbereit.', '#12b600', 112),
(323, 57, 7, 'Maid', NULL, 2013, 'Durch einige Besuche in Maidcafés und durch die tolle Werbung von May habe ich mich entschieden auch eine Maid zu werden, da man so viele Leute kennen lernt und tolle Erfahrung macht ^_^', '2013-06-08', 'Zwillinge', '1,62', 'Lolita, zeichnen, backen', 'Nudelgerichte, Steak', 'Karamellwaffeln', 'Der Panda - super flauschig, putzig und frisst den halben Tag!', 'Da ich darauf keine Antwort wusste, habe ich meine beste Freundin gefragt. Sie meinte Myrapla würde gut zu mir passen :D', NULL, ' In der von Kilala Princess, weil ich die Disney Prinzessinnen liebe <3', ' Super Pig! Ein Schwein als Superheldin ist einfach cool :D', 'Wildwasserbahn', 'Noch mehr Wünsche ;P', 'Ich liebe Lolita, es ist mein größtes Hobby. Was man vielleicht nicht direkt vermutet ist mein Musikgeschmack, denn ich höre bevorzugt Metalcore. Ebenso liebe ich Essen, ich bin vielleicht kein Gourmet aber zu einem leckeren Gericht sage ich eigentlich nicht nein ;) Abgesehen von Lolita und Maid bin ich Mediengestalterin und verdiene so mein Geld, was ich dann in tolle Kleider investiere ;D Außerdem glaube ich, dass man durch den Steckbrief schon einiges über mich erfährt.', '#ccd4d4', 112),
(324, 50, 9, 'Maid', NULL, 2013, 'Durch neugier, interesse an der Japanischen Kultur, spaß an Shootings, liebe zu süßen und leckeren Törtchen usw und letztendlich durch meine Freundin May ;) und ich bereue es kein bischen, da ich super tolle und nette Leute kennen gelernt habe mit denen man die gleichen Interessen teilen darf und das macht es um so schöner!', '1988-02-15', 'Wassermann', '1,65', 'Cosplay und Bengalkatzen', 'ReisCurry', 'Eiscreme', 'Ich bin fasziniert von Katzen und damit meine ich nicht nur Hauskatzen sondern auch Wildkatzen, wie z. B. Geparden, Leoparden aber auch Löwen usw. Doch an erster Stelle steht bei mir die Bengalkatze. Ich besitze selber zwei von den Stubentigern und will sie nicht mehr missen. Sie haben einen tollen Charakter und sind echt einzigartige Tiere. Sie lieben Wasser, reden viel und sind Energiebündel, die bis ins hohe Alter total verspielt sind. Ihre wilde Leopardenmusterung macht sie so faszinierend. Ganz toll finde ich auch Abessiner und Savannah Katzen.', 'Pikachu. Es ist frei und immer voller Energie geladen und so manch einem könnte ein Stromschlag mal nicht schaden xD', NULL, 'In einem Mix aus verschiedenen. Wichtig wäre mir Frieden und der Schutz der Tiere, wo Mensch & Tier im Einklang leben. Wo Kinder behutsam aufwachsen können und man noch Träume hat und die Welt nicht von Hass erfüllt ist und Geld nicht die Welt regiert. Dort, wo wir die Welt nicht kaputt machen und die Natur geschätzt und respektiert wird. Und eine mit ganz viel Sonnenschein :)', 'Wer wäre denn nicht gerne eine Sailor Kriegerin im Kampf für die Gerechtigkeit?', 'Ich glaube überall *lach* an Spielbuden, Süßigkeitenständen und den größten und schnellsten Attraktionen. Wahrscheinlich aber an einem riesen Pferde Karussel, ich finde die altmodischen großen Karussels wunderschön und könnte sie stundenlang bewundern.', 'Natürlich mehr Wünsche, was soll der Geiz hehehe :D Aber ich kann schonmal einen verraten, ich würde super gerne mal nach Japan und außerdem dort selbst mal in einem Maid Cafe bedient werden ^-^', 'Ich bin mit Anime & Manga groß geworden, daher cosplay ich gerne. Und ich fühle mich als Maid pudelwohl :3 Außerdem liebe ich den Gyaru Style und die Lolita Mode ist ein Traum! :) Ich liebe Tiere über alles und finde, dass man sich viel mehr für den Tierschutz einsetzen sollte.  Ganz besonders liebe ich meine Bengalkatzen Simba & Cira. Sie sind alles für mich <3', '#ff0d86', 112),
(325, 52, 9, 'Maid', NULL, 2013, 'Maid Café''s haben mir schon immer gut gefallen und ich wollte auch gerne mal in einem arbeiten.  Außerdem möchte ich viele neue Leute kennenlernen^^', '2013-04-04', 'Widder', '1,68', 'Lolita tragen, Dolls sammeln und Konzerte besuchen.', 'Sushi, Pizza, Pasta und Spinat :3', 'Kuchen natürlich, am liebsten mit Erdbeeren! Und Macarons <3', 'Ich liebe Alpacas! Die sind sooo flauschig und süß und gucken immer so lieb und treudoof *-*', 'Togepi! Es ist immer fröhlich und süß <3', NULL, 'Ich glaube die Digiwelt wäre ganz cool^^', 'Sailor Venus! Sie ist einfach die coolste :D', 'Bei den gebratenen Champignons und den Schokofrüchten, die liiiebe ich <3', 'Ein Leben wie Marie Antoinette xD', 'Ich bin eine Backfee, denn ich liebe backen einfach.', '#79d5ac', 112),
(326, 51, 7, 'Maid', NULL, 2014, 'Mir gefallen die Outfits. Zudem mag ich es den gleichen Stil in einer Gruppe zu tragen (z.B. auch Cosplay und Gothic Lolita).', '2015-12-31', 'Steinbock', '1,75', 'Zeichnen, Lesen, Fotografieren', 'Nudeln aller Art, Süßes', 'Schokolade!', ' Hühner! Hühner sind einfach so cool und liebenswert, oftmals auch sehr belustigend (Ich habe selbst Zwerghühnchen). Ich mag aber auch Katzen sehr gerne.', 'Ein Lugia! Ich mag Vögel sehr gerne. Zudem ist Lugia ein eleganter Flieger... und Fliegen würde ich auch gerne können :)', NULL, 'Das ist eine sehr schwere Frage... Es gibt so viele tolle Welten. Im Moment würde ich sagen in der ''Attack on Titan'' Welt, da ich ein großer Fan von Fachwerkhäusern bin und das derzeit auch meine Lieblingsserie ist. Ansonsten gefällt mir die Welt von ''Ao no Exorcist'' sehr gut, da ich den Campus und die Uniformen super finde.', 'Momoko Asuka von Doremi. Ich liebe einfach ihren lebhaften Charakter! Da ich ein eher zurückhaltender Mensch bin, wünsche ich mir manchmal etwas von ihrer lustigen und positiven Art ;)', 'Bei der nicht ganz so schnellen Achterbahn', 'Dass die Menschen mehr Rücksicht auf andere nehmen und mehr Toleranz zeigen würden.', 'Ich bin Auszubildenende beim Fotografen, liebe Tiere und Manga/Anime. Ich wirke auf die meisten ruhig und zurückhaltend, bin aber ein sehr aufgeschlossener Mensch.', '#f5ac81', 112),
(327, 71, 6, 'Maid', NULL, 2012, 'Anfang 2011 war ich das erste mal  im Lucky Chocolate Maid Café und ich fand die Atmosphäre da so toll und die Kleider waren auch so süß :D da wollte ich unbedingt mitmachen und auch mal die andere Seite der Con sehen :)', '2013-04-12', 'Widder', '1,58', 'Kochen <3', 'Alles was schmeckt (derzeitiger Favorit: Bulgogi <3)', 'EIS, POPCORN! *^* :D', 'Löwen :) es ist halt der König der Tiere ;P', 'ich wäre gern ein Vulpix: süß, klein, trotzdem eigensinnig, temperamentvoll  und nicht leicht zu erobern ;) und wenn es jemanden mag, dann auch von ganzem Herzen <33', NULL, 'One Piece *^* aber auch hier in der realen Welt wird es nie zu langweilig :D', 'Es ist kein typisches Magical Girl, aber ich wäre gerne Buttercup :DD sie ist stark, sehr frech, kann gemein sein, aber im Herzen ist sie sehr lieb <3', 'An den Imbissbuden :DDDD und an den Zuckerwaren (Zuckerwatte und Schokoäpfel FTW *^*) xD <3', 'Dass meine Familie und Freunde gesund bleiben und dass ich glücklich bin :3', 'Ich bin die kleine Umi, die unheimlich gerne isst und ich freue mich euch im Café zu bedienen <3', '#058d41', 112),
