 dort selbst mal in einem Maid Cafe bedient werden ^-^', 'Ich bin mit Anime & Manga groß geworden, daher cosplay ich gerne. Und ich fühle mich als Maid pudelwohl :3 Außerdem liebe ich den Gyaru Style und die Lolita Mode ist ein Traum! :) Ich liebe Tiere über alles und finde, dass man sich viel mehr für den Tierschutz einsetzen sollte.  Ganz besonders liebe ich meine Bengalkatzen Simba & Cira. Sie sind alles für mich <3', '#ff0d86', 112),
(330, 72, 11, 'Maid', NULL, 2012, 'Ich finde es toll in einer süßen Uniform mit süßen Maids zusammen zuarbeiten, in einem süßen Cafe :)  Mir macht es einfach total Spaß (^.^)//', '2013-09-12', 'Jungfrau', '1,69', 'Singen, Tanzen, Camwhoring, Cosplay, Shoppen, Zeit mit meinen Liebsten verbringen, Zeichnen und Malen, Schauspiel, Japanisch lernen...und und und...', 'Zu viel! ^.~', 'Schokolade mit Macadamianüssen und japanisches Konfekt mit Bohnenpaste *__*', 'Ich liebe sooo viele Tiere! Im Moment ahbe ich ein Meerschweinchen und einen Kater :)', 'Woingenau. Dann könnte ich immer im Heißluftbaloon fliegen +__+ yeah! ', NULL, 'Ich würde gerne im wandelnden Schloss leben >///< Das wäre schön und aufregend *^* ', 'Natürlich Sailor Moon >_< Weil sie lustig, hübsch und süß ist und dann auch noch ihren Traumann an ihrer Seite hat. Was will man mehr ^.~  ', 'Bei der Zuckerwatte! ', 'Das alle Menschen glücklich sind :) ', 'Ich bin ein verplantes, kreatives Persönchen, dass meistens ziemlich aufgedreht ist :0  Meine Stärke ist meine gute Laune (^-^) Ich mache gerne Quatsch und freue mich immer, neue Leute kenne zulernen. Aber gefährlich bin ich auch...habe mal Kung Fu gemacht waaahh~~ .`__´.  Kampf-Maid-Power! (>.<)', '#ce9b02', 112),
(331, 67, 9, 'Organisator', NULL, 2012, 'Weil ich es schön finde Leute zu entertainen, süße Maidkleider zu tragen und neue Leute kennenzulernen. Es macht mir viel Spaß zu sehen, wie sich die Gäste an unseren süßen Sachen erfreuen. Ich zaubere gerne jedem ein Lächeln ins Gesicht :3 Und nur ein zufriedener Kunde ist ein guter Kunde <3', '1990-11-16', 'Skorpion', '1,58', 'Lolita Mode tragen, shooten, shoppen, tanzen, Filme gucken, feiern gehen, mit Freunden treffen', 'Kaage-Ramen, KFC, Bún chả, Phở', 'Schokopudding, Erdbeertorte, Benjamin Blümchen Torte, Amicelli, Giotto <3', '1) Wölfe, sie sind stark, anmutig und gefährlich. Diese Kombination ist  sehr faszinierend und mystisch. 2) Delfine. Sie sind die schönsten Geschöpfe der Welt. Für mich sind sie ein Symbol für Freiheit. 3) Meine Bengal Katzen. Süß, vespielt und keine normalen Katzen (nicht nur optisch) :D', 'Ich bin zwar eher ein Fan von Evoli und Vulpix, aber ich  wäre ein Pikachu. Einfach voller Energie geladen und manchmal etwas frech, aber liebenswürdig. Man muss nur für sich entdecken ob diese Energie positiv oder negativ ist. Auf jedenfall ist es verdammt süß und sehr treu :)', 'Ghibli-Filme', 'OMG ich könnte mich absolut nicht entscheiden. Es gibt so viele tolle Welten, da fällt es einem unheimlich schwer sich eine Welt rauszusuchen. >.<  Hauptsache es herrscht Harmonie, Humor, Liebe, Action und ein klein wenig Fantasy :) Aber die Welten der Ghibli-Filme finde ich immer besonders kreativ :)', 'Eigentlich gefallen mir alle Hauptcharaktere von der Manga-Zeichnerin Arina Tanemura (Fullmoon wo sagashite, Jeanne ect.). Jede Figur ist für sich ein ganz besonderer Chara und jeder rettet die Welt auf seine Weise. Ich bewundere den starken Charakter und die unglaubliche Ausstrahlung der Figuren. Könnte ich mir aussuchen ein Magical Girl zu sein, dann wäre ich eine Mischung aus allen Hauptcharakteren von Arina T. ^^', 'Ganz klar, überall wo es schnell ist und so viel Adrenalin wie möglich ausgestoßen werden kann xD', 'Glücklich zu sein bis an das Ende meiner Tage! Denn egal wie viel Geld ich besitze oder ob ich einen guten Mann an meiner Seite habe, bedeutet dass noch lange nicht, das ich auch glücklich bin. ^^', '~Okaerinasaimase, goshujin-sama, ojou-sama~. Mein Name ist May und ich komme aus der Meisterstadt Dortmund :) Ich bin ein aufgewecktes und fröhliches Mädchen, dass gerne auch mal etwas durchgeknallt ist :D Es macht mir sehr viel Spaß, in einem so tollen Team arbeiten zu dürfen und den Gästen viel Freude zu bereiten ^^ Ich wünsche euch allen ein super süßes "Moe, moe kyun <3"', '#fe9ece', 112),
(332, 74, 8, 'Entertainment', NULL, 2010, 'Eine Freundin bat mich damals mit ihr mitzumachen und ich fand die Idee in ein süßes Kleid zu schlüpfen und zu bedienen wunderbar und süß. Außerdem ist es toll wie viele neue Leute man kennenlernt und wie schnell die Maids hier einem ans Herz wachsen. <3', '2013-10-17', 'Waage', '1,63', 'Musik (hören, singen, tanzen und selber machen) <3', 'Crêpes, Sushi', 'Torten, in jeglicher Art, Form etc. Total lecker und vor allem vielseitig, da ist einfach immer was dabei, für jeden Geschmack, Anlass, Jahreszeit! Und so ein Stück Torte lässt einen doch gleich glücklicher werden, wenn man es sich auf der Zunge zergehen lässt, auch wenn es auf die Hüften schlägt! x3', 'Hm… schwierig, ich finde Wildkatzen total faszinierend und atemberaubend schön, aber genauso bin ich auch voll der Hundefan, Huskys oder Wölfe *__________* Also kein richtiges Lieblingstier, dafür bin ich viel zu tierverrückt  <3', 'Vulnona, es ist ein edles und mysteriöses Pokémon, schwer zu fassen, hat magische Fähigkeiten und gehört dem Feuerelement an. Ich fand es schon immer wunderschön.', NULL, 'Definitiv in der Digiwelt! Digimon können mit einem reden und man kann sicher viele Abenteuer mit ihnen erleben. So einen Digipartner zu haben ist doch sicher spannend! *___*', '„Stark, bereit, unbesiegbar, schön, entschlossen, mutig! “ Richtig: Jeanne, die Kamikaze Diebin! Warum? Sie ist eine bewundernswerte Person, als Kind habe ich sie für ihre Stärke immer sehr bewundert. Außerdem ist sie nicht das typische Magical Girl, welches ständig gerettet werden muss, weint und schwach ist. Sie weiß mit ihren Problemen umzugehen und gibt nicht auf. Wenn sie sich verwandelt erkennt man nicht wer sie in Wirklichkeit ist und sie hat einen wunderbaren kleinen Engel der ihr hilft und ein relativ „normales“ Leben. Desweiteren wollte ich schon immer ihren Wunderball haben, mit dem sie sich überall festhalten konnte, praktisches Ding! xD', 'Natürlich bei den Achterbahnen! So ein bisschen Nervenkitzel ab und zu ist einfach purer Fun! Aber ein bisschen Entspannung fürs Herz muss natürlich auch sein, also werde ich ab und zu auch mal am Karussell vorbei schauen und gucken ob vielleicht mein Prinz dort steht und wartet.', 'Eine Zeitreise zu machen. Vergangenheit und Zukunft erkunden, in verschiedene Epochen reisen, dort die Trachten tragen, Speisen probieren, Sitten kennenlernen, aber auch um zu wissen, wie das Leben vor der Menschheit war, Dinosaurier sehen und die Welt in 803789519 Jahren sehen! xD', 'Ich bin Miu, manchmal etwas tollpatschig aber meistens gut gelaunt. Hin und wieder bin ich etwas abgedreht x3 Oh und ich liiiiiiiiebe Kuscheltiere <3', '#c99bfe', 112),
(333, 76, 9, 'Maid', NULL, 2010, 'Damals war ich bei einem seperaten Event von dem Lucky Chocolate in Düsseldorf. Danach war ich so begeistert, dass ich mich auch als Maid beworben habe. Schließlich wurde ich angenommen und war das erste mal bei der Dokomi 2010 aktiv. :) ', '2013-12-22', 'Steinbock', '1,68', 'Musik (Saxophon spielen), Backen, Ausgehen, Festivals, Philosophie und so ein Kram. :D ', 'Schokolade. Am liebsten kiloweise!!', 'SCHOKOLADE. TONNENWEISE!', 'Ich hab zwei! Einmal Eulen und Katzen. Eulen finde ich schon toll seit ich denken kann, da diese Tiere sehr weise und stolz wirken. Katzen hingegen sind die einzigen Haustiere die irgendwie noch ihr eigener Herr sind. Sie haben einen eigenen Willen und springen dir nicht hinterher wie ein Flummi. Sie sind unabhängig aber lieben trotzdem bedingungslos. ', 'Flegmon! Faul sein den ganzen Tag, das wärs!', NULL, 'Definitiv in der von One Piece. Ich will Reisen und die Welt sehen. Dabei noch einen Schatz suchen... der Gedanke gefällt mir!', 'Oha, das ist eine wirklich, wirklich schwere Frage. Ich persönlich sehe mich einfach so gar nicht als Magical Girl. Magical Girls sind entschlossene und mutige Persönlichkeiten, die oft eine große Verantwortung in die Hand gelegt bekommen. Ich zweifel oft an meinen Fähigkeiten und bin glaube ich einzig und allein gut darin, Schokolade zu eliminieren. Daher sollten wir das bei mir mit dem Magical Girl lieber sein lassen ;)', 'Erst auf der abgefahrensten Achterbahn die es da so gibt. Danach würde ich (natürlich wenn mein Magen noch möchte) erstmal was essen und DANN (ganz wichtig! Ein Muss bei jedem Ausflug in den Freizeitpark!!) Maskottchen auf den Arm nehmen. :D', 'Einen nicht ausschöpfbaren Vorrat an Schokolade! Dafür muss dann eine neue Einheit erfunden werden. Zum Beispiel Trillzionen Tonnen? (Trillzionen ist dann nicht eine Millionen hoch 3, sondern eine Trillionen hoch unendlich! OH JA!)', 'Meinen Charakter würde ich als wuselig aber trotz allem auch als offen und freundlich bezeichnen... Zumindest gebe ich mir dabei aller beste Mühe. :) Ich konnte im Jahr 2013 leider nicht im Cafe mitwirken, daher freue ich mich umso mehr auf 2014!  Wir sehen uns im Cafe! ', '#cfc4e4', 112),
(334, 76, 10, 'Maid', NULL, 2010, 'Damals war ich bei einem seperaten Event von dem Lucky Chocolate in Düsseldorf. Danach war ich so begeistert, dass ich mich auch als Maid beworben habe. Schließlich wurde ich angenommen und war das erste mal bei der Dokomi 2010 aktiv. :) ', '2013-12-22', 'Steinbock', '1,68', 'Musik (Saxophon spielen), Backen, Ausgehen, Festivals, Philosophie und so ein Kram. :D ', 'Schokolade. Am liebsten kiloweise!!', 'SCHOKOLADE. TONNENWEISE!', 'Ich hab zwei! Einmal Eulen und Katzen. Eulen finde ich schon toll seit ich denken kann, da diese Tiere sehr weise und stolz wirken. Katzen hingegen sind die einzigen Haustiere die irgendwie noch ihr eigener Herr sind. Sie haben einen eigenen Willen und springen dir nicht hinterher wie ein Flummi. Sie sind unabhängig aber lieben trotzdem bedingungslos. ', 'Flegmon! Faul sein den ganzen Tag, das wärs!', NULL, 'Definitiv in der von One Piece. Ich will Reisen und die Welt sehen. Dabei noch einen Schatz suchen... der Gedanke gefällt mir!', 'Oha, das ist eine wirklich, wirklich schwere Frage. Ich persönlich sehe mich einfach so gar nicht als Magical Girl. Magical Girls sind entschlossene und mutige Persönlichkeiten, die oft eine große Verantwortung in die Hand gelegt bekommen. Ich zweifel oft an meinen Fähigkeiten und bin glaube ich einzig und allein gut darin, Schokolade zu eliminieren. Daher sollten wir das bei mir mit dem Magical Girl lieber sein lassen ;)', 'Erst auf der abgefahrensten Achterbahn die es da so gibt. Danach würde ich (natürlich wenn mein Magen noch möchte) erstmal was essen und DANN (ganz wichtig! Ein Muss bei jedem Ausflug in den Freizeitpark!!) Maskottchen auf den Arm nehmen. :D', 'Einen nicht ausschöpfbaren Vorrat an Schokolade! Dafür muss dann eine neue Einheit erfunden werden. Zum Beispiel Trillzionen Tonnen? (Trillzionen ist dann nicht eine Millionen hoch 3, sondern eine Trillionen hoch unendlich! OH JA!)', 'Meine Name ist Fia und ich bin wuselig aber trotz allem auch offen und freundlich... Zumindest gebe ich mir dabei aller beste Mühe. :) Ich konnte im Jahr 2013 leider nicht im Cafe mitwirken, daher freue ich mich umso mehr auf 2014!  Wir sehen uns im Cafe! ', '#cfc4e4', 112);
INSERT INTO `maid_versions` (`ID`, `RecordID`, `Version`, `Type`, `colour`, `since`, `maidreason`, `BDay`, `zodiac`, `size`, `hobbys`, `favfood`, `favsweet`, `favanimal`, `pokemon`, `anime`, `animelocation`, `magicalgirl`, `funfairlocation`, `wish`, `aboutme`, `mcolour`, `maidphotoID`) VALUES
(335, 79, 8, 'Maid', NULL, 2011, 'Ich bin Maid geworden, weil ich es liebe Leuten eine Freude zu bereiten und an diesem Job sehr viel Spaß habe.', '2014-02-04', 'Wassermann', '1,61', 'Zeichnen, reiten, schwimmen, Cosplay', 'Milchsuppe, Pizza, Sushi, Nudeln', 'Ich liebe Schoko-CuepeCakes, mit Sahne und dann noch Streusel drauf, am besten bunte. ', 'Da kann ich mich nicht entscheiden aber ich sage mal Katzen und das weil ich selber auch drei Katzen zuhause habe.', 'Also wenn dann vielleicht Arktos, weil ich das einfach liebe und ich das auch früher in den Video-Spielen immer genommen habe, außerdem liebe ich Schnee, Winter und wenn es kalt ist :3 ', NULL, 'Ich würde gerne im Anime "Eden of the East" oder "Air Gear" leben weil es einfach nur interessant wäre und ich einfach diese Animes sehr mag, auch wenn "Trinity Blood" oder "D.Gray-man" auch toll wären >.< ', 'Also wenn dann Dokuro-chan XD weil sie einfach nicht das übliche Magical Girl Opfer ist. Denn sie hat eine Waffe mit der sie einige mal ab und zu tot schlägt aber trotzdem iwie schon süß ist :3 ', 'Man würde mich denke ich an fast jedem Karusell finden oder besser an allem was einen Überschlag macht und schnell ist, weil ich es liebe auf Achterbahnen zu gehen. ', 'Wenn ich einen Wunsch frei hätte würde ich es so machen, dass mein Leben wie in dem Anime Eden of the East wäre, sodass ich auch einer der Selecaos wäre, weil ich das einfach so interessant finde, bzw. was man dann alles machen könnte. ', 'Hallo <3! Ich bin Tsuki, backe und koche gerne. Ich liebe Onlinespiele und werkel in meiner Freizeit gerne an meinen Cosplays!', '#95001e', 112),
(336, 73, 7, 'Maid', NULL, 2011, 'Als Maid bereitet es mir die größte Freude so viel Kontakt mit neuen Menschen zu haben und ihnen mit Gesprächen, Spielen und unseren leckeren Kuchen ein Lächeln auf ihr Gesicht zu zaubern.', '2013-04-04', 'Widder', NULL, 'Theater, Spielkonsolen, Cosplay', 'Vanilleeis mit heißen Kirschen', 'Helle Schokomuffins mit Schokoladenstückchen! Wenn man hinein beißt, kommt einem immer die Frage auf: Bekomme ich jetzt ein Stück Schokolade ab oder nicht? Und wenn doch, schmeckt der auch so schon leckere Muffin noch viel besser!', 'Eulen. Sie sind wunderschöne und elegante Tiere. Sie strahlen eine unfassbare Stärke aus, sodass man von ihnen fasziniert sein muss.', 'Glumanda! Ich friere immer sehr schnell und als Feuer-Pokemon könnte mir das nicht passieren! Davon ab sind Glumandas Weiterentwicklungen nicht so schwach und süß, als dass Team Rocket versuchen würde sie zu fangen. ', NULL, 'In der Digiwelt! Ein Digimon ist dein bester Freund und mit ihm dann auch noch zusammen spannende Abenteuer zu erleben, wäre das Größte. ', 'Eindeutig Michiru Kaioh von Sailor Moon! Als ich sie das erste mal im Anime in einem Park mit ihrer Violine gesehen habe, war es um mich geschehen. Den ganzen Tag habe ich meine Mutter angebettelt mir eine Geige zu kaufen und meine Haare zu färben, was sie mir, verständlicherweise, nicht erlaubt hat. Davon abgesehn, war ich früher in Haruka Tenoh verliebt und mein sehnlichster Wunsch war sie zu heiraten! ', 'Achterbahnen! Je schneller und gefährlicher, desto besser! Wenn man im Sitz sitzt, langsam die Schräge hoch fährt um im nächsten Moment in einen Looping durchzustarten ist das Größte! Wenn man dann genug von der ganzen Fahrerei hat, kann man dann in Ruhe einen leckeren selbstgebackenen Schokomuffin genießen.~ ', 'Nach meinem Leben möchte ich gerne eine Katze sein. Katzen sind schöne und vor allem eigenwillige Tiere. Und wenn ich sehe wie ich meine Katze immer verhätschel, könnte mir ein Leben als Katze ziemlich gut gefallen. Nur auf das Mäusejagen kann ich verzichten...', 'Hey! Ich bin Peggy und liebe es mit meiner Katze zu kuscheln. Ich freue mich schon euch bedienen zu dürfen <3 ', '#9b002f', 112),
(337, 75, 8, 'Maid', NULL, 2011, 'Ich fand Maids und die Idee vom Maidcafé schon immer total süß <3', '2013-11-06', 'Skorpion', '1,58', 'Zeichnen, Geige spielen, Tanzen, Animes und Mangas <3', 'Schokolade :)', 'Schokolade :)', 'Katze! Sie sind intelligent, elegant, trotzdem süß, verschmust und außerdem etwas eigensinnig. ', 'Ich wäre Vulpix :)', NULL, 'Hm...  wahrscheinlich Death Note... ist eigentlich unsere Welt, aber ein Death Note würde existieren! :D', 'Sailor Mars! Schon allein wegen den schwarzen Haaren und da meine Lieblings- und Maidfarbe Rot ist :D Aber auch ich kann manchmal ein bisschen zickig sein wie Sailor Mars und bin im Grunde aber ein ganz lieber Mensch :)', 'Beim Süßigkeitenstand :3 und wenn nicht dann auf dem Riesenrad :D', 'Seelenfrieden :) ', 'Ich bin am Anfang sehr schüchtern und rede nicht gerne. Aber wenn man mich ein bisschen besser kennen lernt, merkt man, dass ich eigentlich ein sehr aufgeschlossener Mensch bin, mit dem man viel Spaß haben kann.', '#fe0000', 112),
(338, 78, 7, 'Maid', NULL, 2012, '2011 wurde ich danke meines Bruders mal gaaaaanz spontan plötzlich Helferin. Ich habe dabei so viele neue nette Leute, Helfer und Maids kennen gelernt. Es war lustig und hat so Spaß gemacht und weil die Maids dabei auch noch alle so zuckersüß aussahen, hatte ich mich kurz danach sofort beworben. ', '2013-11-14', 'Skorpion', '1,58', 'Zeichnen (am liebsten Mangafiguren), Singen, Filme schauen und Süßigkeiten naschen', 'Mmmh ~ Ich weiß nicht…Erdbeeren? Sushi? Ramen? Fried Ice Cream? Zu viele Verführungen! Ich kann mich nicht entscheiden *o* ', 'Ich liebe Fried Ice Cream ~ Außen warm und knusprig ~ Innen kalt, süß und schmilzt langsam auf der Zunge <3', 'Teacupschweinchen~ so klein und süß und knuffig und die NASE! <3 ', 'Ich wäre gerne Evoli ~ Evoli ist süß und sooo flauschig. Es hat so viel Potenzial und kann sich zu so vielen verschiedene Pokemon entwickeln.', NULL, 'Tsubasa Chronicle ~ Knuffiger Mokona und in der Welt von Tsubasa Chronicle gibt es noch so viele unterschiedliche Welten: vergangene und zukünftige Welten, Real-live ähnliche und Fantasy-Welten. Da ist einfach alles dabei! =3 ', 'Jeanne d’Arc! Sie ist ein bewundernswerter Chara ~ Stark, mutig, schön und entschlossen~ Man kann sie nur ins Herz schließen. Obwohl sie von klein auf ein hartes Leben hat, hat sie nie aufgegeben und wird dadurch nur immer stärker.  ', 'Bei der Wildwasserbahn! Es ist lustig wenn alle nass sind.', 'Ich würde mir wunderschöne Flügel wünschen damit ich die Welt von ganz oben sehen kann und viele Länder bereisen kann. Erste Station: Japan! <3', 'Ich bin etwas tollpatschig und vergesslich und eher schüchtern. Ich verhasple mich deswegen manchmal weil ich dann so nervös bin… Gomenasai! >____< Aber ich gebe mein bestes weil es mir unglaublich viel Spaß macht euch zu bedienen und euch ein Lächeln ins Gesicht zu zaubern.', '#ce398a', 112),
(339, 78, 8, 'Maid', NULL, 2012, '2011 wurde ich danke meines Bruders mal gaaaaanz spontan plötzlich Helferin. Ich habe dabei so viele neue nette Leute, Helfer und Maids kennen gelernt. Es war lustig und hat so Spaß gemacht und weil die Maids dabei auch noch alle so zuckersüß aussahen, hatte ich mich kurz danach sofort beworben. ', '2013-11-14', 'Skorpion', '1,58', 'Zeichnen (am liebsten Mangafiguren), Singen, Filme schauen und Süßigkeiten naschen', 'Mmmh ~ Ich weiß nicht…Erdbeeren? Sushi? Ramen? Fried Ice Cream? Zu viele Verführungen! Ich kann mich nicht entscheiden *o* ', 'Ich liebe Fried Ice Cream ~ Außen warm und knusprig ~ Innen kalt, süß und schmilzt langsam auf der Zunge <3', 'Teacupschweinchen~ so klein und süß und knuffig und die NASE! <3 ', 'Ich wäre gerne Evoli ~ Evoli ist süß und sooo flauschig. Es hat so viel Potenzial und kann sich zu so vielen verschiedene Pokemon entwickeln.', NULL, 'Tsubasa Chronicle ~ Knuffiger Mokona und in der Welt von Tsubasa Chronicle gibt es noch so viele unterschiedliche Welten: vergangene und zukünftige Welten, Real-live ähnliche und Fantasy-Welten. Da ist einfach alles dabei! =3 ', 'Jeanne d’Arc! Sie ist ein bewundernswerter Chara ~ Stark, mutig, schön und entschlossen~ Man kann sie nur ins Herz schließen. Obwohl sie von klein auf ein hartes Leben hat, hat sie nie aufgegeben und wird dadurch nur immer stärker.  ', 'Bei der Wildwasserbahn! Es ist lustig wenn alle nass sind.', 'Ich würde mir wunderschöne Flügel wünschen damit ich die Welt von ganz oben sehen kann und viele Länder bereisen kann. Erste Station: Japan! <3', 'Ich bin etwas tollpatschig, vergesslich und eher schüchtern. Ich verhasple mich deswegen manchmal weil ich dann so nervös bin… Gomenasai! >____< Aber ich gebe mein bestes weil es mir unglaublich viel Spaß macht euch zu bedienen und euch ein Lächeln ins Gesicht zu zaubern.', '#ce398a', 112),
(340, 80, 8, 'Maid', NULL, 2012, 'Maid bin ich geworden weil ich quasi genötigt wurde von zwei Freundinnen. Als ich dann ein Seminar besucht habe und so herzlich aufgenommen wurde habe ich unglaublich viel Spaß gehabt und viel gelernt. Den Gästen einen schönen Tag zu bereiten macht mich glücklich :3', '2013-08-14', 'Löwe', '1,82', 'Meine Hobbys sind die Showgruppen in denen ich Mitglied bin also singen und tanzen und außerdem schwimmen und kochen', 'Lasagne', 'Ich liebe Eiscrem aber mein absoluter Favorit sind Erdbeeren in  weißer Schokolade ', 'Mein Lieblingstier ist schwierig auszuwählen, da ich so viele mag, aber ich denke ich mag wildtiere am meisten, wie zum Beispiel den Wolf oder den Luchs. Sie sind wunderschön anzusehen, wild und frei <3', 'Ich wäre auf jeden Fall ein Psiana, denn meine beste Freundin ist ein Nachtara <3 Wir machen alles zusammen.', NULL, 'In einer anderen Welt zu leben wäre bestimmt aufregend. Die Welt von Avatar (auch wenn es kein Anime ist) würde mich besonders reizen, weil ich gerne wüsste welches Element ich wohl bändigen würde (mein Tipp ist ja Wasser aber wer weiß).', 'Ein spezielles Magical Girl habe ich nicht im Sinn. Doch vermutlich hätte ich Heilfähigkeiten, denn ich bin eine wandelnde Apotheke und ein Verbandskasten.', 'In Vergnügungsparks findest du mich immer an der schnellsten und wildesten Achterbahn. Ich liebe die schnelle Fahrt und schreie wie ein kleines Mädchen.', 'Den Wunsch einer Fee muss man sich gut überlegen  und man darf ihn nicht verraten sonst geht er nicht in Erfüllung ;)', 'Was soll ich sagen? Ich bin ein wenig durchgedreht, tierlieb und ein Riese mit 1,82 m.', '#006600', 112),
(341, 80, 9, 'Maid', NULL, 2012, 'Maid bin ich geworden weil ich quasi genötigt wurde von zwei Freundinnen. Als ich dann ein Seminar besucht habe und so herzlich aufgenommen wurde habe ich unglaublich viel Spaß gehabt und viel gelernt. Den Gästen einen schönen Tag zu bereiten macht mich glücklich :3', '2013-08-14', 'Löwe', '1,82', 'Meine Hobbys sind die Showgruppen in denen ich Mitglied bin also singen und tanzen und außerdem schwimmen und kochen', 'Lasagne', 'Ich liebe Eiscrem aber mein absoluter Favorit sind Erdbeeren in  weißer Schokolade ', 'Mein Lieblingstier ist schwierig auszuwählen, da ich so viele mag, aber ich denke ich mag wildtiere am meisten, wie zum Beispiel den Wolf oder den Luchs. Sie sind wunderschön anzusehen, wild und frei <3', 'Ich wäre auf jeden Fall ein Psiana, denn meine beste Freundin ist ein Nachtara <3 Wir machen alles zusammen.', NULL, 'In einer anderen Welt zu leben wäre bestimmt aufregend. Die Welt von Avatar (auch wenn es kein Anime ist) würde mich besonders reizen, weil ich gerne wüsste welches Element ich wohl bändigen würde (mein Tipp ist ja Wasser aber wer weiß).', 'Ein spezielles Magical Girl habe ich nicht im Sinn. Doch vermutlich hätte ich Heilfähigkeiten, denn ich bin eine wandelnde Apotheke und ein Verbandskasten.', 'In Vergnügungsparks findest du mich immer an der schnellsten und wildesten Achterbahn. Ich liebe die schnelle Fahrt und schreie wie ein kleines Mädchen.', 'Den Wunsch einer Fee muss man sich gut überlegen  und man darf ihn nicht verraten sonst geht er nicht in Erfüllung ;)', 'Was soll ich sagen? Ich bin ein wenig durchgedreht, aber tierlieb. Und außerdem bin ich ein Riese mit 1,82 m.', '#006600', 112),
(342, 72, 12, 'Maid', NULL, 2012, 'Ich finde es toll in einer süßen Uniform mit süßen Maids zusammen zu arbeiten, in einem süßen Cafe :)  Mir macht es einfach total Spaß (^.^)//', '2013-09-12', 'Jungfrau', '1,69', 'Singen, tanzen, camwhoring, Cosplay, shoppen, Zeit mit meinen Liebsten verbringen, zeichnen und malen, Schauspiel, Japanisch lernen...und und und...', 'Zu viel! ^.~', 'Schokolade mit Macadamianüssen und japanisches Konfekt mit Bohnenpaste *__*', 'Ich liebe sooo viele Tiere! Im Moment habe ich ein Meerschweinchen und einen Kater :)', 'Woingenau. Dann könnte ich immer im Heißluftballon fliegen +__+ yeah! ', NULL, 'Ich würde gerne im wandelnden Schloss leben >///< Das wäre schön und aufregend *^* ', 'Natürlich Sailor Moon >_< Weil sie lustig, hübsch und süß ist und dann auch noch ihren Traumann an ihrer Seite hat. Was will man mehr ^.~  ', 'Bei der Zuckerwatte! ', 'Dass alle Menschen glücklich sind :) ', 'Ich bin ein verplantes, kreatives Persönchen, dass meistens ziemlich aufgedreht ist :0.  Meine Stärke ist meine gute Laune (^-^) Ich mache gerne Quatsch und freue mich immer, neue Leute kennenzulernen. Aber gefährlich bin ich auch...habe mal Kung Fu gemacht waaahh~~ .`__´.  Kampf-Maid-Power! (>.<)', '#ce9b02', 112),
(343, 72, 13, 'Maid', NULL, 2012, 'Ich finde es toll in einer süßen Uniform mit süßen Maids zusammen zu arbeiten, in einem süßen Cafe :)  Mir macht es einfach total Spaß (^.^)//', '2013-09-12', 'Jungfrau', '1,69', 'Singen, tanzen, camwhoring, Cosplay, shoppen, Zeit mit meinen Liebsten verbringen, zeichnen und malen, Schauspiel, Japanisch lernen...und und und...', 'Zu viel! ^.~', 'Schokolade mit Macadamianüssen und japanisches Konfekt mit Bohnenpaste *__*', 'Ich liebe sooo viele Tiere! Im Moment habe ich ein Meerschweinchen und einen Kater :)', 'Woingenau. Dann könnte ich immer im Heißluftballon fliegen +__+ yeah! ', NULL, 'Ich würde gerne im wandelnden Schloss leben >///< Das wäre schön und aufregend *^* ', 'Natürlich Sailor Moon >_< Weil sie lustig, hübsch und süß ist und dann auch noch ihren Traumann an ihrer Seite hat. Was will man mehr ^.~  ', 'Bei der Zuckerwatte! ', 'Dass alle Menschen glücklich sind :) ', 'Ich bin ein verplantes, kreatives Persönchen. Und ich bin meistens ziemlich aufgedreht :0.  Meine Stärke ist meine gute Laune (^-^) Ich mache gerne Quatsch und freue mich immer, neue Leute kennenzulernen. Aber gefährlich bin ich auch...habe mal Kung Fu gemacht waaahh~~ .`__´.  Kampf-Maid-Power! (>.<)', '#ce9b02', 112),
(344, 71, 8, 'Maid', NULL, 2012, 'Anfang 2011 war ich das erste mal  im Lucky Chocolate Maid Café und ich fand die Atmosphäre da so toll und die Kleider waren auch so süß :D da wollte ich unbedingt mitmachen und auch mal die andere Seite der Con sehen :)', '2013-04-12', 'Widder', '1,58', 'Kochen <3', 'Alles was schmeckt (derzeitiger Favorit: Bulgogi <3)', 'EIS, POPCORN! *^* :D', 'Löwe :) er ist halt der König der Tiere ;P', 'Ich wäre gern ein Vulpix: süß, klein, trotzdem eigensinnig, temperamentvoll und nicht leicht zu erobern ;) und wenn es jemanden mag, dann auch von ganzem Herzen <33', NULL, 'One Piece *^* aber auch hier in der realen Welt wird es nie zu langweilig :D', 'Es ist kein typisches Magical Girl, aber ich wäre gerne Buttercup :DD Sie ist stark, sehr frech, kann gemein sein, aber im Herzen ist sie sehr lieb <3', 'An den Imbissbuden :DDDD und an den Zuckerwaren (Zuckerwatte und Schokoäpfel FTW *^*) xD <3', 'Dass meine Familie und Freunde gesund bleiben und dass ich glücklich bin :3', 'Ich bin die kleine Umi, die unheimlich gerne isst. Ich freue mich euch im Café zu bedienen <3', '#058d41', 112),
(345, 81, 8, 'Maid', NULL, 2012, 'Ich bin Maid geworden, weil es mir Spaß macht, Kuchen zu backen, zu dekorieren und euch damit eine Freude zu machen. Außerdem kann man immer süße Kleider tragen und neue Leute kennenlernen. Zusätzlich ein nicht zu vergessener wichtiger Punkt: In so einem großen und tollen Maid Café zu arbeiten ist einfach nur eine super Erfahrung!', '2013-06-25', 'Krebs', '1,60', 'Nähen, Videospiele, Lesen', 'Wackelpudding, Erdbeeren, Fruchtzwerge', 'Schokokekse! *nomnomnom* Die überleben bei mir nie lange. Und ansonsten gerne alle Arten von Obst, das ist auch süß, macht aber nicht so dick :3', 'Eigentlich war es immer das Pferd. Ist es auch noch... aber in letzter Zeit bin ich seltsam addicted zu Tiger. Sie sind so flauschig *-* Ich hätte gern einen, wenn der nicht so groß werden würde.', 'Ich liebe alle Katzenpokemon (und Pummelluff). Am liebsten wäre ich ein Evoli, weil es so wandelbar ist wie ich selbst es bin.', NULL, 'Am besten gefallen mir mittelalterlich angehauchte Welten so wie in Claymore. Da würde ich mich, glaube ich, ziemlich wohl fühlen. Ich mag den rustikalen Charme und die mittelalterliche Kleidung sehr gerne und auch wenn die angenehmen Sachen der Neuzeit mir doch fehlen würden: ich nehm auch ein Bett aus Stroh <3', 'Ich war nie ein großer Magical Girls Fan, aber eine Serie hab ich dann doch gesehen und das war DoReMi. Und ich liebe Sofie! Sie ist einfach... genau wie ich :) ein bisschen sturköpfig aber immer für ihre Freunde da. Daher mag ich sie so gerne.', 'In der größten und schnellsten Achterbahn. Ich bin ein kleiner Adrenalinjunkie und könnte den ganzen Tag nur damit fahren.', 'Ganz egoistisch Unsterblichkeit. Auf der Welt gibt es so viel zu entdecken und ein Leben reicht gar nicht aus, um alles zu sehen. Und das finde ich so schade, dass ich gerne noch ein Leben und noch eins dran hängen möchte.', 'Ich bin Bibi und freue mich euch mit allerlei Kuchen den Tag versüßen zu dürfen :3. Und falls einmal eine Erdbeere auf eurer Torte fehlt, dann war ich es vielleicht, denn ich liebe Erdbeeren!', '#dbb7ff', 112),
(346, 81, 9, 'Maid', NULL, 2012, 'Ich bin Maid geworden, weil es mir Spaß macht, Kuchen zu backen, zu dekorieren und euch damit eine Freude zu machen. Außerdem kann man immer süße Kleider tragen und neue Leute kennenlernen. Zusätzlich ein nicht zu vergessener wichtiger Punkt: In so einem großen und tollen Maid Café zu arbeiten ist einfach nur eine super Erfahrung!', '2013-06-25', 'Krebs', '1,60', 'Nähen, Videospiele, Lesen', 'Wackelpudding, Erdbeeren, Fruchtzwerge', 'Schokokekse! *nomnomnom* Die überleben bei mir nie lange. Und ansonsten gerne alle Arten von Obst, das ist auch süß, macht aber nicht so dick :3', 'Eigentlich war es immer das Pferd. Ist es auch noch... aber in letzter Zeit bin ich seltsam addicted zu Tiger. Sie sind so flauschig *-* Ich hätte gern einen, wenn der nicht so groß werden würde.', 'Ich liebe alle Katzenpokemon (und Pummelluff). Am liebsten wäre ich ein Evoli, weil es so wandelbar ist wie ich selbst es bin.', NULL, 'Am besten gefallen mir mittelalterlich angehauchte Welten so wie in Claymore. Da würde ich mich, glaube ich, ziemlich wohl fühlen. Ich mag den rustikalen Charme und die mittelalterliche Kleidung sehr gerne und auch wenn die angenehmen Sachen der Neuzeit mir doch fehlen würden: ich nehm auch ein Bett aus Stroh <3', 'Ich war nie ein großer Magical Girls Fan, aber eine Serie hab ich dann doch gesehen und das war DoReMi. Und ich liebe Sofie! Sie ist einfach... genau wie ich :) ein bisschen sturköpfig aber immer für ihre Freunde da. Daher mag ich sie so gerne.', 'In der größten und schnellsten Achterbahn. Ich bin ein kleiner Adrenalinjunkie und könnte den ganzen Tag nur damit fahren.', 'Ganz egoistisch Unsterblichkeit. Auf der Welt gibt es so viel zu entdecken und ein Leben reicht gar nicht aus, um alles zu sehen. Und das finde ich so schade, dass ich gerne noch ein Leben und noch eins dran hängen möchte.', 'Ich bin Bibi und freue mich euch mit Kuchen den Tag zu versüßen :3. Und falls einmal eine Erdbeere auf eurer Torte fehlt, dann war ich es vielleicht, denn ich liebe Erdbeeren!', '#dbb7ff', 112),
(347, 77, 7, 'Maid', NULL, 2012, 'Weil ich Spaß an kreativer Arbeit, Mode und schön garnierten Süßigkeiten habe. ^^', '2013-12-20', 'Schütze', '1,68', 'Sport, zeichnen & kreatives Gestalten, etwas mit Freunden unternehmen, Sprachen lernen, reisen', 'Spinat & Lachs, Ramen, Okonomiyaki, gedünstetes oder gegrilltes Gemüse', 'Eiscreme & Joghurt, mitteldunkle Schokolade, Käsekuchen & Cup Cakes, Weihnachtsplätzchen, Lakritz… und zum Trinken: Chocolate Frappé', 'Füchse & Wölfe, sowie die domestizierte Version: Hunde. Sie sind hochintelligent, sie sind schnell, sie sind geheimnisvoll, gefährlich und trotzdem der beste Freund des Menschen, treu und stark. Ihr Fell ist weich und flauschig und der berühmte Hundeblick ist einfach unwiderstehlich. ', 'Ein Fuchs-PokéMon, ob nun Vulpix, Evoli oder eine ihrer Weiterentwicklungen, weil ich Hunde super süß finde, aber das Geheimnisvolle an Katzen bewundere und Füchse beide Eigenschaften in sich vereinen. ', NULL, 'In der Fluch der Karibik Welt *trollolol* :D', 'Ich wäre lieber eine Revolverheldin wie Revy aus Black Lagoon. >:D', 'In der Wildwasserbahn! ', 'Ich möchte beamen und mich dadurch an verschiedene Orte teleportieren können – wie Son Goku. Nie wieder mit überfüllten Bussen oder Zügen fahren müssen, nie wieder an Bahnhöfen mit zwielichtigen Gestalten rumgammeln müssen, mich nie wieder über die Bahn ärgern, nie wieder eine Party absagen, weil man nachts nicht mehr nach Hause käme. Reisen an jeden Ort der Welt, ohne Hotel- oder Flugkosten, denn man kann ja jederzeit nach Hause.  DAS wäre die absolute Freiheit!! ', 'Ich bin lebenshungrig und wissbegierig und gerne unterwegs. Auérdem würde ich am liebsten die ganze Welt bereisen, weil ich mehr von diesem wunderschönen Planeten sehen und begreifen will: verschiedene Kulturen, fremde Gerüche und Geräusche, ungewöhnliche Früchte, faszinierende Tiere, bunte Blumen und grüne Pflanzen, den blauen Himmel, das weite Meer, den Wind im Haar.  Ich liebe Freiheit und Athentisches, Farben und Lebensfreude.  Kreative Schaffensprozesse faszinieren mich, ob mit Stift & Papier, Lebensmitteln, Stoff, der Kamera oder am PC.   An sich bin ich eher eine ruhige Person, die lieber erst beobachtet, die Dinge hinterfragt und sich ihr eigenes Bild macht, bevor sie vorschnell handelt. Andererseits kann ich aber auch furchtbar spontan, abgedreht und verrückt sein. Doch ich genieße auch faule und gemütliche Tage, ob zu Hause oder in einem guten Café. <3 ', '#66cafc', 112),
(348, 77, 8, 'Maid', NULL, 2012, 'Weil ich Spaß an kreativer Arbeit, Mode und schön garnierten Süßigkeiten habe. ^^', '2013-12-20', 'Schütze', '1,68', 'Sport, zeichnen & kreatives Gestalten, etwas mit Freunden unternehmen, Sprachen lernen, reisen', 'Spinat & Lachs, Ramen, Okonomiyaki, gedünstetes oder gegrilltes Gemüse', 'Eiscreme & Joghurt, mitteldunkle Schokolade, Käsekuchen & Cup Cakes, Weihnachtsplätzchen, Lakritz… und zum Trinken: Chocolate Frappé', 'Füchse & Wölfe, sowie die domestizierte Version: Hunde. Sie sind hochintelligent, sie sind schnell, sie sind geheimnisvoll, gefährlich und trotzdem der beste Freund des Menschen, treu und stark. Ihr Fell ist weich und flauschig und der berühmte Hundeblick ist einfach unwiderstehlich. ', 'Ein Fuchs-PokéMon, ob nun Vulpix, Evoli oder eine ihrer Weiterentwicklungen, weil ich Hunde super süß finde, aber das Geheimnisvolle an Katzen bewundere und Füchse beide Eigenschaften in sich vereinen. ', NULL, 'In der Fluch der Karibik Welt *trollolol* :D', 'Ich wäre lieber eine Revolverheldin wie Revy aus Black Lagoon. >:D', 'In der Wildwasserbahn! ', 'Ich möchte beamen und mich dadurch an verschiedene Orte teleportieren können – wie Son Goku. Nie wieder mit überfüllten Bussen oder Zügen fahren müssen, nie wieder an Bahnhöfen mit zwielichtigen Gestalten rumgammeln müssen, mich nie wieder über die Bahn ärgern, nie wieder eine Party absagen, weil man nachts nicht mehr nach Hause käme. Reisen an jeden Ort der Welt, ohne Hotel- oder Flugkosten, denn man kann ja jederzeit nach Hause.  DAS wäre die absolute Freiheit!! ', 'Ich bin lebenshungrig, wissbegierig und gerne unterwegs. Auérdem würde ich am liebsten die ganze Welt bereisen, weil ich mehr von diesem wunderschönen Planeten sehen und begreifen will: verschiedene Kulturen, fremde Gerüche und Geräusche, ungewöhnliche Früchte, faszinierende Tiere, bunte Blumen und grüne Pflanzen, den blauen Himmel, das weite Meer, den Wind im Haar.  Ich liebe Freiheit und Athentisches, Farben und Lebensfreude.  Kreative Schaffensprozesse faszinieren mich, ob mit Stift & Papier, Lebensmitteln, Stoff, der Kamera oder am PC.   An sich bin ich eher eine ruhige Person, die lieber erst beobachtet, die Dinge hinterfragt und sich ihr eigenes Bild macht, bevor sie vorschnell handelt. Andererseits kann ich aber auch furchtbar spontan, abgedreht und verrückt sein. Doch ich genieße auch faule und gemütliche Tage, ob zu Hause oder in einem guten Café. <3 ', '#66cafc', 112),
(349, 49, 8, 'Maid', NULL, 0, 'Ich bin Maid geworden um mich neu zu fordern, neue Leute kennen zu lernen und einfach nur Spaß zu haben :D', '1991-07-16', 'Krebs', '1,65', 'Cosplay, Showgruppe D.A.N.G.O, singen', 'Salat, Thunfisch/Lachs Onigiri, Pilze', 'Kinderpingui und HariboSpaghetti', 'Mein Lieblings- Landsäugetiere bzw. -Tiere sind katzenartige. ich bin mit Katzen aufgewachsen und deswegen verrückt nach Vertretern der Katzenfamilie ^^ Mein Liebstes Meerestier ist der Orca. Ich hab früher sehr oft Free Willy geguckt und träume oft davon einmal mit einem Orca zu schwimmen :3', 'Ich wäre ein Nachtara  weil ich einfach ein Nachtmensch bin und Katzen und den Mond liebe oder ich wäre ein Ampharos, weil es einfach mein Lieblings Elektro-Pokémon ist welches ich, wenn es denn geht immer in meinem Team habe ^_^', NULL, 'Es gibt so viele tolle Welten o.o Digimon, Pokemon, Fairy Tail...', 'Da ist erstmal die frage wer jetz alles zum Magicalgirl zählt aber Blair aus Soul Eater oder Erza Scarlet aus Fairy Tail.', 'Überall und Nirgendwo am besten hat man meine Handynummer xD', 'Ich würde mir wünschen endlich meinen Traumberuf als Tierpflegerin ausüben zu können ^^', 'Ich bin lustig, aufgeweckt, kontaktfreudig, kreativ und hilfsbereit.', '#12b600', 112),
(350, 46, 7, 'Maid', NULL, 2014, ' Ich liebe es zu cosplayen und Maid zu sein erfüllt mich in meinem Hobby. Es macht Spaß zu sehen wie glücklich die Kunden sind und die gemeinsame Arbeit ist wundervoll.', '2013-10-16', 'Waage', '1,60', ' Zeichnen, tanzen, Videos machen & cosplayen', 'Kuchen', 'Erdbeertörtchen', 'Mehrere, Wolf & weißer Löwe, (Katzen&Panda) Sie sind im Rudel und treu zu ihren Kameraden, es sind schöne und stolze Tiere. Weiße Löwen sind selten und stolz - wunderschöne Tiere.', 'Pikachu, weil meine Freunde und Kollegen mich so nennen und es immer treu ist', NULL, 'Chobits / Vampire Knight', 'Kagome (Inuyasha), weil sie immer versucht Ihre Freunde zu beschützen und stets an ihrer Stärke arbeitet.', 'An den Ständen wo man Plüschis gewinnen kann ;)', 'Gesundheit für alle, die ich liebe!', 'Hallo ich bin Lisa, bin gerne kreativ und liebe Süßes und niedliche Tiere. Aber wer auch nicht? Ich freue mich auf euren Besuch <3', '#bf111b', 112),
(351, 47, 7, 'Maid', NULL, 2013, 'Es war eine spontane Entscheidung :)', '2013-08-10', 'Löwe', '1,63', 'Schlafen, Fotos machen und mit meiner Katze kuscheln *-*', 'Crêpe mit Kinderschokolade *-*', 'Schoki :3', 'Katzen sind so wundervoll, weil.. öhm .. ich habe schon immer Katzen geliebt :)', 'Pika Pika-chuuuu, weil es süß ist und das erste Pokemon war, das ich knuffig fand :3', NULL, 'One Piece :3 ein Traumabenteuer :D', 'Ich würde sagen Ichigo aus Tokyo Mew Mew :3 einfach weil der Charakter mir etwas ähnlich ist und ich Katzen über alles liebe *^*', 'Auf der Wildwasser Achterbahn oder auf so Kleinkinder Karussells :D ', 'Man soll Wünsche erst verraten wenn sie wahr geworden sind, ansonsten bringt das doch unheil, oder nicht? u.u', 'Ich bin Chooko und liebe Schokolade *-*. Und mein Name Chooko ist absichtlich mit k geschrieben :D', '#309eaf', 112);
