(32, 'Page', '2013-08-27 19:20:15', '2013-09-07 20:50:51', 'to-do', 'To Do', NULL, '<p>News:</p>\n<p>ersten paar zeilen mit Button "Weiterlesen"</p>\n<p>Möglicher Rahmen um Subnav</p>\n<p> </p>\n<p>bild für anzahl der jahre in Maidholder</p>', NULL, NULL, NULL, NULL, 0, 0, 10, 0, 0, NULL, 'Inherit', 'OnlyTheseUsers', 9, 0),
