INSERT INTO `sitetree_live` (`ID`, `ClassName`, `Created`, `LastEdited`, `URLSegment`, `Title`, `MenuTitle`, `Content`, `MetaTitle`, `MetaDescription`, `MetaKeywords`, `ExtraMeta`, `ShowInMenus`, `ShowInSearch`, `Sort`, `HasBrokenFile`, `HasBrokenLink`, `ReportClass`, `CanViewType`, `CanEditType`, `Version`, `ParentID`) VALUES
(1, 'HomePage', '2013-08-21 12:48:06', '2013-09-15 14:20:56', 'home', 'Startseite', NULL, '<h1><strong>Okaerinasai Mase Goshujin-Sama</strong></h1>\n<p>Im Maid Café "Lucky Chocolate" kannst du dich von einem rund 40 köpfigen Team aus süßen Mädchen in die Welt japanischer Maid Cafés entführen lassen. Für den süßen Zahn ist gesorgt: Kuchen, Torten und andere Leckereien werden mit viel Liebe von unseren Maids für dich verziert und ganz wie in Japan kannst du auch gegen unsere Maids in kleinen Minispielen antreten und gewinnen!</p>\n<p>La<img class="left" style="float: left; border: none; margin: 0;" title="&lt;3" src="assets/Uploads/image2.png" alt="image2" height="393" width="224">sse dich vom Entertainment Programm mitziehen: In Maid Café "Lucky Chocolate" bieten dir unsere Maids Gesangs- und Tanzeinlagen! Bei einer Tasse Tee oder Kakao kannst du unsere talentierten Maids beim Gitarrenspiel zuhören und vielleicht wird dir die ein odere andere Maid nach einer gewonnenen Runde Jan Ken Pon (Schnick Schnack Schnuck) auch Acapella etwas vorsingen. Neugierig geworden? Dann lass dir einen Besuch bei uns nicht entgehen!</p>\n<p> Das "Lucky Chocolate" Maid Cafe ist zugleich das Eventcafe der Dokomi in Düsseldorf (<a href="www.dokomi.de">www.dokomi.de</a>) und hauptsächlich dort vertreten. Zu besonderen Anlässen veranstalten unsere Maids auch eigene Events. So hast du die Möglichkeit uns rund um das Jahr besuchen zu kommen! Unsere News findest du in der Kategorie "Neuigkeiten" oder auf der "Lucky Chocolate" eigenen Facebook Fanpage.</p>\n<p>Auch außerhalb von Events hat unser Maid Cafe viel zu bieten. Denn so hast du die Möglichkeit an vielen verschiedenen Gewinnspielen teilzunehmen, um zum Beispiel bei der Umsetzung unserer Ideen mitzuwirken oder einige Fotos und Preise zu erhaschen. Auch so war es unseren "Lucky Chocolate" Maids möglich unser neues Maid Kleid zu designen!</p>\n<p>Solltest du daran Interesse haben "Lucky Chocolate" in Form von Spenden zu unterstützen, kannst du dich gerne per E-Mail an unsere Maids wenden.</p>\n<p><span class="null">Viel Spaß auf unserer Homepage!<br></span></p>', NULL, NULL, NULL, NULL, 1, 1, 1, 0, 0, NULL, 'Inherit', 'OnlyTheseUsers', 18, 0),
(4, 'ErrorPage', '2013-08-21 12:48:08', '2013-09-07 20:44:58', 'seite-nicht-gefunden', 'Seite nicht gefunden', NULL, '<p>Entschuldigung, möglicherweise versuchst du eine Seite zu erreichen, die nicht existiert.</p>\n<p>Bitte überprüfe die Schreibweise der URL, die du versucht hast zu erreichen und versuche es noch einmal.</p>', NULL, NULL, NULL, NULL, 0, 0, 8, 0, 0, NULL, 'Inherit', 'OnlyTheseUsers', 3, 0),
(5, 'ErrorPage', '2013-08-21 12:48:09', '2013-09-07 20:45:18', 'serverfehler', 'Serverfehler', NULL, '<p>Entschuldigung, bei der Bearbeitung deiner Anfrage ist ein Problem aufgetreten.</p>', NULL, NULL, NULL, NULL, 0, 0, 9, 0, 0, NULL, 'Inherit', 'OnlyTheseUsers', 3, 0),
(11, 'Page2', '2013-08-22 12:20:36', '2013-09-01 10:09:44', 'impressum', 'Impressum', NULL, '<p><strong>Angabe nach § 5 TMG und § 55 RStV:</strong></p>\n<p>André Stenzel<br>Tonhallenstraße 21<br>47051 Duisburg</p>\n<p>Kontakt:</p>\n<p>E-Mail: a.stenzel92@web.de</p>\n<p><strong>Haftung für Inhalte</strong></p>\n<p>Die Inhalte unserer Seiten wurden mit größter Sorgfalt erstellt. Für die Richtigkeit, Vollständigkeit und Aktualität der Inhalte können wir jedoch keine Gewähr übernehmen. Als Diensteanbieter sind wir gemäß § 7 Abs.1 TMG für eigene Inhalte auf diesen Seiten nach den allgemeinen Gesetzen verantwortlich. Nach §§ 8 bis 10 TMG sind wir als Diensteanbieter jedoch nicht verpflichtet, übermittelte oder gespeicherte fremde Informationen zu überwachen oder nach Umständen zu forschen, die auf eine rechtswidrige Tätigkeit hinweisen. Verpflichtungen zur Entfernung oder Sperrung der Nutzung von Informationen nach den allgemeinen Gesetzen bleiben hiervon unberührt. Eine diesbezügliche Haftung ist jedoch erst ab dem Zeitpunkt der Kenntnis einer konkreten Rechtsverletzung möglich. Bei Bekanntwerden von entsprechenden Rechtsverletzungen werden wir diese Inhalte umgehend entfernen.</p>\n<p><strong>Haftung für Links</strong></p>\n<p>Unser Angebot enthält Links zu externen Webseiten Dritter, auf deren Inhalte wir keinen Einfluss haben. Deshalb können wir für diese fremden Inhalte auch keine Gewähr übernehmen. Für die Inhalte der verlinkten Seiten ist stets der jeweilige Anbieter oder Betreiber der Seiten verantwortlich. Die verlinkten Seiten wurden zum Zeitpunkt der Verlinkung auf mögliche Rechtsverstöße überprüft. Rechtswidrige Inhalte waren zum Zeitpunkt der Verlinkung nicht erkennbar. Eine permanente inhaltliche Kontrolle der verlinkten Seiten ist jedoch ohne konkrete Anhaltspunkte einer Rechtsverletzung nicht zumutbar. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Links umgehend entfernen.</p>\n<p><strong>Urheberrecht</strong></p>\n<p>Die durch die Seitenbetreiber erstellten Inhalte und Werke auf diesen Seiten unterliegen dem deutschen Urheberrecht. Die Vervielfältigung, Bearbeitung, Verbreitung und jede Art der Verwertung außerhalb der Grenzen des Urheberrechtes bedürfen der schriftlichen Zustimmung des jeweiligen Autors bzw. Erstellers. Downloads und Kopien dieser Seite sind nur für den privaten, nicht kommerziellen Gebrauch gestattet. Soweit die Inhalte auf dieser Seite nicht vom Betreiber erstellt wurden, werden die Urheberrechte Dritter beachtet. Insbesondere werden Inhalte Dritter als solche gekennzeichnet. Sollten Sie trotzdem auf eine Urheberrechtsverletzung aufmerksam werden, bitten wir um einen entsprechenden Hinweis. Bei Bekanntwerden von Rechtsverletzungen werden wir derartige Inhalte umgehend entfernen.</p>\n<p><strong>Datenschutz</strong></p>\n<p>Die Nutzung unserer Webseite ist in der Regel ohne Angabe personenbezogener Daten möglich. Soweit auf unseren Seiten personenbezogene Daten (beispielsweise Name, Anschrift oder eMail-Adressen) erhoben werden, erfolgt dies, soweit möglich, stets auf freiwilliger Basis. Diese Daten werden ohne Ihre ausdrückliche Zustimmung nicht an Dritte weitergegeben.</p>\n<p>Wir weisen darauf hin, dass die Datenübertragung im Internet (z.B. bei der Kommunikation per E-Mail) Sicherheitslücken aufweisen kann. Ein lückenloser Schutz der Daten vor dem Zugriff durch Dritte ist nicht möglich.</p>\n<p>Der Nutzung von im Rahmen der Impressumspflicht veröffentlichten Kontaktdaten durch Dritte zur Übersendung von nicht ausdrücklich angeforderter Werbung und Informationsmaterialien wird hiermit ausdrücklich widersprochen. Die Betreiber der Seiten behalten sich ausdrücklich rechtliche Schritte im Falle der unverlangten Zusendung von Werbeinformationen, etwa durch Spam-Mails, vor.</p>\n<p> </p>\n<p><strong>Datenschutzerklärung für die Nutzung von Facebook-Plugins (Like-Button)</strong></p>\n<p>Auf unseren Seiten sind Plugins des sozialen Netzwerks Facebook, 1601 South California Avenue, Palo Alto, CA 94304, USA integriert. Die Facebook-Plugins erkennen Sie an dem Facebook-Logo oder dem "Like-Button" ("Gefällt mir") auf unserer Seite. Eine Übersicht über die Facebook-Plugins finden Sie hier: <a href="http://developers.facebook.com/docs/plugins/" target="_blank">http://developers.facebook.com/docs/plugins/</a>.<br> Wenn Sie unsere Seiten besuchen, wird über das Plugin eine direkte Verbindung zwischen Ihrem Browser und dem Facebook-Server hergestellt. Facebook erhält dadurch die Information, dass Sie mit Ihrer IP-Adresse unsere Seite besucht haben. Wenn Sie den Facebook "Like-Button" anklicken während Sie in Ihrem Facebook-Account eingeloggt sind, können Sie die Inhalte unserer Seiten auf Ihrem Facebook-Profil verlinken. Dadurch kann Facebook den Besuch unserer Seiten Ihrem Benutzerkonto zuordnen. Wir weisen darauf hin, dass wir als Anbieter der Seiten keine Kenntnis vom Inhalt der übermittelten Daten sowie deren Nutzung durch Facebook erhalten. Weitere Informationen hierzu finden Sie in der Datenschutzerklärung von facebook unter <a href="http://de-de.facebook.com/policy.php" target="_blank"> http://de-de.facebook.com/policy.php</a></p>\n<p>Wenn Sie nicht wünschen, dass Facebook den Besuch unserer Seiten Ihrem Facebook-Nutzerkonto zuordnen kann, loggen Sie sich bitte aus Ihrem Facebook-Benutzerkonto aus.</p>', NULL, NULL, NULL, NULL, 0, 1, 10, 0, 0, NULL, 'Inherit', 'OnlyTheseUsers', 4, 0),
(12, 'ContactPage', '2013-08-22 12:23:58', '2013-09-01 10:08:51', 'kontakt', 'Kontakt', NULL, '<p> </p>\n<p> Habt ihr Fragen, Wünsche oder Anregungen?</p>\n<p> Möchtet ihr uns für eure Convention buchen?</p>\n<p> Oder möchtet ihr sogar selber eine Maid werden?</p>\n<p> Dann seid ihr hier richtig! Schreibt uns euer Anliegen und wir werden euch so schnell wie möglich antworten! :D</p>', NULL, NULL, NULL, NULL, 1, 1, 5, 0, 0, NULL, 'Inherit', 'OnlyTheseUsers', 7, 0),
(13, 'UserDefinedForm', '2013-08-22 12:26:01', '2013-09-07 20:39:28', 'kontakt', 'Kontakt', NULL, '<p>Wenn dir etwas ganz besonders am Herzen liegt, schick uns einfach deine Nachricht :) Ob allgemeine Fragen, Feedback, Verbesserungsvorschläge bezüglich unseres Maidcafes, etc. - wir freuen uns immer auf deine Meinung :D!</p>\n<p>$UserDefinedForm</p>', NULL, NULL, NULL, NULL, 1, 1, 1, 0, 0, NULL, 'Inherit', 'Inherit', 5, 12),
(14, 'UserDefinedForm', '2013-08-22 12:26:15', '2013-08-22 12:46:25', 'buchen', 'Buchen', NULL, '<p>Bucht das Lucky Chocolate Team jetzt für eure Convention, Firmenfeier oder andere Events!<br>Wir leiten oder sind Teil eures Maid Cafes, können frei in der Bedienung oder Küche einsetzbar sein.<br>Ihr braucht noch Werbestände für eure Convention? Wir kommen gerne bei euch vorbei um zu werben!<br>Auch auf der Bühne sind wir einsetzbar! Wir lernen jedes Jahr einen Maidtanz für die DoKomi, den wir auch bei euch präsentieren können! Andere Ideen? Schreibe in das freie Feld einfach deine Wünsche an uns!<br>Du möchtest bestimmte Maids? Frage nach ob unsere Maids für dein Event frei sind und buche deine Traummaids!<br>Wir bitten darum besonders bei Conventions anzugeben, ob es ein Budget für Fahrtkosten, Eintrittskarten, Übernachtung und Leistung geben wird.<br>Da wir uns selber finanzieren, ist es uns sonst evtl. nicht möglich euch euren Maidwunsch zu erfüllen! &lt;3<br>Liebe Grüße, euer Maidteam<br><br></p>\n<p>$UserDefinedForm</p>', NULL, NULL, NULL, NULL, 1, 1, 2, 0, 0, NULL, 'Inherit', 'Inherit', 3, 12),
(15, 'UserDefinedForm', '2013-08-22 12:26:31', '2013-08-23 12:31:15', 'bewerben', 'Bewerben', NULL, '<p>Du wolltest schon immer mal in einem Maid Cafe arbeiten?<br> Dann bist du bei uns genau richtig!<br><br>Wir bieten Dir:<br>- ein großes, freundliches Cafe auf der Dokomi mit Terasse<br> - ein süßes Team, das zwar etwas chaotisch aber total liebenswert ist<br> - von Zeit zur Zeit Jobangebote für Privatfirmen oder andere Conventions<br> - aktive Mitarbeit im Internet für unser Cafe<br> - Lernseminare, Besprechungsseminare, Fotoshootings und frei Kuchen ;D<br> - ein Wochenendticket für die Dokomi und Vergünstigungen beim Hotel<br> - eine gute Zusammenarbeit mit unserem Host Cafe der Dokomi<br> - die Gelegenheit auf der Bühne und im Cafe vor Publikum zu performen<br> - Zusammenarbeit mit erfahrenen Maids und Gastronomiearbeitern<br> - Spaß, Stress, Schweiß X''D</p>\n<p>Unsere Voraussetzungen: <br>- Du wohnst in Deutschland, vorzugsweise im NRW Bereich <br> - Du bist bereit 2~3x im Jahr zum Seminar oder Fotoshooting nach NRW zu reisen<br> (Unser Hauptstützpunkt liegt im VRR Bereich, Nähe Düsseldorf)<br> - Du bist freundlich, teamfähig und unterhaltsam<br> - Du bist bereit die Maiderstausstattung zu zahlen (ca. 60,00 €)<br> - Du erklärst Dich damit einverstanden, dass du als Maid auf der Dokomi kein <br> Geld als Bezahlung erhälst. Nur bei gebuchten Events ist es möglich bezahlt zu werden<br> - Du bist mindestens 16 Jahre alt<br> - Du hast einen Facebookaccount</p>\n<p>$UserDefinedForm</p>', NULL, NULL, NULL, NULL, 1, 1, 1, 0, 0, NULL, 'Inherit', 'Inherit', 7, 12),
(16, 'ArticleHolder', '2013-08-23 13:16:05', '2013-09-01 16:43:37', 'neuigkeiten', 'Neuigkeiten', NULL, '<p>Hier findest du unsere aktuellen Neuigkeiten, Events und Gewinnspiele!<br>Du hast die Möglichkeit unsere Neuigkeiten zu <a href="neuigkeiten/rss">abonnieren</a> um immer auf dem neuesten Stand zu bleiben.</p>\n<p>Hier siehst du unsere letzten Einträge:</p>', NULL, NULL, NULL, NULL, 1, 1, 2, 0, 0, NULL, 'Inherit', 'OnlyTheseUsers', 10, 0),
