(170, 1, 10, 1, 3, 3, 'HomePage', '2013-08-21 12:48:06', '2013-09-07 23:48:18', 'home', 'Startseite', NULL, '<h1><strong>Okaerinasai Mase Goshujin-Sama</strong></h1>\n<p>Im Maid Café "Lucky Chocolate" kannst du dich von einem rund 40 köpfigen Team aus süßen Mädchen in die Welt japanischer Maid Cafés entführen lassen. Für den süßen Zahn ist gesorgt: Kuchen, Torten und andere Leckereien werden mit viel Liebe von unseren Maids für dich verziert und ganz wie in Japan kannst du auch gegen unsere Maids in kleinen Minispielen antreten und gewinnen!</p>\n<p>Lasse dich vom Entertainment Programm mitziehen: In Maid Café "Lucky Chocolate" bieten dir unsere Maids Gesangs- und Tanzeinlagen! Bei einer Tasse Tee oder Kakao kannst du unsere talentierten Maids beim Gitarrenspiel zuhören und vielleicht wird dir die ein odere andere Maid nach einer gewonnenen Runde Jan Ken Pon (Schnick Schnack Schnuck) auch Acapella etwas vorsingen. Neugierig geworden? Dann lass dir einen Besuch bei uns nicht entgehen!</p>\n<p>Das "Lucky Chocolate" Maid Cafe ist zugleich das Eventcafe der Dokomi in Düsseldorf (<a href="www.dokomi.de">www.dokomi.de</a>) und hauptsächlich dort vertreten. Zu besonderen Anlässen veranstalten unsere Maids auch eigene Events. So hast du die Möglichkeit uns rund um das Jahr besuchen zu kommen! Unsere News findest du in der Kategorie "Neuigkeiten" oder auf der "Lucky Chocolate" eigenen Facebook Fanpage.</p>\n<p>Auch außerhalb von Events hat unser Maid Cafe viel zu bieten. Denn so hast du die Möglichkeit an vielen verschiedenen Gewinnspielen teilzunehmen, um zum Beispiel bei der Umsetzung unserer Ideen mitzuwirken oder einige Fotos und Preise zu erhaschen. Auch so war es unseren "Lucky Chocolate" Maids möglich unser neues Maid Kleid zu designen!</p>\n<p>Solltest du daran Interesse haben "Lucky Chocolate" in Form von Spenden zu unterstützen, kannst du dich gerne per E-Mail an unsere Maids wenden.</p>\n<p><span class="null">Viel Spaß auf unserer Homepage!<br></span></p>', NULL, NULL, NULL, NULL, 1, 1, 1, 0, 0, NULL, 'Inherit', 'OnlyTheseUsers', 0),
